INSERT INTO `wced_entry` VALUES (13109, "pa-", "711", "<entry page=""711"" id=""13109""><form id=""pa-"" lang=""ceb"">pa-</form>
<hom>
<sense n=""0""><trans> derivational verb-forming affix to which inflectional affixes are added without morphophonemic alternation. </trans>
</sense>
<sense n=""1""><number>1</number><trans> referring to actions one has caused s.o. to do (either to s.t. else or to oneself). </trans>
<eg><i lang=""ceb"">Palútù ta ug sud-an,</i><trans> Let’s have s.o. prepare (<ix>lútù</ix>) some food. </trans></eg>
<eg><i lang=""ceb"">Palutúun nátù si Maríya,</i><trans> Let’s have Maria cook. </trans></eg>
<eg><i lang=""ceb"">Ipalútù ang sud-an,</i><trans> Have the food cooked. </trans></eg>
<eg><i lang=""ceb"">Patupi ta,</i><trans> Let’s get a haircut (cause s.o. to cut hair [<ix>tupi</ix>]). </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> added to adjectives. </trans>
</sense>
<sense n=""1a1""><number>1a1</number><trans> have s.o. make s.t. [adj.]. </trans>
<eg><i lang=""ceb"">Ipaitum ang ákung sapátus,</i><trans> Have s.o. dye my shoes black. </trans></eg>
</sense>
<sense n=""1a2""><number>1a2</number><trans> have s.t. become [adj.]. </trans>
<eg><i lang=""ceb"">Patambúkun ta ka sa uma,</i><trans> We’ll fatten you up on the farm. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> <ix>added to nouns:</ix> cause s.o. to do [the action that verbs derived from the noun refer to]. </trans>
<eg><i lang=""ceb"">Gustu ka ba pabakyà?</i><trans> You want me to hit you with a wooden slipper (cause me to use the <ix>bakyà</ix>)? </trans></eg>
<eg><i lang=""ceb"">Dì ku paulípun,</i><trans> I will not let myself be made a slave. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <ix>added to doubled adjectives:</ix> pretend to be. </trans>
<eg><i lang=""ceb"">Ayaw pasakitsákit dihà,</i><trans> Don’t pretend to be sick! </trans></eg>
<eg><i lang=""ceb"">Nagpadiyusdiyusnun ang sungáyan,</i><trans> The devil is pretending to be saintly. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <ix>added to nouns:</ix> go to [noun]. </trans>
<eg><i lang=""ceb"">Padaplin ug dì ka gustung hiligsan,</i><trans> Get out of the way if you don’t want to get run over. </trans></eg>
<eg><i lang=""ceb"">Papiliw ba ang ímung sakayan run?</i><trans> Is your boat headed for the shallow waters now?
</trans></eg>
</sense></hom></entry>");
