INSERT INTO `wced_entry` VALUES (13118, "pabilu", "712", "<entry page=""712"" id=""13118""><form id=""pabixlu"" lang=""ceb"">pabílu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>wick</tr> of a lamp. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> drainage, sterile gauze inserted into a wound. </trans>
</sense>
<sense n=""1b""><number>1b</number><trans> <tr>fuse</tr> of dynamite. </trans>
</sense>
<sense n=""2""><number>2</number><trans> cause, agent of intensity. </trans>
<eg><i lang=""ceb"">Siya ang pabílu sa kasámuk sa ámung balay,</i><trans> She is the cause of the troubles in our house. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> put a wick in a lamp, fuse in dynamite, drainage in a dressing. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> give a cause for a quarrel or misunderstanding. </trans>
<eg><i lang=""ceb"">Wà tà tu siya mangísug apan ímu pung gipabilúhan,</i><trans> He wouldn’t have gotten angry if you hadn’t given him cause.
</trans></eg>
</sense></hom></entry>");
