INSERT INTO `wced_entry` VALUES (13127, "pabur", "712", "<entry page=""712"" id=""13127""><form id=""pabur"" lang=""ceb"">pabur</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> advantageous to. </trans>
<eg><i lang=""ceb"">Ang kasabútan pabur kanátù,</i><trans> The agreement is advantageous to us. </trans></eg>
</sense></hom>
<entry><form id=""pabur_sa_haxngin"" lang=""ceb""><abbr expan=""pabur"" type=""lemma"">—</abbr> sa hángin</form>
<hom>
<sense n=""0""><trans> have the wind at one’s back. </trans>
<eg><i lang=""ceb"">Túlin ang sakayan kay pabur sa hángin,</i><trans> The boat sails fast when the wind is in back. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> in favor of, on the side of. </trans>
<eg><i lang=""ceb"">Ang disisiyun pabur kang Rimutígi,</i><trans> The decision was in favor of Remotigue. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> within easy reach. </trans>
<eg><i lang=""ceb"">Pagbantay! Kay pabur ka ra ba sa ákung tuu!</i><trans> Watch out! You’re in easy reach of my right hand! </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> move towards. </trans>
<eg><i lang=""ceb"">Iirug-irug ang lamísa pabur sa tuu,</i><trans> Move the table more to the right. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> advantage, concession. </trans>
<eg><i lang=""ceb"">Nangáyù siyag pabur sa kumpári níyang mayur,</i><trans> He asked a favor from his friend who was the mayor. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> port, left side of a ship. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12]</itype><trans> </trans>
</sense>
<sense n=""a""><number>a</number><trans> have the edge or winning trend. </trans>
<eg><i lang=""ceb"">Kusug ming musyágit ug makapabur nag ámung manuk,</i><trans> We shout boisterously when our cock gets the edge. </trans></eg>
</sense>
<sense n=""b""><number>b</number><trans> be in a position to hit, strike well. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> favor, take sides. </trans>
<eg><i lang=""ceb"">Ayawg paburi ang bísag háing grúpu,</i><trans> Don’t take sides with either group. </trans></eg>
</sense></hom></entry>
<entry><form id=""papabur"" lang=""ceb""><abbr expan=""papabur"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> turn a boat to the left side. </trans>
</sense></hom></entry>
<entry><form id=""purpabur"" lang=""ceb""><abbr expan=""purpabur"" type=""lemma"">pur-</abbr></form>
<hom>
<sense n=""0""><trans> please (said in asking a favor). </trans>
<eg><i lang=""ceb"">Purpabur ayaw na kug samúka,</i><trans> Please, don’t bother me any more. </trans></eg>
<eg><i lang=""ceb"">Purpabur ikúhà kug túbig,</i><trans> Please, get me a glass of water. †
</trans></eg>
</sense></hom></entry></entry>");
