INSERT INTO `wced_entry` VALUES (13139, "padpad", "712", "<entry page=""712"" id=""13139""><form id=""padpad"" lang=""ceb"">padpad</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> for wind or water to carry s.t. in the current. </trans>
<eg><i lang=""ceb"">Ang dag-um nga walà makabundak ganíha gipadpad,</i><trans> The rain clouds did not fall a while ago and were dispersed. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> bring s.o. s.w. </trans>
<eg><i lang=""ceb"">Unsang hangína ang mipadpad nímu nganhi?</i><trans> What (wind) brought you here? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> remove s.t. from whatever it was mixed with or stuck to. </trans>
<eg><i lang=""ceb"">Padpára ang amursíku sa ímung sinínà,</i><trans> Pull the burrs from your dress. </trans></eg>
<eg><i lang=""ceb"">Padpárig pasì nang bugas,</i><trans> Pick out the unhusked grains from the rice.
</trans></eg>
</sense></hom></entry>");
