INSERT INTO `wced_entry` VALUES (13149, "pag-", "713", "<entry page=""713"" id=""13149""><form id=""pag-"" lang=""ceb"">pag-</form>
<hom>
<sense n=""0""><trans> prefix added to most bases which take the verbal inflectional affixes. </trans>
</sense>
<sense n=""1""><number>1</number><trans> forming imperatives (used esp. after <ix>ayaw</ix> ‘don’t’). <ix>short forms:</ix> <bx>g</bx>, or <bx>ug</bx>. </trans>
<eg><i lang=""ceb"">Ayaw paglakaw (ug lakaw, glakaw),</i><trans> Don’t go away. </trans></eg>
<eg><i lang=""ceb"">Ayaw siya pagpatya,</i><trans> Don’t kill him. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> forming infinitives. </trans>
<eg><i lang=""ceb"">Gisugdan níya pagtágik ang íyang bálak,</i><trans> He began to compose his poem. </trans></eg>
<eg><i lang=""ceb"">Arun sa pagbutyag sa íyang tinagúan,</i><trans> In order to make his secrets public. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> forming nouns meaning the action of [do]ing. </trans>
<eg><i lang=""ceb"">Dílì maáyu ang pagpalabi,</i><trans> It’s no good to do things to excess. </trans></eg>
<eg><i lang=""ceb"">Nakabungkag sa ílang pagpúyù,</i><trans> Destroyed their life together. </trans></eg>
<eg><i lang=""ceb"">Ang pagburunda sa simbahan dì na kinahanglan,</i><trans> It is no longer necessary to wear a veil to church. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> forming words which mean ‘when [so-and-so] was done’. </trans>
<eg><i lang=""ceb"">Pag-abut nákù sa balay, mau say íyang paglakaw,</i><trans> When I arrived at the house, he left.
</trans></eg>
</sense></hom></entry>");
