INSERT INTO `wced_entry` VALUES (13155, "paga-an", "713", "<entry page=""713"" id=""13155""><form id=""paga-an"" lang=""ceb"">paga-an</form>
<hom>
<sense n=""0""><trans> local passive durative affix, future. (<ix>Past</ix>: <bx>gina-an</bx>. <ix>Subjunctive</ix>: <bx>paga-i</bx>.) <ix>For the use of the durative passive forms see the entry under</ix> <bx>paga-un</bx>. </trans>
