<eg><i lang=""ceb"">Ang maung hitabù nahímung ginahisgútan sa mga táwu,</i><trans> That event became the subject of conversation for these people. </trans></eg>
<eg><i lang=""ceb"">Pagaabunuhi ang lubi,</i><trans> Keep putting fertilizer to the coconut trees every once in a while.
