INSERT INTO `wced_entry` VALUES (13157, "pagakpak", "713", "<entry page=""713"" id=""13157""><form id=""pagakpak"" lang=""ceb"">pagakpak</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> sound produced by clapping, clapping of wooden sandals, clopping of horses, and the like. </trans>
<eg><i lang=""ceb"">Limpiyang pagakpak,</i><trans> Shoeshine done by slapping a piece of cloth over the shoes with a popping sound. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> instrument for making a clapping sound. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> make a clapping, clip-clop sound. </trans>
<eg><i lang=""ceb"">Ikaw bay mupagakpak sa humayan?</i><trans> Will you sound the clapper in the rice field? </trans></eg>
<eg><i lang=""ceb"">Nagpagakpak ang ílang bakyà pag-ági níla,</i><trans> Their wooden sandals made a clapping sound as they passed by. </trans></eg>
<eg><i lang=""ceb"">Pagakpákan nátù ang nakadaug,</i><trans> Let’s applaud the winner.
</trans></eg>
</sense></hom></entry>");
