INSERT INTO `wced_entry` VALUES (13167, "paga-un", "714", "<entry page=""714"" id=""13167""><form id=""paga-un"" lang=""ceb"">paga-un</form>
<hom>
<sense n=""0""><trans> direct passive durative affix future time. (Past: <bx>gina-</bx>. <ix>Subjunctive</ix>: <bx>paga-a</bx>.) <ix>Literary style except in Southern Leyte and Bohol where it is colloquial</ix> (<ix>with the dialectal prefix</ix> <bx>a-</bx> <ix>substituting for</ix> <bx>paga-</bx>). <ix>Forms with</ix> <bx>paga-un</bx> <ix>are used to refer to actions repeated at intervals or after preposed forms meaning ‘it is good, proper, necessary,’ and the like</ix>. </trans>
<eg><i lang=""ceb"">Ságad pagabasáhun níya ang Biblíya sa dì pa matúlug,</i><trans> She usually reads the Bible before she goes to sleep. </trans></eg>
<eg><i lang=""ceb"">Unsay ángay nátung pagabuhátun?</i><trans> What is the proper thing to do? <ix>Forms with</ix> <bx>gina-</bx> <ix>refer to an action which goes on in time</ix>. </trans></eg>
<eg><i lang=""ceb"">Ginapasundáyag pa gihápun ang mga dúlà ni Piyuks,</i><trans> Piux’s dramas are still performed. <ix>The forms with</ix> <bx>paga-a</bx> <ix>are used when the subjunctive is required, or for the imperatives, in contexts referring to repeated or enduring actions</ix>. </trans></eg>
<eg><i lang=""ceb"">Ang humay adtu pagadagamíha sa búus,</i><trans> They take the rice on the stalks to the granary, and there they get the rice grains (as they need them).
</trans></eg>
</sense></hom></entry>");
