INSERT INTO `wced_entry` VALUES (13176, "pagka-1", "714", "<entry page=""714"" id=""13176""><form id=""pagka-"" lang=""ceb"">pagka-<sub>1</sub></form>
<hom>
<sense n=""0""><trans> affix added to most bases which occur with the verbal inflections in one or more of the following usages. </trans>
</sense>
<sense n=""1""><number>1</number><trans> forming a noun meaning the action of having had [so-and-so] done or happen to it. </trans>
<eg><i lang=""ceb"">Maáyu ang pagkalútù níya sa kík,</i><trans> He baked the cake well. (Lit. The action of his having baked the cake was good.) </trans></eg>
<eg><i lang=""ceb"">Ang kabílin wà maángay pagkabáhin,</i><trans> The inheritance was not divided fairly. </trans></eg>
<eg><i lang=""ceb"">Dalì rang pagkamatay,</i><trans> He died quickly. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> forming a noun meaning ‘having done [so-and-so]’. </trans>
<eg><i lang=""ceb"">Hustu ra giyud ang pagkaabut ninyu kay dáyun na námung paniudtu,</i><trans> You arrived just in time because we are about to eat <corr sic=""dinner"">lunch</corr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> forming a word meaning when [so-and-so] had happened, had been done. </trans>
<eg><i lang=""ceb"">Pagkapalit níya sa pán,</i><trans> When he had bought the bread (lit. when the bread was bought). </trans></eg>
<eg><i lang=""ceb"">Pagkakità níya niánà,</i><trans> When he saw that. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> forming an infinitive referring to completed action or the coming into a state. </trans>
<eg><i lang=""ceb"">Walà maángay pagkabáhin ang kabílin,</i><trans> The inheritance had not been fairly divided. </trans></eg>
<eg><i lang=""ceb"">Misamut siya pagkahubug,</i><trans> He got all the more drunk.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (13176, "pagka-", "pagka-", "s", "");
INSERT INTO `wced_entry` VALUES (13177, "pagka-2", "714", "<entry page=""714"" id=""13177""><form id=""pagka-2"" lang=""ceb"">pagka-<sub>2</sub></form>
<hom>
<sense n=""0""><trans> prefix added to adjectives to form exclamations. </trans>
<eg><i lang=""ceb"">Pagkadakù bayà niíning syudára,</i><trans> Gee! What a huge city this is! </trans></eg>
<eg><i lang=""ceb"">Pagkabuútan giyud nímu,</i><trans> How awfully nice of you!
</trans></eg>
</sense></hom></entry>");
