INSERT INTO `wced_entry` VALUES (13178, "pagka-a(←)", "714", "<entry page=""714"" id=""13178""><form id=""pagka-alx"" lang=""ceb"">pagka-a(←)</form>
<hom>
<sense n=""0""><trans> forms with the prefix <ix>pagka-<sub>1</sub></ix> and <ix>pagka-<sub>2</sub></ix> to which <bx>-a(←)</bx> has been added. </trans>
</sense>
<sense n=""1""><number>1</number><trans> prefix added to adjectives to form exclamations, with a greater degree of emotion or intensity of the exclamation than <ix>pagka-<sub>2</sub></ix>. </trans>
<eg><i lang=""ceb"">Pagkadakúa sa ílang bag-ung balay!</i><trans> Their new house is absolutely tremendous! </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> form meaning particular action of having done [so-and-so]. </trans>
<eg><i lang=""ceb"">Hustu giyud tung pagkaabúta <pb n=""715""/>ninyu,</i><trans> Your arrival (lit. that particular arrival of yours) was just at the right time.
</trans></eg>
</sense></hom></entry>");
