INSERT INTO `wced_entry` VALUES (13182, "pagtung", "715", "<entry page=""715"" id=""13182""><form id=""pagtung"" lang=""ceb"">pagtung</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[BN; a12]</itype><trans> <tr>burn</tr>, <tr>scorch</tr>. </trans>
<eg><i lang=""ceb"">Napagtung siya sa kaínit sa adlaw,</i><trans> He got burned by the heat of the sun. </trans></eg>
