<sense n=""2""><number>2</number> <itype>[B12; a12]</itype><trans> for popcorn to fail to pop. </trans>
<eg><i lang=""ceb"">Napagtung ang bitì ug walà mubukad,</i><trans> The corn turned brown and did not pop. </trans></eg>
</sense></hom>
