INSERT INTO `wced_entry` VALUES (13184, "pagu", "715", "<entry page=""715"" id=""13184""><form id=""paxgu"" lang=""ceb"">págu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> <tr>welsh on a bet</tr>, <tr>delay payment</tr>. </trans>
<eg><i lang=""ceb"">Kinsay nagpágu sa tanang pusta nga nahánaw man lang?</i><trans> Who ran away without paying the bets? </trans></eg>
<eg><i lang=""ceb"">Ákù lang úsà ning pagúhun (ipágu) nga pusta,</i><trans> I won’t pay my bet for the time being. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> amount which one failed to pay. </trans>
<eg><i lang=""ceb"">Pilay ímung págu kaníya?</i><trans> How big an amount did you welsh on? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> comeuppance, just deserts. </trans>
<eg><i lang=""ceb"">Mau kanay págu nímu,</i><trans> That’s what you get!
</trans></eg>
</sense></hom></entry>");
