INSERT INTO `wced_entry` VALUES (13197, "pagya, pagya", "715", "<entry page=""715"" id=""13197""><form id=""pagya_pagyaq"" lang=""ceb"">pagya, pagyà</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> way of referring to s.o. in a humorous, but indirect way. </trans>
<eg><i lang=""ceb"">Layágun ug dunggan si Pidru mu nay nahímung pagyà,</i><trans> Pedro has large ears so that became the way they used to refer to him. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5c]</itype><trans> refer to s.t. by making a joke about it but not naming it. </trans>
<eg><i lang=""ceb"">Napagyà karun nga ang dalágang mamatay pabawnan ug alhu,</i><trans> It is a common joke to say that when a spinster dies, they should put a pestle at her side. </trans></eg>
<eg><i lang=""ceb"">Gipagyà (gipagyáan) námù siyang pahak,</i><trans> We used to refer to him as scar head.
</trans></eg>
</sense></hom></entry>");
