INSERT INTO `wced_entry` VALUES (13202, "pahat", "716", "<entry page=""716"" id=""13202""><form id=""paxhat"" lang=""ceb"">páhat</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3S; ac]</itype><trans> divide food, property, money into allocations. </trans>
<eg><i lang=""ceb"">Ang gubyirnu mupáhat nímu ug dúsi iktariyas,</i><trans> The government will allocate you twelve hectares. </trans></eg>
<eg><i lang=""ceb"">Paháta ang kík sa lima ka báhin,</i><trans> Divide the cake up into five portions. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; b6]</itype><trans> get a portion, allocation. </trans>
<eg><i lang=""ceb"">Nakapahat (napahatan) siyag dakùdakù kay sa ákù,</i><trans> He managed to get a slightly larger allocation than mine. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>allocation</tr>, <tr>portion</tr>. </trans>
</sense></hom>
<entry><form id=""paxhatanan"" lang=""ceb""><abbr expan=""páhatanan"" type=""lemma"">-anan</abbr></form>
