INSERT INTO `wced_entry` VALUES (13222, "pahunpahun", "716", "<entry page=""716"" id=""13222""><form id=""pahunpaxhun"" lang=""ceb"">pahunpáhun</form>
<hom role=""n""><pos>n</pos>
