INSERT INTO `wced_entry` VALUES (13235, "paka-", "717", "<entry page=""717"" id=""13235""><form id=""paka-"" lang=""ceb"">paka-</form>
<hom>
<sense n=""0""><trans> derivational verb forming prefix. </trans>
</sense>
<sense n=""1""><number>1</number><trans> added to adjectives or nouns referring to a person in a certain capacity, forming verbs which occur with the durative active affixes (<ix>mag-<sub>1</sub></ix>) and the direct passive affixes (<ix>-un<sub>1</sub></ix>). With the durative active affixes, verbs with <ix>paka-</ix> mean ‘pretend to be, act like [so-and-so]’ and with the direct passive affixes they mean ‘consider as [so-and-so]’ or ‘treat like [so-and-so]’. </trans>
<eg><i lang=""ceb"">Nagpakadakung asyindíru,</i><trans> Pretended to be a big plantation owner. </trans></eg>
<eg><i lang=""ceb"">Nagpakatigúlang,</i><trans> Acted like an old man. </trans></eg>
<eg><i lang=""ceb"">Ángayng pakabathaláun ang bána sa asáwa,</i><trans> A wife should consider her husband a god. </trans></eg>
<eg><i lang=""ceb"">Gipakasayun lang nímu ang kaminyúun,</i><trans> You think marriage is an easy thing. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> added to most verbs to form verbs with potential meanings (see <ix>maka-<sub>1</sub></ix>) to which the durative active affixes (<ix>mag-<sub>1</sub></ix>) are added. <pb n=""718""/>This form is literary and usually refers to several agents. </trans>
<eg><i lang=""ceb"">Nagpakapusta sila sa manuk nga napildi,</i><trans> They bet on a cock that lost. </trans></eg>
<eg><i lang=""ceb"">Nagpakabatì sila apan nagpakabungulbúngul,</i><trans> They heard but remained silent. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> added to a few verbs meaning see, hear, smell, sense, and the like to form verbs which mean ‘cause s.o. to hear, etc.’. Verbs with <ix>paka-</ix> of this sort occur only with the potential active affixes. </trans>
<eg><i lang=""ceb"">Suntuk nga nakapakakità ug aniníput,</i><trans> A blow that made him see stars. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> added to roots referring to a state to form verbs meaning ‘bring oneself or s.o. else into [such-and-such] a state purposely.’ Verbs with this <ix>paka-</ix> occur with the active durative and local passive affixes. </trans>
<eg><i lang=""ceb"">Nagpakabúhì siya álang sa íyang mga anak,</i><trans> He lived for his children. </trans></eg>
<eg><i lang=""ceb"">Nagpakaúlaw kug panghangyù,</i><trans> I lowered myself to beg. </trans></eg>
<eg><i lang=""ceb"">Gipakamatyan níya ang yútang natawhan,</i><trans> He gave his life (lit. caused himself to die) for the sake of his country. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> added to roots referring to a time of day or life: stay s.w. until [such-and-such] a time. Usually with (→). </trans>
<eg><i lang=""ceb"">Magpakatigulang ku dinhing dapíta, piru adtu ku magpakamatay sa ámù,</i><trans> I will stay here until my old age, but I will go home to die. </trans></eg>
<eg><i lang=""ceb"">Didtu sa barku pagpakakaadláwun,</i><trans> Stay on the boat until daybreak. †
</trans></eg>
</sense></hom></entry>");
