<eg><i lang=""ceb"">Nagkapákang ang ílang úlu,</i><trans> Their heads slammed into each other. </trans></eg>
<eg><i lang=""ceb"">Pakngag hínay ang silsil,</i><trans> Tap the chisel lightly. </trans></eg>
