<eg><i lang=""ceb"">Pakngun ta ka run ug dílì ka mutúu,</i><trans> I’ll rap you on the head if you don’t obey me. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to tap or drive s.t. in. </trans>
