INSERT INTO `wced_entry` VALUES (13257, "pakig-(←)", "719", "<entry page=""719"" id=""13257""><form id=""pakig-lx"" lang=""ceb"">pakig-(←)</form>
<hom>
<sense n=""0""><trans> (<ix>see</ix> <xr lang=""ceb"" target=""#makig-""><sc>makig-</sc></xr> <ix>for illustrations of the tense forms of the active voice</ix>.) Derivational verb forming affix, added to almost all roots which refer to an action and also to bases with <ix>-ay</ix>, (<ix>-anay</ix>) to form verbs which mean ‘engage s.o. in [such-and-such] an action’. </trans>
<eg><i lang=""ceb"">Ayaw pakigkítà níyag usab,</i><trans> Don’t go see him again. </trans></eg>
<eg><i lang=""ceb"">Dakù ang ákung tingúhà pakiglákaw níya sa plása,</i><trans> I am very intent on taking her for a walk in the plaza. </trans></eg>
<eg><i lang=""ceb"">Ayaw pakigsumbagay ug gamay,</i><trans> Don’t pick a fight with s.o. smaller than you.
</trans></eg>
</sense></hom></entry>");
