INSERT INTO `wced_entry` VALUES (13258, "pakig-an(←)", "719", "<entry page=""719"" id=""13258""><form id=""pakig-anlx"" lang=""ceb"">pakig-an(←)</form>
<hom>
<sense n=""0""><trans> local passive future prefix added to some bases with a prefix <ix>pakig-</ix>. (<ix>Past</ix>: <bx>gipakig-an(←)</bx>. <ix>Subjunctive</ix>: <bx>pakig-i</bx>.) </trans>
<eg><i lang=""ceb"">Pakigsabútan ku siya,</i><trans> I will make an agreement with him. </trans></eg>
<eg><i lang=""ceb"">Gipakigbungúlan ku siya,</i><trans> I got onto bad terms with him. </trans></eg>
<eg><i lang=""ceb"">Ayaw siya pakigkitái,</i><trans> Don’t go to see her.
</trans></eg>
</sense></hom></entry>");
