INSERT INTO `wced_entry` VALUES (13286, "paku", "720", "<entry page=""720"" id=""13286""><form id=""pakuq"" lang=""ceb"">pakù</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>wings</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>ventral fin</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> means or instrument to achieve s.t.: money, credentials, ability (colloquial). </trans>
<eg><i lang=""ceb"">Dì ku makapamyista kay wà man kuy pakù,</i><trans> I can’t attend the fiesta because I don’t have the money for the fare. </trans></eg>
<eg><i lang=""ceb"">Dì ka mauwaw nga murikumindǎr níya kay hustu nà sa pakù,</i><trans> You need not be ashamed to recommend her because she has the qualifications. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>armpit</tr> (humorous euphemism). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> put wings on. </trans>
</sense></hom>
<entry><form id=""pakuqpaxkuq"" lang=""ceb"">pakùpákù</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> upper part of back just below the shoulder. </trans>
</sense></hom></entry>
<entry><form id=""pamakuq"" lang=""ceb""><abbr expan=""pamakù"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> <tr>grow wings</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pak-an"" lang=""ceb"">pak-an</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>winged</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>devilish</tr>. </trans>
<eg><i lang=""ceb"">Pak-an bayà nímung dakù!</i><trans> You are a devil.
</trans></eg>
</sense></hom></entry></entry>");
