INSERT INTO `wced_entry` VALUES (13288, "pakug", "720", "<entry page=""720"" id=""13288""><form id=""pakug"" lang=""ceb"">pakug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; c]</itype><trans> bang the head against s.t., bang heads together. </trans>
<eg><i lang=""ceb"">Pakúgun ta mu kay paríhu mung sad-an,</i><trans> I’m going to bang your heads together. You are both guilty. </trans></eg>
<eg><i lang=""ceb"">Íyang ipakug ang íyang úlu sa halígi ug sapútun,</i><trans> He bangs his head against the post when he is angry. </trans></eg>
</sense></hom>
<entry><form id=""pakugpaxkug"" lang=""ceb"">pakugpákug</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; c1]</itype><trans> for things hanging loosely to bang repeatedly against each other. </trans>
<eg><i lang=""ceb"">Magpakugpákug ang mga buwad nga binítay ug hangínun,</i><trans> The dried fish which are hung up knock against each other when the wind blows.
</trans></eg>
</sense></hom></entry></entry>");
