INSERT INTO `wced_entry` VALUES (13297, "pakyas", "721", "<entry page=""721"" id=""13297""><form id=""pakyas"" lang=""ceb"">pakyas</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>failed</tr>, come to nothing. </trans>
<eg><i lang=""ceb"">Pakyas na ang ákung panganduy,</i><trans> My dreams have come to naught. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>fail</tr>, make s.t. fail. </trans>
<eg><i lang=""ceb"">Dílì aku mupakyas nímu,</i><trans> I will not fail you. </trans></eg>
<eg><i lang=""ceb"">Dílì ka mapakyas,</i><trans> You cannot fail. </trans></eg>
<eg><i lang=""ceb"">Ayawg pakyása ang ákung tingúhà,</i><trans> Don’t cause my aspirations to fail. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; b5]</itype><trans> fail to do s.t. </trans>
<eg><i lang=""ceb"">Gipakyas (gipakyásan) níya ang íyang pagsimba,</i><trans> He missed going to church. </trans></eg>
</sense></hom>
<entry><form id=""kapakyasan"" lang=""ceb""><abbr expan=""kapakyasan"" type=""lemma"">ka-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>failure</tr>.
</trans>
</sense></hom></entry></entry>");
