INSERT INTO `wced_entry` VALUES (13298, "pakyaw", "721", "<entry page=""721"" id=""13298""><form id=""pakyaw"" lang=""ceb"">pakyaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> hire for the whole job, buy the whole lot. </trans>
<eg><i lang=""ceb"">Nagpakyaw mig usa ka trák pára sa ámung ikskursiyun,</i><trans> We chartered a bus for our excursion. </trans></eg>
<eg><i lang=""ceb"">Magpakyaw tag panday paghímug aparadur,</i><trans> Let’s hire a carpenter to make the cabinet, paying him for the job. </trans></eg>
<eg><i lang=""ceb"">Pakyáwun ku ang pagtúkud sa balay,</i><trans> I’ll have the house constructed, paying a lump sum for the whole job. </trans></eg>
<eg><i lang=""ceb"">Pakyáwun ku ang tanang ságing basta itúgut ug barátu,</i><trans> I’ll buy all your bananas if you let me have them cheap. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; a12]</itype><trans> finish a game by making all the points consecutively without changing balls or hands. </trans>
<eg><i lang=""ceb"">Ug aku nay makasirbi, pakyáwun giyud nákù,</i><trans> If I serve, I’ll do it to the end of the game (the other side won’t get the ball again). </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a12]</itype><trans> skip doing s.t. one regularly does. </trans>
<eg><i lang=""ceb"">Way bugas, pakyáwun na lang nátù ang átung paniudtu,</i><trans> We don’t have any rice. Let’s just skip our dinner. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. hired or paid for as a whole. </trans>
<eg><i lang=""ceb"">Dílì ni inadlaw. Pakyaw ni,</i><trans> We are paid for doing the whole job, not on a daily basis. </trans></eg>
</sense></hom>
<entry><form id=""mamamakyaw_mamakyaxwan"" lang=""ceb""><abbr expan=""mamamakyaw"" type=""lemma"">maN-r-</abbr>, <abbr expan=""mamakyáwan"" type=""lemma"">maN-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> whole lot buyer or worker of jobs under agreement.
</trans>
</sense></hom></entry></entry>");
