<sense n=""4""><number>4</number> <itype>[A23]</itype><trans> gather fallen coconuts, esp. from plantations not one’s own (humorous—word play on <ix>pamúlak</ix> ‘gather fallen coconuts’ which looks as though the root is <ix>búlak</ix> ‘flower’ [whereas actually the root is <ix>púlak</ix>]).
