INSERT INTO `wced_entry` VALUES (13393, "palispis", "725", "<entry page=""725"" id=""13393""><form id=""palispis"" lang=""ceb"">palispis</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN]</itype><trans> for leaves to start sprouting<corr>.</corr> </trans>
<eg><i lang=""ceb"">Sa tulu ka adlaw mupalispis (mamalispis) na ang pugas,</i><trans> In three days the corn seeds will be sprouting. </trans></eg>
<eg><i lang=""ceb"">Nagpalispis na ang sanga nga íyang gitisuk,</i><trans> The branch of a tree that she planted is beginning to grow leaves. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> short, thin sprouting leaf, not fully grown. </trans>
</sense>
<sense n=""2""><number>2</number><trans> sheath of a stem of the bamboo plant. </trans>
</sense>
<sense n=""3""><number>3</number><trans> sheath wings, usually of insects. </trans>
</sense>
<sense n=""4""><number>4</number><trans> caudal fin of the squid. </trans>
</sense></hom>
<entry><form id=""pinalispis"" lang=""ceb""><abbr expan=""pinalispis"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a fraction of s.t. </trans>
<eg><i lang=""ceb"">Pinalispis lang kini sa ímung abilidad,</i><trans> This is only a fraction of your ability.
</trans></eg>
</sense></hom></entry></entry>");
