INSERT INTO `wced_entry` VALUES (13400, "paliyar", "725", "<entry page=""725"" id=""13400""><form id=""paliyar"" lang=""ceb"">paliyar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B6; b4(1)]</itype><trans> for an engine to malfunction. </trans>
<eg><i lang=""ceb"">Sus, nagpaliyar na pud ning kagangkagang!</i><trans> Darn! This rattletrap is breaking down again! </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B6]</itype><trans> for a plan to fail to come out successfully. </trans>
<eg><i lang=""ceb"">Mipaliyar ang ámung sábut nga mangalígù kay nag-ulan,</i><trans> Our plans to go swimming didn’t materialize because it rained. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; c1]</itype><trans> default in payment. </trans>
<eg><i lang=""ceb"">Nakapaliyar kug usa ka instulmin sa pagdaut nákù,</i><trans> I failed to pay one installment when I got sick. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B36]</itype><trans> for one’s health to fail. </trans>
<eg><i lang=""ceb"">Mipaliyar ang íyang láwas tungud sa síging bilar,</i><trans> She kept staying up nights and it ruined her health. </trans></eg>
</sense></hom>
<entry><form id=""palyaxdu_palyaxwu"" lang=""ceb"">palyádu, palyáwu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> malfunctioning. </trans>
</sense>
<sense n=""2""><number>2</number><trans> failing to come out. </trans>
</sense>
<sense n=""3""><number>3</number><trans> defaulting in payments. </trans>
</sense>
<sense n=""4""><number>4</number><trans> failing in health. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> break down.
</trans>
</sense></hom></entry></entry>");
