INSERT INTO `wced_entry` VALUES (13414, "palta", "726", "<entry page=""726"" id=""13414""><form id=""palta"" lang=""ceb"">palta</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> fail to do s.t. </trans>
<eg><i lang=""ceb"">Walà pa ku makapalta sa ákung klási,</i><trans> I never missed a class. </trans></eg>
<eg><i lang=""ceb"">Napalta ug hatud run ang Tayims,</i><trans> The Times wasn’t delivered today. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> break up people fighting. </trans>
<eg><i lang=""ceb"">Gipalta sa pulis ang duha ka batan-un nga nagsinumbagay,</i><trans> The policeman separated the two youngsters who were engaged in a fist fight. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> failure to attend some function. </trans>
</sense>
<sense n=""2""><number>2</number><trans> fail to do s.t. </trans>
<eg><i lang=""ceb"">Way palta ang íyang pagbisíta magabíi,</i><trans> He never failed to visit her in the evening. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> amount less in a score, amount lacking in a count. </trans>
<eg><i lang=""ceb"">Palta úna ug tabla na kamu,</i><trans> One more point and you’ll be even. </trans></eg>
<eg><i lang=""ceb"">Ang ímung ihap kúlang. Palta ug duha,</i><trans> You counted wrong. You lack two. </trans></eg>
</sense></hom>
<entry><form id=""kuxhaq_ug_palta"" lang=""ceb"">kúhà ug <abbr expan=""palta"" type=""lemma"">—</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b(1)]</itype><trans> be held culpable. </trans>
<eg><i lang=""ceb"">Makuháag palta ang mga ginikánan nga kinamatayun nga mukastígu ug anak,</i><trans> Parents can be held culpable if they punish their children too severely. </trans></eg>
</sense></hom></entry>
<entry><form id=""himalta"" lang=""ceb""><abbr expan=""himalta"" type=""lemma"">hiN-</abbr></form>
