INSERT INTO `wced_entry` VALUES (13427, "palung2", "727", "<entry page=""727"" id=""13427""><form id=""palung2"" lang=""ceb"">palung<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> whittle the end of s.t. to make it taper or smooth it. </trans>
<eg><i lang=""ceb"">Gipalungan níya ang pasamánu sa hagdan,</i><trans> He made the edges of the bannister rounded. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> cut the ears so that they hang. </trans>
<eg><i lang=""ceb"">Gipalung ang dalunggan sa bábuy ági ug timailhan,</i><trans> They cut the pig’s ear as a mark. </trans></eg>
