<sense n=""2a""><number>2a</number><trans> cut the cockscomb. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> move the end of a line to make it parallel or directly vertical to s.t. </trans>
<eg><i lang=""ceb"">Gipalungan níya ang linya dapit sa tuu,</i><trans> He moved the line a little to the right. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having an ear that hangs due to injury. </trans>
<eg><i lang=""ceb"">Si Huwan palung,</i><trans> Juan has a dangling ear. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> deformations on the ear. </trans>
</sense></hom>
