INSERT INTO `wced_entry` VALUES (13437, "palut", "727", "<entry page=""727"" id=""13437""><form id=""paxlut"" lang=""ceb"">pálut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> <tr>peel skin off</tr>. </trans>
<eg><i lang=""ceb"">Gipalútan ku na ang mansánas,</i><trans> I peeled the apple. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B2]</itype><trans> for the skin to get chafed. </trans>
<eg><i lang=""ceb"">Napálut (mipálut) ang líug sa kábaw tungud sa yúgu,</i><trans> The yoke chafed the water buffalo’s neck. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AB12]</itype><trans> for land to become bare. </trans>
<eg><i lang=""ceb"">Napálut ang kaumahan kay way ulan,</i><trans> The fields became bare from lack of rain. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A; b5]</itype><trans> shave the head bald. </trans>
<eg><i lang=""ceb"">Akuy mupálut sa ímung úlu ug dì ka magpatupi ánang ímung bítul,</i><trans> I’ll shave your head bald if you don’t get rid of your <corr sic=""beatle"">Beatle</corr> cut. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>peelings</tr>. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> bare of vegetation. </trans>
<eg><i lang=""ceb"">Kanúnay kitang bahaan kay pálut na ang kabukíran,</i><trans> We have constant floods because the mountains have been denuded. </trans></eg>
</sense></hom>
<entry><form id=""paxlut_saxging"" lang=""ceb""><abbr expan=""pálut"" type=""lemma"">—</abbr> ságing</form>
<hom>
<sense n=""0""><trans> <tr>banana peel</tr>, said esp. in stating that s.t. is of no more worth than a banana peel. </trans>
<eg><i lang=""ceb"">Ngánung wà man ku kunsultahi. Unsa man ku, pálut ságing?</i><trans> Why was I not consulted? What am I around here, anyway? Just a piece of furniture? </trans></eg>
</sense></hom></entry>
<entry><form id=""palut"" lang=""ceb""><abbr expan=""palut"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> sorely chafed area. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>scar</tr> on the head. </trans>
<eg><i lang=""ceb"">Nakítà ang palut sa íyang úlu,</i><trans> You can see the scar on his head. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having a bald spot on it. </trans>
<eg><i lang=""ceb"">Ang sal-ing palut ug úlu,</i><trans> The coleto bird has a bald spot on the head.
</trans></eg>
</sense></hom></entry></entry>");
