INSERT INTO `wced_entry` VALUES (13440, "palwa", "727", "<entry page=""727"" id=""13440""><form id=""palwa"" lang=""ceb"">palwa</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> petiole of a palm frond, banana leaf, or similarly-shaped leaves. </trans>
