<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b8]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> grow fronds. </trans>
<eg><i lang=""ceb"">Namalwa (gipamalwáhan) na ang pitsay,</i><trans> The Chinese cabbage has grown leaves. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> gather palm fronds. </trans>
<eg><i lang=""ceb"">Mamalwa tag isugnud,</i><trans> We’ll gather palm fronds for fuel. </trans></eg>
