INSERT INTO `wced_entry` VALUES (13452, "pamilya", "728", "<entry page=""728"" id=""13452""><form id=""pamilya"" lang=""ceb"">pamilya</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>immediate family</tr>, group of closely related people who live together. </trans>
</sense>
<sense n=""2""><number>2</number><trans> large group of related people with the same name. </trans>
<eg><i lang=""ceb"">Ang mga Lúpis dátung pamilya sa Pilipínas,</i><trans> The Lopezes are a rich family in the Philippines. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> belonging to a class or a family. </trans>
<eg><i lang=""ceb"">Kining isdáa pamilya sa mga pági,</i><trans> This fish is in the ray family. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256]</itype><trans> become a member of a certain family by virtue of marriage. </trans>
<eg><i lang=""ceb"">Ayaw lag kaúlaw kay mapamilya ka na námù,</i><trans> Don’t be shy because you are soon going to become a member of our family. </trans></eg>
</sense></hom>
<entry><form id=""dipamilya"" lang=""ceb""><abbr expan=""dipamilya"" type=""lemma"">di-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>family man</tr>. </trans>
<eg><i lang=""ceb"">Lisud sa usa ka dipamilya kun way kapangwartáhan,</i><trans> It is terrible for a person with a family if he has no work. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> man’s undershorts, cut in boxer style. </trans>
</sense>
<sense n=""3""><number>3</number><trans> of a large size, designed for two or more people in a family. </trans>
<eg><i lang=""ceb"">Muskitírung dipamilya,</i><trans> A large-sized mosquito net. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> s.t. done together by all the members of a family. </trans>
<eg><i lang=""ceb"">Dipamilya manan-aw ug sini,</i><trans> See the movie with the whole family. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> wear boxer-style underpants. </trans>
</sense></hom></entry>
<entry><form id=""padri_dipamilya"" lang=""ceb"">padri <abbr expan=""dipamilya"" type=""lemma"">di-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> head of a family.
</trans>
</sense></hom></entry></entry>");
