INSERT INTO `wced_entry` VALUES (13455, "paminaw", "728", "<entry page=""728"" id=""13455""><form id=""pamixnaw"" lang=""ceb"">pamínaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2S; ab2]</itype><trans> <tr>listen</tr>, <tr>hear</tr>. </trans>
<eg><i lang=""ceb"">Mamínaw ta sa nyús,</i><trans> Let’s listen to the news. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A23; a12]</itype><trans> listen, heed. </trans>
<eg><i lang=""ceb"">Dì ka untà maingun ug namínaw pa ka,</i><trans> If you had listened, that wouldn’t have happened to you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a12]</itype><trans> feel, think. </trans>
<eg><i lang=""ceb"">Pamináwun ku lang ug makaadtu ku,</i><trans> I’ll see if I can go. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2S; a12]</itype><trans> watch, keep an eye on. </trans>
<eg><i lang=""ceb"">Pamináwa ra ang balay samtang wà ku dinhi,</i><trans> Watch the house while I’m away. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2S; b5]</itype><trans> look to find out. </trans>
<eg><i lang=""ceb"">Pamínaw didtu ug dúna ba silay bakanti,</i><trans> Go find out if they have any openings. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>feeling</tr>. </trans>
<eg><i lang=""ceb"">Kumusta ang ímung pamínaw karun?</i><trans> How are you feeling now? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>observation</tr>. </trans>
<eg><i lang=""ceb"">Sa ákung pamínaw dílì siya kasalígan,</i><trans> As far as I have noticed, he is not to be trusted. †
</trans></eg>
</sense></hom></entry>");
