INSERT INTO `wced_entry` VALUES (13475, "pan-", "729", "<entry page=""729"" id=""13475""><form id=""paN-"" lang=""ceb"">paN-</form>
<hom>
<sense n=""0""><trans> (<ix>see p. xvi for the meaning of the symbol</ix> <bx>N.</bx> <ix>see</ix> <xr lang=""ceb"" target=""#man-""><sc>maN-</sc></xr> <ix>for illustrations of the tense forms of the active voice</ix>.) </trans>
</sense>
<sense n=""1""><number>1</number><trans> derivational verb forming prefix. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> forming verbs that refer to plural actions: action done by one or more agents to several things, or several agents to one thing, or one (or more) agents to s.t. more than once. </trans>
<eg><i lang=""ceb"">Pangáun na, mga bátà,</i><trans> Come eat, children. </trans></eg>
<eg><i lang=""ceb"">Ikay pangúhà sa mga hinayhay,</i><trans> You be the one to bring the laundry in. </trans></eg>
<eg><i lang=""ceb"">Hinúgay na ug pangusì ánang bat-ána,</i><trans> You’ve been pinching that child for long enough now. </trans></eg>
</sense>
<sense n=""1a1""><number>1a1</number><trans> added to nouns referring to living beings to form verbs meaning ‘catch [such-and-such]’. </trans>
<eg><i lang=""ceb"">Pamangsi,</i><trans> Go catch flying fish (<ix>bangsi</ix>). </trans></eg>
<eg><i lang=""ceb"">Nanginabúhì sila sa pagpangisdà,</i><trans> They live by catching fish. </trans></eg>
</sense>
<sense n=""1a2""><number>1a2</number><trans> do [so-and-so] as an occupation. </trans>
<eg><i lang=""ceb"">Dúgay na níyang pangutsíru,</i><trans> He has been a rig driver (<ix>kutsíru</ix>) for a long time. </trans></eg>
<eg><i lang=""ceb"">Dì ka makakwarta sa pagpangáhuy lang,</i><trans> You cannot get rich by gathering firewood (<ix>káhuy</ix>). </trans></eg>
</sense>
<sense n=""1b""><number>1b</number><trans> forming verbs referring to an energetic action or happening. </trans>
<eg><i lang=""ceb"">Nagpanlugnut ang dalága nga gikidnap,</i><trans> The girl that was being kidnapped struggled to get free. </trans></eg>
<eg><i lang=""ceb"">Gipaningut ku,</i><trans> I am completely drenched with sweat. </trans></eg>
<eg><i lang=""ceb"">Nagpangamay siya iyáwat makit-an,</i><trans> He waved for all he was worth in hopes that he would be seen. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number><trans> added to verbs referring to the action of cleaning, beautifying, and the like to form verbs meaning ‘[do] to oneself’. </trans>
<eg><i lang=""ceb"">Panipilyu uy!</i><trans> Brush your teeth! </trans></eg>
<eg><i lang=""ceb"">Panabun ug maáyu,</i><trans> Soap yourself well. </trans></eg>
<eg><i lang=""ceb"">Ayaw pangìkì,</i><trans> Don’t pick your teeth. </trans></eg>
</sense>
<sense n=""1d""><number>1d</number><trans> added to nouns referring to an event or a place to form verbs meaning ‘attend [such-and-such] an event, go to [such-and-such] a place’. </trans>
<eg><i lang=""ceb"">Pamirnis Santu sa inyu,</i><trans> Spend Good Friday (<ix>Birnis Santu</ix>) at home. </trans></eg>
<eg><i lang=""ceb"">Pangarbun na,</i><trans> Go to the Carbon market now. </trans></eg>
<eg><i lang=""ceb"">Pamista sa ámung lungsud,</i><trans> Come to the fiesta in our town. </trans></eg>
</sense>
<sense n=""1d1""><number>1d1</number><trans> added to other nouns to form verbs. </trans>
<eg><i lang=""ceb"">Ayaw úsà pamána, Pirla,</i><trans> Don’t get married (lit. take a husband—<ix>bána</ix>), Perla. </trans></eg>
<eg><i lang=""ceb"">Hápit siya mamatay pagpanganak,</i><trans> She practically died in childbirth. </trans></eg>
<eg><i lang=""ceb"">Ginadílì ang pagpangíhì dinhi,</i><trans> It’s forbidden to urinate here. </trans></eg>
</sense>
<sense n=""1e""><number>1e</number><trans> added to adj. to form verbs meaning be [adj.]. </trans>
<eg><i lang=""ceb"">Nag-inánay pagpamula ang íyang náwung,</i><trans> His face gradually started getting red all over. </trans></eg>
<eg><i lang=""ceb"">Pagpangínit na sa íyang bukubuku mibákud siya,</i><trans> When his back was warm, he got up. </trans></eg>
</sense>
<sense n=""1f""><number>1f</number><trans> verb forming affix with no ascertainable meaning. </trans>
<eg><i lang=""ceb"">Pangáyù didtu níyag kwarta,</i><trans> Ask for (<ix>káyù</ix>) money from him. </trans></eg>
<eg><i lang=""ceb"">Pananghid úsà ka mulakaw,</i><trans> Say good-bye (<ix>sanghid</ix>) before you leave. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> noun forming affix. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> added to roots which form verbs taking <ix>paN-</ix>: action of [do]ing. </trans>
<eg><i lang=""ceb"">Way kaláki ang pangisdà dinhi,</i><trans> Fishing is no good here. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> instrument for [do]ing. </trans>
<eg><i lang=""ceb"">Panlaba,</i><trans> S.t. to wash with. </trans></eg>
<eg><i lang=""ceb"">Panágat,</i><trans> Fishing equipment. </trans></eg>
<eg><i lang=""ceb"">Panápì,</i><trans> Means of obtaining money. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number><trans> sense of. </trans>
<eg><i lang=""ceb"">Panimhut,</i><trans> Sense of smell.
</trans></eg>
</sense></hom></entry>");
