INSERT INTO `wced_entry` VALUES (13482, "panahun, panahun", "730", "<entry page=""730"" id=""13482""><form id=""panahun_panaxhun"" lang=""ceb"">panahun, panáhun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>weather</tr>. </trans>
<eg><i lang=""ceb"">Dì ta mularga kay dautan ang panahun,</i><trans> We cannot travel because the weather is bad. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>season</tr>, <tr>recurring time</tr>. </trans>
<eg><i lang=""ceb"">Panahun sa ting-ulan,</i><trans> Rainy season. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> time s.t. happened or happens. </trans>
<eg><i lang=""ceb"">Sa panahun sa libirasiyun,</i><trans> In the liberation period. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> times of s.t. </trans>
<eg><i lang=""ceb"">Mahinumdum ka lang sa Diyus panahun sa kalisud,</i><trans> You remember God only in times of hardship. </trans></eg>
<eg><i lang=""ceb"">Natigúlang ku sa dì pa sa ákung panáhun,</i><trans> I became an old man before my time. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <form id=""panahun_diq_axtuq"" lang=""ceb""><abbr expan=""panahun"" type=""lemma"">—</abbr> dì átù</form><trans> we are not the masters of our fate (lit. time is not our own). </trans>
<eg><i lang=""ceb"">Magpaábut ta sa pagbuut sa Ginúu, ang panahun dì átù,</i><trans> Let us wait for what God ordains. We are not the masters of our fate. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> time to do s.t. </trans>
<eg><i lang=""ceb"">Wà na kuy panahun paghulat nímu,</i><trans> I have no more time to wait for you. </trans></eg>
</sense>
<sense n=""5""><number>5</number><trans> <tr>chance</tr>, <tr>occasion</tr>. </trans>
<eg><i lang=""ceb"">Daghan ka pang panahun pag-usab,</i><trans> You still have a lot of chances to reform. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1456; b8]</itype><trans> come at a certain season. </trans>
<eg><i lang=""ceb"">Magpanahun ang mangga; dílì kanúnay,</i><trans> Mangoes come in season. They aren’t always available. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12]</itype><trans> have a chance, time to do. </trans>
<eg><i lang=""ceb"">Ug makapanahun ka, pamisíta sa ámù,</i><trans> If you have time, come visit us.
</trans></eg>
</sense></hom></entry>");
