<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>erase</tr>, <tr>make s.t. unclear</tr>. </trans>
<eg><i lang=""ceb"">Ang maung hitabù dílì mapánas sa ákung panumdúman,</i><trans> That incident cannot be erased from my memory. </trans></eg>
