INSERT INTO `wced_entry` VALUES (13502, "panday", "730", "<entry page=""730"" id=""13502""><form id=""panday"" lang=""ceb"">panday</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>forge</tr>. </trans>
<eg><i lang=""ceb"">Walu ka ispáda ang íyang gipanday,</i><trans> He forged eight swords. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> build s.t. from wood. </trans>
