INSERT INTO `wced_entry` VALUES (13586, "panit", "733", "<entry page=""733"" id=""13586""><form id=""paxnit"" lang=""ceb"">pánit</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>skin</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>peelings</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>bark</tr>. </trans>
</sense>
<sense n=""4""><number>4</number><trans> <tr>leather</tr>, s.t. made of leather. </trans>
</sense>
<sense n=""5""><number>5</number><trans> shell of a shrimp, egg. </trans>
</sense></hom>
<entry><form id=""bukug_ug_paxnit"" lang=""ceb"">bukug ug <abbr expan=""pánit"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>skin and bones</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> skin, peel s.t. </trans>
<eg><i lang=""ceb"">Sayun ang ukban panítan,</i><trans> It is easy to peel a tangerine. </trans></eg>
<eg><i lang=""ceb"">Paníti ang itlug,</i><trans> Take the shell off the egg. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B1256; b6]</itype><trans> for a barber to take too much hair off. </trans>
<eg><i lang=""ceb"">Gipanítan ku sa barbíru,</i><trans> The barber butchered my hair. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> beat s.o. in gambling. </trans>
<eg><i lang=""ceb"">Gipanítan ku sa madyung gabíi,</i><trans> I lost in mahjong last night. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> be trounced in a fight. </trans>
</sense></hom></entry>
<entry><form id=""panit_mu_rag_irug_panit"" lang=""ceb""><abbr expan=""panit"" type=""lemma"">(→)</abbr> mu rag irug panit</form>
<hom>
<sense n=""0""><trans> miserable poor (like a dog with no fur). </trans>
<eg><i lang=""ceb"">Kung wà tay kwarta mu ra tag irug panit,</i><trans> If we don’t have money, we are miserable. </trans></eg>
</sense></hom></entry>
<entry><form id=""pamaxnit"" lang=""ceb""><abbr expan=""pamánit"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>complexion</tr>. </trans>
<eg><i lang=""ceb"">Is-is siyag pamánit,</i><trans> She has smooth, white skin.
</trans></eg>
</sense></hom></entry></entry>");
