INSERT INTO `wced_entry` VALUES (13650, "papa", "735", "<entry page=""735"" id=""13650""><form id=""paqpaq"" lang=""ceb"">pàpà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> bite s.t. or grab it with the teeth without tearing or wounding it. </trans>
<eg><i lang=""ceb"">Maáyu ning irúa sa pangáyam. Dílì mupàpà sa kuhà,</i><trans> This is a good dog for hunting because it just takes the game in its mouth without tearing it. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> for a pig to chew on s.t. without eating it. </trans>
<eg><i lang=""ceb"">Pàpáun sa anay ang íyang pasawan ug dì dáyun mapasawan,</i><trans> A pig will chew at its trough if it is not fed on time. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> slurp up greedily, eat s.t. completely. </trans>
<eg><i lang=""ceb"">Mipàpà ang kaláyu ug ubay-ubayng balay,</i><trans> The fire consumed quite a number of houses.
</trans></eg>
</sense></hom></entry>");
