INSERT INTO `wced_entry` VALUES (13668, "par", "736", "<entry page=""736"" id=""13668""><form id=""paxr"" lang=""ceb"">pár</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a <tr>pair</tr> of s.t. of the same kind. </trans>
<eg><i lang=""ceb"">Mupalit kug tulu ka pár tsinílas,</i><trans> I’ll buy three pairs of slippers. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bottle of liquor and a bottle of soft drink which will be mixed together. </trans>
</sense>
<sense n=""3""><number>3</number><trans> being of the same color or cut. </trans>
<eg><i lang=""ceb"">Pár silag kurbáta, púlus pula,</i><trans> They have matching ties, both red. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; ac]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> wear s.t. which is of the same color or cut as s.o. else’s. </trans>
<eg><i lang=""ceb"">Dì ku mupár nímug sinínà,</i><trans> I don’t want to wear a dress the same style as yours. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be a pair, match. </trans>
<eg><i lang=""ceb"">Maáyung párun ang ítik arun musánay,</i><trans> It would be good to make it a pair of ducks so they can multiply. </trans></eg>
<eg><i lang=""ceb"">Kining bága mauy ipár sa ímung sapátus,</i><trans> This is the bag you should match your shoes with. </trans></eg>
</sense></hom>
<entry><form id=""parpaxr"" lang=""ceb"">parpár</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a hand in mahjong containing two pairs. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> have two pairs, either one of which may allow one to go mahjong.
</trans>
</sense></hom></entry></entry>");
