INSERT INTO `wced_entry` VALUES (13669, "para", "736", "<entry page=""736"" id=""13669""><form id=""para"" lang=""ceb"">para</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b(1)]</itype><trans> <tr>result in</tr>. </trans>
<eg><i lang=""ceb"">Ug unsay ímung parahan, wà kuy lábut,</i><trans> Whatever happens to you, I won’t be responsible. </trans></eg>
<eg><i lang=""ceb"">Unsa may giparahan sa inyung nigusyu?</i><trans> What happened in the end to your business venture? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> chance of winning or succeeding. </trans>
<eg><i lang=""ceb"">May parahan kahà ning átung tím?</i><trans> Think our team has a chance of winning?
</trans></eg>
</sense></hom></entry>");
