INSERT INTO `wced_entry` VALUES (13671, "para2", "736", "<entry page=""736"" id=""13671""><form id=""paxra2"" lang=""ceb"">pára<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2b2]</itype><trans> hail a vehicle or ask the driver to stop. </trans>
<eg><i lang=""ceb"">Pára bay,</i><trans> Stop, driver! </trans></eg>
<eg><i lang=""ceb"">Paráha ang bús kay musakay ku,</i><trans> Stop the bus because I want to get on. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A123P; c1]</itype><trans> discontinue a course of action. </trans>
<eg><i lang=""ceb"">Dílì siya makapára sa íyang pag-inum,</i><trans> He can’t stop his drinking. </trans></eg>
<eg><i lang=""ceb"">Paráhun (ipára) ang átung pinsiyun ug mamatay na aku,</i><trans> If I die my pension will be cut off. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23; b5]</itype><trans> hesitate doing s.t. (usually in negative sentences). </trans>
<eg><i lang=""ceb"">Dílì mupára ug súkul nang batáa bísag kinsa,</i><trans> That child doesn’t hesitate to fight back, no matter who it is. </trans></eg>
<eg><i lang=""ceb"">Wà kuy gipára (giparáhan) sa mga kan-unun,</i><trans> There is no food I hesitate to eat. </trans></eg>
</sense></hom>
<entry><form id=""paraxda"" lang=""ceb""><abbr expan=""paráda"" type=""lemma"">-da</abbr><sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> two-wheeled, horse-drawn <tr>rig</tr> that plies the streets and takes up to four passengers who sit facing each other. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> park a vehicle in a certain place. </trans>
<eg><i lang=""ceb"">Ang íyang giparadáhan gidilì,</i><trans> He parked in a no-parking zone. </trans></eg>
</sense></hom></entry>
<entry><form id=""pamaraxda"" lang=""ceb"">pamaráda</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6(1)]</itype><trans> operate the <ix>paráda</ix>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> rig-driving occupation. </trans>
</sense></hom></entry>
<entry><form id=""paradahan"" lang=""ceb"">paradahan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> vehicle terminal. </trans>
</sense></hom></entry>
<entry><form id=""paradista"" lang=""ceb""><abbr expan=""paradista"" type=""lemma"">-dista</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who drives a <ix>paráda</ix>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B156; a12]</itype><trans> be in this occupation.
</trans>
</sense></hom></entry></entry>");
