INSERT INTO `wced_entry` VALUES (13685, "parak1", "736", "<entry page=""736"" id=""13685""><form id=""parak"" lang=""ceb"">parak<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> counter for things that come in large lumps. </trans>
<eg><i lang=""ceb"">Dakung parak nga pagkababáyi,</i><trans> A huge hulk of a woman. </trans></eg>
<eg><i lang=""ceb"">Mupalit kug bibingkang duha ka parak ug kalamayng usa <pb n=""737""/>ka parak,</i><trans> I will buy two rice cakes and one piece of sugar candy. </trans></eg>
</sense></hom>
