INSERT INTO `wced_entry` VALUES (13707, "parayig", "737", "<entry page=""737"" id=""13707""><form id=""paraxyig"" lang=""ceb"">paráyig</form>
<hom>
<sense n=""0""><trans> (from <ix>daláyig</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> asking for affection, usually by showing affection. </trans>
<eg><i lang=""ceb"">Nagparáyig nang batáa maung gasígig hílak,</i><trans> That child is crying because he is asking for attention. </trans></eg>
<eg><i lang=""ceb"">Ákung giparaygan si Máma arun paadtúun ku sa bayli,</i><trans> I played up to Mother so she would let me go to the dance. </trans></eg>
</sense></hom>
<entry><form id=""pamaraxyig"" lang=""ceb""><abbr expan=""pamaráyig"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> ask for s.t. in an endearing way. </trans>
<eg><i lang=""ceb"">Mamaráyig aku níyag sapátus,</i><trans> I’ll ask her for shoes in a sweet way. </trans></eg>
<eg><i lang=""ceb"">Dúna kuy ipamaráyig nímu, Pri. Ipasúd ring ákung umágad,</i><trans> I have a little favor to ask of you. Help my son-in-law get into the company. </trans></eg>
</sense></hom></entry>
<entry><form id=""paraygun"" lang=""ceb"">paraygun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>affectionate</tr>, demanding of affection. </trans>
<eg><i lang=""ceb"">Paraygun kaáyu ang sinultihan sa mga Ilunggu,</i><trans> The Ilonggos speak in an affectionate tone of voice. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> be <tr>affectionate</tr>, demanding of affection. </trans>
<eg><i lang=""ceb"">Maparaygun ang bátà ug sigíhag kúgus,</i><trans> A child gets to be demanding if <pb n=""738""/>you keep picking him up. </trans></eg>
</sense></hom></entry>
<entry><form id=""parayganay"" lang=""ceb"">parayganay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C]</itype><trans> be affectionate with each other.
</trans>
</sense></hom></entry></entry>");
