INSERT INTO `wced_entry` VALUES (13715, "pariha", "738", "<entry page=""738"" id=""13715""><form id=""parixha"" lang=""ceb"">paríha</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>similar</tr>, <tr>identical</tr> to another. </trans>
<eg><i lang=""ceb"">Sigi lang, paríha ra nà,</i><trans> It’s all right, it makes no difference. (It’s all the same.) </trans></eg>
<eg><i lang=""ceb"">Paríha kaáyu ang nawung sa kalúha,</i><trans> The twins look exactly alike. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pair</tr>. </trans>
<eg><i lang=""ceb"">Píla ka paríhang sapátus<corr sic="","">?</corr></i><trans> How many pairs of shoes? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B13C; ac]</itype><trans> be the same. </trans>
<eg><i lang=""ceb"">Maparíha kahà ang átung grádu<corr sic="","">?</corr></i><trans> Will our grades come out the same? </trans></eg>
<eg><i lang=""ceb"">Way makaparíha sa ímung kaáyu,</i><trans> No one could equal your goodness. </trans></eg>
<eg><i lang=""ceb"">Nagkaparíha ang ámung sinínà,</i><trans> Our dresses happened to be similar. </trans></eg>
<eg><i lang=""ceb"">Ayaw kug iparíha nímung tabian,</i><trans> Don’t say I’m like you, a gossip. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AC; ac]</itype><trans> pair up with. </trans>
<eg><i lang=""ceb"">Akuy muparíha níya sa kuratsa,</i><trans> I will pair off with her in dancing the curacha. </trans></eg>
<eg><i lang=""ceb"">Nagkaparíha sila sa patigáyun,</i><trans> They teamed up in business. </trans></eg>
<eg><i lang=""ceb"">Pariháun nátù ang átung sunuy,</i><trans> Let’s pair off our cocks. </trans></eg>
</sense></hom>
<entry><form id=""kaparixha"" lang=""ceb""><abbr expan=""kaparíha"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>partner</tr>. </trans>
</sense></hom></entry>
<entry><form id=""puluparixha_paliparixha"" lang=""ceb""><abbr expan=""puluparíha"" type=""lemma"">Culu-</abbr>, <abbr expan=""paliparíha"" type=""lemma"">pari-</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> somewhat similar. </trans>
<eg><i lang=""ceb"">Puparíha (pariparíha) sa kang Risal ang ímung sinudlayan,</i><trans> The way you comb your hair looks s.t. like Rizal.
</trans></eg>
</sense></hom></entry></entry>");
