INSERT INTO `wced_entry` VALUES (13721, "paris", "738", "<entry page=""738"" id=""13721""><form id=""paxris"" lang=""ceb"">páris</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pair</tr>. </trans>
<eg><i lang=""ceb"">Duha ka páris nga kapling,</i><trans> Two pairs of cuff links. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the other one of a pair. </trans>
<eg><i lang=""ceb"">Háin man ang páris niíning sapátus<corr sic="","">?</corr></i><trans> Where is the other shoe of this pair of shoes? </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> the thing that matches s.t. else. </trans>
<eg><i lang=""ceb"">Kining bága páris sa ákung bistídu,</i><trans> This bag is the one that matches my dress. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>partner</tr> in doing s.t. </trans>
</sense>
<sense n=""4""><number>4</number><trans> <tr>spouse</tr>. </trans>
</sense>
<sense n=""5""><number>5</number><trans> food or drink served with s.t. else. </trans>
</sense>
<sense n=""6""><number>6</number><trans> even in number. </trans>
<eg><i lang=""ceb"">Lúnis u páris ba<corr sic="","">?</corr></i><trans> Odd or even? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3SC; ac]</itype><trans> pair off, go with, match. </trans>
<eg><i lang=""ceb"">Nagpáris silang nanglákaw,</i><trans> They were walking in pairs. </trans></eg>
<eg><i lang=""ceb"">Maáyu untà ug makaparis kug kugihan,</i><trans> It would be good to get an industrious girl for a helpmate. </trans></eg>
<eg><i lang=""ceb"">Ákung parísan ang barung Tagálug ug karsúnis itum,</i><trans> I’ll match my barong with black trousers. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C13; c]</itype><trans> eat or drink together with s.t. else. </trans>
<eg><i lang=""ceb"">Mangga ang maáyung ipáris sa budbud,</i><trans> Mangoes go well with rice sticks. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B; c1]</itype><trans> be even in number, [do] by two’s. </trans>
<eg><i lang=""ceb"">Ug mupáris mudaug ka. Akuy pildi,</i><trans> If it comes out even you win and I lose. </trans></eg>
</sense></hom>
<entry><form id=""parispaxris"" lang=""ceb"">parispáris</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; c1]</itype><trans> be in several pairs. </trans>
<eg><i lang=""ceb"">Parisparísun (iparispáris) sa Ginúu ang mga maáyug batásan,</i><trans> The Lord will pair good people up with each other. </trans></eg>
</sense></hom></entry>
<entry><form id=""parisparis"" lang=""ceb"">parisparis</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a game of cards, usually of four players, each dealt five cards. The players draw and discard in turn with the object of getting three pairs (where the last card drawn making the third pair is not discarded). </trans>
</sense></hom></entry>
<entry><form id=""parisan"" lang=""ceb""><abbr expan=""parisan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>pair</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kapaxris"" lang=""ceb""><abbr expan=""kapáris"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>partner</tr>. </trans>
</sense></hom></entry>
<entry><form id=""parisun"" lang=""ceb""><abbr expan=""parisun"" type=""lemma"">-un(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> things that fit together. </trans>
<eg><i lang=""ceb"">Parisun kaáyu silang duha,</i><trans> They are a good pair.
</trans></eg>
</sense></hom></entry></entry>");
