INSERT INTO `wced_entry` VALUES (13735, "parti1", "739", "<entry page=""739"" id=""13735""><form id=""parti"" lang=""ceb"">parti<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>party</tr>, a social gathering. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> have, throw a party. </trans>
<eg><i lang=""ceb"">Ámung gipartíhan ang bag-ung nanggraduwar,</i><trans> We held a party for the new graduates. </trans></eg>
</sense></hom>
<entry><form id=""parti_layin"" lang=""ceb""><abbr expan=""parti"" type=""lemma"">—</abbr> layin</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> party line of a telephone. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C; c]</itype><trans> be on the same party line. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A12]</itype><trans> get as one’s party line. </trans>
</sense></hom></entry>
<entry><form id=""partiparti"" lang=""ceb"">partiparti</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> parties collectively, esp. dance parties. </trans>
<eg><i lang=""ceb"">Túa siya kanúnay ug ása tung partiparti,</i><trans> Wherever there is a party you’ll be sure to see him. </trans></eg>
<eg><i lang=""ceb"">Daghang partiparti sa Disimbri,</i><trans> There are lots of parties in December.
</trans></eg>
</sense></hom></entry></entry>");
