INSERT INTO `wced_entry` VALUES (13736, "parti2", "739", "<entry page=""739"" id=""13736""><form id=""parti2"" lang=""ceb"">parti<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> share of s.t. </trans>
<eg><i lang=""ceb"">Tagáan ta kag usa ka parti,</i><trans> I’ll give you one share. </trans></eg>
<eg><i lang=""ceb"">Kwarta parti,</i><trans> A quarter part. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> part assigned to s.o. in a play, program, and similar activity. </trans>
<eg><i lang=""ceb"">Unsay ímung parti sa dráma?</i><trans> What’s your part in the drama? </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> a specific part of a certain location or place. </trans>
<eg><i lang=""ceb"">Háin kang parti sa Mindanaw puyù?</i><trans> In what part of Mindanao do you live? </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> concerning about. </trans>
<eg><i lang=""ceb"">Nangutána siya parti sa nahitabù,</i><trans> He asked about what happened. </trans></eg>
<eg><i lang=""ceb"">Parti sa ímung anak ayaw kabaláka,</i><trans> Don’t worry about your son. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>divide s.t.</tr> </trans>
</sense>
<sense n=""2""><number>2</number><trans> relay a message; report. </trans>
<eg><i lang=""ceb"">Iparti ni nátù dáyun,</i><trans> Let us report this immediately. </trans></eg>
</sense></hom>
<entry><form id=""partixda"" lang=""ceb""><abbr expan=""partída"" type=""lemma"">-da</abbr><sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>message</tr>, <tr>report</tr>. </trans>
</sense></hom></entry>
<entry><form id=""partixda_dibawtismu"" lang=""ceb""><abbr expan=""partída"" type=""lemma"">-da</abbr> dibawtismu</form>
<hom>
<sense n=""0""><trans> <tr>baptismal certificate</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> share, part of s.t. divided. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#parti""><sc>parti</sc></xr>, <i lang=""ceb"">v</i>.
</trans>
</sense></hom></entry></entry>");
