INSERT INTO `wced_entry` VALUES (13738, "partida2", "739", "<entry page=""739"" id=""13738""><form id=""partixda2"" lang=""ceb"">partída<sub>2</sub></form>
<hom>
<sense n=""0""><trans> (from <ix>parti<sub>2</sub></ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.w., in a certain part of some place. </trans>
<eg><i lang=""ceb"">Adtu ku maninda sa partída sa Mindanaw,</i><trans> I sell things in some places in Mindanao. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> place one goes outside of the home on business. </trans>
</sense>
<sense n=""3""><number>3</number><trans> amount paid for goods bought wholesale or in big quantities. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> <tr>migrate</tr>, <tr>travel</tr>. </trans>
<eg><i lang=""ceb"">Gipartída námù ang mga dagkung syudad sa Urúpa,</i><trans> We visited the big cities of Europe. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AN; c]</itype><trans> <tr>peddle</tr>. </trans>
<eg><i lang=""ceb"">Túa siya sa kabukíran nagpartídag bulad,</i><trans> She is in the mountains peddling dried fish. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AN; a]</itype><trans> buy in great quantities. </trans>
<eg><i lang=""ceb"">Nakapartída kug barátu kaáyung isdà,</i><trans> I managed to buy a big quantity of fish cheaply. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[c]</itype><trans> <tr>sell wholesale</tr>. </trans>
<eg><i lang=""ceb"">Íyang ipartída pagbaligyà kay sámuk ug minudúhun,</i><trans> He will just sell it wholesale because it is too much trouble to sell it in small quantities.
</trans></eg>
</sense></hom></entry>");
