INSERT INTO `wced_entry` VALUES (13739, "partida3", "739", "<entry page=""739"" id=""13739""><form id=""partixda3"" lang=""ceb"">partída<sub>3</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> advantage given in a game. </trans>
<eg><i lang=""ceb"">Dakù ang partída nga ílang gihátag sa kaatbang,</i><trans> They gave their opponents a big advantage. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> in billiards or games of pool where dice are thrown to give the player part of the score, the points the player must make to win in addition to the number rolled on the dice. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> have made the requisite number of points in billiards. </trans>
<eg><i lang=""ceb"">Makakuhir lang kug dus puntus, partída na ku,</i><trans> If I can get two points, I win. </trans></eg>
<eg><i lang=""ceb"">Dus puntus na lay ákung partída,</i><trans> I need only two points to win this game. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ac]</itype><trans> give an advantage to the opponent in games, contests, etc. </trans>
<eg><i lang=""ceb"">Kun partidáhun ku ning ákung manuk, musúkul ka?</i><trans> If I have my cock give you an advantage, would you bet against it? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> need [so-and-so] many more points to win in billiards.
</trans>
</sense></hom></entry>");
