INSERT INTO `wced_entry` VALUES (13743, "partikular", "739", "<entry page=""739"" id=""13743""><form id=""partikular"" lang=""ceb"">partikular</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>peculiarity</tr>, <tr>characteristic</tr> act. </trans>
<eg><i lang=""ceb"">Partikular sa manuk nga mubátug matag gabíi,</i><trans> That’s the way chickens are. They roost in the evening. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>specific</tr>, the very one. </trans>
<eg><i lang=""ceb"">Ngánung kanà mang partikular nga bran sa rilu ang gustu nímu?</i><trans> Why do you like just that particular brand of watch? </trans></eg>
<eg><i lang=""ceb"">Ang partikular nga táwu mauy tagáan giyud sa sulat,</i><trans> The letter should be given to the man himself. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> ordinary in looks or ways. </trans>
<eg><i lang=""ceb"">Milyunaryu, apan mu ra lag táwung partikular <pb n=""740""/>nga musúruy,</i><trans> He’s a millionaire, but you’d think he was an ordinary person when he goes out. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <form id=""mga_partikular"" lang=""ceb"">mga <abbr expan=""partikular"" type=""lemma"">—</abbr></form><trans> unimportant matters, nothing of special concern. </trans>
<eg><i lang=""ceb"">A, mga partikular lang tung ámung gipanaghisgútan,</i><trans> Oh, all we talked about were trivial things. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> place outside of the home one goes to on business. </trans>
<eg><i lang=""ceb"">Ang mga nigusyanting bulanti náa pirmi sa partikular,</i><trans> Traveling salesmen are always away from home on business. </trans></eg>
</sense></hom>
