INSERT INTO `wced_entry` VALUES (13778, "pasakalyi, pasakayli", "741", "<entry page=""741"" id=""13778""><form id=""pasakalyi_pasakayli"" lang=""ceb"">pasakalyi, pasakayli</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; b6(1)]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do the introduction to a musical number. </trans>
</sense>
<sense n=""2""><number>2</number><trans> give a long prologue before getting around to one’s real subject. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> pass the time away by strolling around. </trans>
<eg><i lang=""ceb"">Mipasakalyi ku sa plása,</i><trans> I was passing the time strolling in the park. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> introduction to a musical number. </trans>
<eg><i lang=""ceb"">Mauy nindut ang pasakayli kay sa kanta,</i><trans> The introductory portion was nicer than the song itself. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> round-about speech in preparation for saying s.t. else difficult. </trans>
<eg><i lang=""ceb"">Hinúgay nang pasakalyi mu. Sulti na,</i><trans> That’s enough of your beating around the bush. What do you want?
</trans></eg>
</sense></hom></entry>");
