INSERT INTO `wced_entry` VALUES (13787, "pasar1", "742", "<entry page=""742"" id=""13787""><form id=""pasar"" lang=""ceb"">pasar<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a2b2]</itype><trans> pass an exam, screening, or the like. </trans>
<eg><i lang=""ceb"">Mipasar siya sa iksámin sa sirbisyu sibil,</i><trans> He passed the Civil Service test. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> pass a certain time, deadline. </trans>
<eg><i lang=""ceb"">Nakapasar na nang tagal sa pagbáyad,</i><trans> The term to pay me has expired. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B2]</itype><trans> for canned or packaged foods to spoil after being kept too long. </trans>
<eg><i lang=""ceb"">Nagkapasar na ning tablitása kay nalánay na,</i><trans> These tablets must be expired because they have already melted. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B2]</itype><trans> go out of style or fashion, be not with the times. </trans>
<eg><i lang=""ceb"">Napasar na ang tag-as nga múda sa palda,</i><trans> The long skirt is out of fashion. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> go through, go by s.t. (used in set phrases). </trans>
</sense>
<sense n=""4a""><number>4a</number> <form id=""pasar_ang_guxtum_pasar_ang_kaxun"" lang=""ceb""><abbr expan=""pasar"" type=""lemma"">—</abbr> ang gútum, <abbr expan=""pasar ang káun"" type=""lemma"">káun</abbr></form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b4]</itype><trans> fail to eat at the proper time and lose one’s desire to eat. </trans>
<eg><i lang=""ceb"">Makapasar gánì ang ákung gútum dì na ku gustung mukáun,</i><trans> If I fail to eat during meal times, I lose my appetite. </trans></eg>
</sense>
<sense n=""4b""><number>4b</number> <form id=""pasar_ang_gaxna"" lang=""ceb""><abbr expan=""pasar"" type=""lemma"">—</abbr> ang gána</form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2]</itype><trans> lose one’s fondness for s.t. </trans>
<eg><i lang=""ceb"">Mipasar (napasar) na ang ákung gána sa mga kalingáwan,</i><trans> I have lost my interest for amusements. </trans></eg>
</sense>
<sense n=""4c""><number>4c</number> <form id=""pasar_sa_kamut"" lang=""ceb""><abbr expan=""pasar"" type=""lemma"">—</abbr> sa kamut</form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> for s.t. to pass through one’s hands. </trans>
<eg><i lang=""ceb"">Mipasar nang bayhána sa ákung kamut únà maminyù,</i><trans> That girl passed through my hands before she got married. </trans></eg>
<eg><i lang=""ceb"">Ipasar ang papílis sa ákung kamut únà idusù,</i><trans> The papers go through my hands before they are passed forward. </trans></eg>
</sense></hom>
<entry><form id=""pasar_noun_pronoun"" lang=""ceb""><abbr expan=""pasar"" type=""lemma"">—</abbr> <r>[<ix>noun, pronoun</ix>]</r></form>
<hom>
<sense n=""0""><trans> [so-and-so] has a passing mark. </trans>
<eg><i lang=""ceb"">Pasar ka sa sibil sirbis tist,</i><trans> You passed the Civil Service test. </trans></eg>
</sense></hom></entry>
<entry><form id=""pasaxdu"" lang=""ceb"">pasádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> successful in an exam. </trans>
<eg><i lang=""ceb"">Pasádu tanan kay may líkids,</i><trans> Everybody passed because there was a leakage (the test questions were known to the examinees). </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> past a certain time. </trans>
<eg><i lang=""ceb"">Pasádu alas dúsi na,</i><trans> It’s past twelve o’clock now. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> canned foods, packaged products which are so old that they have become spoiled. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B126]</itype><trans> be successful in an examination. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B6; c16]</itype><trans> be past a certain hour. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[B]</itype><trans> for canned foods or other packaged products to spoil from being too old. </trans>
<eg><i lang=""ceb"">Mupasádu (mapasádu) na gánì ang sardínas, ilábay na lang,</i><trans> If the can of sardines is already spoiled, throw it away.
</trans></eg>
</sense></hom></entry></entry>");
