INSERT INTO `wced_entry` VALUES (13805, "pasipala", "742", "<entry page=""742"" id=""13805""><form id=""pasipaxla"" lang=""ceb"">pasipála</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>mistreat</tr>, treat s.t. roughly, abusively. </trans>
<eg><i lang=""ceb"">Ayaw pasipad-i ang mwiblis,</i><trans> <pb n=""743""/>Don’t mistreat the furniture. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> abuse a woman. </trans>
</sense>
<sense n=""3""><number>3</number> <form id=""pasipaxla_ug_sulti"" lang=""ceb""><abbr expan=""pasipála"" type=""lemma"">—</abbr> ug sulti</form><trans> mistreat s.o. by saying s.t. inconsiderate and painful to him in a light, unthinking way. </trans>
<eg><i lang=""ceb"">Ngánung nagpasipála ka mag pamasángil nga dì ka man sigúru?</i><trans> Why do you accuse me unthinkingly if you are not sure? </trans></eg>
</sense>
<sense n=""4""><number><corr sic=""3"">4</corr></number><trans> dare do s.t. dangerous. </trans>
<eg><i lang=""ceb"">Dì ku mupasipála ug labang ánang kusug nga bahà,</i><trans> I don’t dare cross the river because it is so high. </trans></eg>
</sense></hom>
<entry><form id=""mapasipalaxhun_mapasipad-axnun"" lang=""ceb"">mapasipaláhun, mapasipad-ánun</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>abusive</tr>, <tr>maltreating</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> careless with things that are dangerous.
