INSERT INTO `wced_entry` VALUES (13814, "pasiyu, pasiyu", "743", "<entry page=""743"" id=""13814""><form id=""pasiyu_pasixyu"" lang=""ceb"">pasiyu, pasíyu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> take a leisurely walk, stroll, ride. </trans>
<eg><i lang=""ceb"">Mupasíyu ku sa parki mahápun,</i><trans> I take a stroll in the park in the afternoon. </trans></eg>
<eg><i lang=""ceb"">Ipasíyu nang bátà arun mainitan,</i><trans> Take the child for a stroll to get some sun. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> drop by a place to see s.o. </trans>
<eg><i lang=""ceb"">Pasyúhan ku siya matag Duminggu,</i><trans> I drop by her place every Sunday. </trans></eg>
</sense></hom>
<entry><form id=""pasyuhan"" lang=""ceb"">pasyuhan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> take a stroll habitually in a certain place. </trans>
<eg><i lang=""ceb"">Magpasyuhan ku ngadtus íla ug maduminggu,</i><trans> I usually take a stroll to their place on Sundays.
</trans></eg>
</sense></hom></entry></entry>");
