INSERT INTO `wced_entry` VALUES (13818, "paskin", "743", "<entry page=""743"" id=""13818""><form id=""paskin"" lang=""ceb"">paskin</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> notice or announcement displayed publicly. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. bad about a person written anonymously in a public place or an anonymous poison-pen letter. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put up as a public announcement. </trans>
<eg><i lang=""ceb"">Nagpaskin si Lútir sa pultahan sa simbahan,</i><trans> Luther posted his theses on the church door. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> post an announcement ruining s.o.’s reputation. </trans>
<eg><i lang=""ceb"">Kinsay nagpaskin nga si Pidru pisut?</i><trans> Who wrote on the wall that Pedro is uncircumcised? </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> send an anonymous poison-pen letter. </trans>
<eg><i lang=""ceb"">Gipaskínan ang ginikánan nga kidnápun ang ílang anak,</i><trans> The parents received an anonymous letter that their baby would be kidnapped. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> play a game in which the letters of the name of a man and a woman are compared to find out if they will fall in love, be married, and the like.
</trans>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (13818, "paskin", "paskin", "m", "nv");
INSERT INTO `wced_entry` VALUES (13819, "pasku", "743", "<entry page=""743"" id=""13819""><form id=""Pasku"" lang=""ceb"">Pasku</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> Christmas season, day, or Easter. </trans>
<eg><i lang=""ceb"">Maáyung Pasku,</i><trans> Merry Christmas! </trans></eg>
</sense></hom>
<entry><form id=""Pasku_sa_kalixpay"" lang=""ceb""><abbr expan=""Pasku"" type=""lemma"">—</abbr> sa kalípay</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>Christmas</tr>. </trans>
</sense></hom></entry>
<entry><form id=""Pasku_sa_kasaxkit"" lang=""ceb""><abbr expan=""Pasku"" type=""lemma"">—</abbr> sa kasákit</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>Lenten season</tr>. </trans>
</sense></hom></entry>
<entry><form id=""Pasku_sa_labaduxra"" lang=""ceb""><abbr expan=""Pasku"" type=""lemma"">—</abbr> sa labadúra</form>
<hom>
<sense n=""0""><trans> Feast of the <tr>Passover</tr>. </trans>
</sense></hom></entry>
<entry><form id=""Pasku_sa_pagkabanhaw"" lang=""ceb""><abbr expan=""Pasku"" type=""lemma"">—</abbr> sa pagkabanhaw</form>
<hom>
<sense n=""0""><trans> <tr>Easter</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b2]</itype><trans> spend Christmas day. </trans>
<eg><i lang=""ceb"">Nagpasku ang mga sundálu sulud sa ílang pakshul,</i><trans> The soldiers spent their Christmas in their foxholes. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B3; b8]</itype><trans> for it to be Christmas. </trans>
<eg><i lang=""ceb"">Mupasku na lang wà pa kuy kwarta,</i><trans> It will be Christmas and I still have no money. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b8]</itype><trans> get a Christmas present from s.o. </trans>
</sense></hom></entry>
<entry><form id=""pamasku"" lang=""ceb""><abbr expan=""pamasku"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> spend or celebrate Christmas. </trans>
<eg><i lang=""ceb"">Didtu ku mamasku sa prisuhan,</i><trans> I spent my Christmas in jail. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> go caroling. </trans>
<eg><i lang=""ceb"">Mamasku ta sa kumbintu,</i><trans> Let’s go caroling at the rectory. </trans></eg>
</sense></hom></entry>
<entry><form id=""pinaskuxhan"" lang=""ceb"">pinaskúhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> Christmas gift. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12]</itype><trans> get a Christmas present. †
</trans>
</sense></hom></entry></entry>");
