INSERT INTO `wced_entry` VALUES (13821, "paslag", "743", "<entry page=""743"" id=""13821""><form id=""paslag"" lang=""ceb"">paslag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> drive s.t. away by poking or throwing s.t. at it. </trans>
<eg><i lang=""ceb"">Akuy mupaslag ug batu sa mga bábuy nga misúd sa gít,</i><trans> I’ll drive the pigs that entered the gate away by throwing rocks at them. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> throw a lot of things at s.t. </trans>
<eg><i lang=""ceb"">Gipaslag ang balay gabíi,</i><trans> S.o. threw rocks at the house last night.
