INSERT INTO `wced_entry` VALUES (13822, "paslak", "743", "<entry page=""743"" id=""13822""><form id=""paslak"" lang=""ceb"">paslak</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; bc]</itype><trans> stuff s.t. into s.t. with force, not carefully. </trans>
<eg><i lang=""ceb"">Pasláki ang lungag arun way mabulásut,</i><trans> Stuff s.t. into the hole so nobody will fall into it. </trans></eg>
<eg><i lang=""ceb"">Gipaslak lang sa nars ang pítu sa labatíba ngadtu sa ákung lubut,</i><trans> The nurse just shoved the enema nozzle into my behind.
</trans></eg>
</sense></hom></entry>");
