INSERT INTO `wced_entry` VALUES (13823, "paslang", "743", "<entry page=""743"" id=""13823""><form id=""paslang"" lang=""ceb"">paslang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a12]</itype><trans> <tr>exterminate</tr>, defeat a great number of people or things. </trans>
<eg><i lang=""ceb"">Ang usa ka iring dì makapaslang sa mga ilagà dinhing baláya,</i><trans> One cat is not enough to get rid of <pb n=""744""/>the rats in this house. </trans></eg>
<eg><i lang=""ceb"">Gipaslang níla ang mga sagbut sa uma,</i><trans> They got rid of all of the weeds in the field.
