INSERT INTO `wced_entry` VALUES (13826, "paslut", "744", "<entry page=""744"" id=""13826""><form id=""paslut"" lang=""ceb"">paslut</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B26; b8]</itype><trans> <tr>chafe</tr> the skin from scalding or friction. </trans>
<eg><i lang=""ceb"">Ug mubutu ang lutu, mupaslut ang pánit,</i><trans> If the blister bursts, the skin will come off. </trans></eg>
<eg><i lang=""ceb"">Ang ínit kaáyung kapi makapaslut (makapapaslut) sa dílà,</i><trans> Hot coffee will blister your tongue. </trans></eg>
<eg><i lang=""ceb"">Mapaslutan ang ímung kamut ug magsígi kag gúna,</i><trans> Your hands will get chafed if you keep on weeding.
