INSERT INTO `wced_entry` VALUES (13828, "paspas1", "744", "<entry page=""744"" id=""13828""><form id=""paspas"" lang=""ceb"">paspas<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>fast</tr> in motion or doing s.t. </trans>
<eg><i lang=""ceb"">Paspas siyang mukáun,</i><trans> He eats fast. </trans></eg>
<eg><i lang=""ceb"">Paspas siyang mudrayib ug awtu,</i><trans> He drives fast. </trans></eg>
<eg><i lang=""ceb"">Paspas siyang musulti,</i><trans> He speaks rapidly. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB2; b5]</itype><trans> do s.t. hurriedly, get to be fast. </trans>
<eg><i lang=""ceb"">Mupaspas kug káun kay tayim na,</i><trans> I’ll eat hurriedly because it is already late. </trans></eg>
<eg><i lang=""ceb"">Mupaspas (mapaspas) ang ákung pulsu ug kulbaan ku,</i><trans> My pulse beats fast if I’m scared. </trans></eg>
<eg><i lang=""ceb"">Paspásig (paspásag) bugsay,</i><trans> Row fast. </trans></eg>
</sense></hom>
<entry><form id=""pinaspaxsan"" lang=""ceb""><abbr expan=""pinaspásan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> anything gotten or obtained illegally. </trans>
<eg><i lang=""ceb"">Kanang kwartang gigastu sa tagakustum pinaspásan nà,</i><trans> The customs examiner is spending ill-gotten money. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> magic food left s.w. (e.g. fish in<corr sic=""-""/> a fish trap) by an <ix>unglù</ix> which will cause the eater to become an <ix>unglù</ix> or develop some sort of ailment, usually losing his teeth.
</trans>
</sense></hom></entry></entry>");
