INSERT INTO `wced_entry` VALUES (13840, "pastikum", "744", "<entry page=""744"" id=""13840""><form id=""pastixkum"" lang=""ceb"">pastíkum</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the custom of the Roman Catholic church of carrying the image of the Infant Jesus lying on a crib by two acolytes from house to house for people to adore, for which people usually give money as an offering. The <ix>pastíkum</ix> begins on the 25th of December and ends on the 2nd of February. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the words uttered by the acolyte when the image has been kissed.
</trans>
</sense></hom></entry>");
