INSERT INTO `wced_entry` VALUES (13841, "pastilan", "744", "<entry page=""744"" id=""13841""><form id=""pastilan"" lang=""ceb"">pastilan</form>
<hom>
<sense n=""0""><trans> <ix>short form</ix>: <bx>tilan</bx> </trans>
</sense>
<sense n=""1""><number>1</number><trans> expression of <pb n=""745""/>great worry or grief. </trans>
<eg><i lang=""ceb"">Pastilan ang ákung bátà naligsan sa trák,</i><trans> Heavens! My son got run over by a truck! </trans></eg>
</sense>
<sense n=""2""><number>2</number>
<eg><i lang=""ceb"">expression of feigned surprise or concern, with a disdainful tone:</i><trans> what are you worrying so much for? </trans></eg>
<eg><i lang=""ceb"">Pastilan, Tiryú, kasayun niánà ug mahadluk kang mubúhat!</i><trans> Goodness, Terio, that’s so easy and you’re scared to do it? </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> expression of scorn or derision at s.o. trying to tell a lie. </trans>
<eg><i lang=""ceb"">Tilan nímu uy, bísag klárung bakak patuhúun gihápun ta ánà!</i><trans> You sure are s.t.! It’s such an obvious lie and you expect me to believe it! </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> expression of pain or annoyance. </trans>
<eg><i lang=""ceb"">Tilan ning mga batáa, pagkasabaan!</i><trans> My these children, how noisy they are! </trans></eg>
<eg><i lang=""ceb"">Pastilang labára sa ákung úlu!</i><trans> Oh! How my head aches! </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> exclamation of how intense s.t. is. </trans>
<eg><i lang=""ceb"">Pastilang gwapáhang bayhána!</i><trans> What a beautiful woman!
</trans></eg>
</sense></hom></entry>");
