<sense n=""0""> <itype>[B26; b8]</itype><trans> commit certain violations in games: get a score of more than the winning number of points and therefore be out of the contest, step on the demarcation line in hopscotch, et al. </trans>
<eg><i lang=""ceb"">Mapasu (mupasu) ka na ug mulápas nang ímung puntus sa bayinti únu,</i><trans> You lose if you get more than twenty-one points. </trans></eg>
