INSERT INTO `wced_entry` VALUES (13851, "pasu", "745", "<entry page=""745"" id=""13851""><form id=""paxsu"" lang=""ceb"">pásu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> walk slowly and deliberately. </trans>
<eg><i lang=""ceb"">Mipásu siyag lakaw kay dihay natúlug,</i><trans> He walked slowly because there was s.o. asleep. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> march before a crowd in a ceremony. </trans>
<eg><i lang=""ceb"">Mipásu na ang mga intranti sa banggà sa kaanyag,</i><trans> The beauty contestants marched before the judges. </trans></eg>
<eg><i lang=""ceb"">Wà kuy sinínà nga ipásu sa gradwisyun,</i><trans> I don’t have a dress to wear when I march in the commencement. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; c]</itype><trans> walk in front and in view of many people as if on parade. </trans>
<eg><i lang=""ceb"">Mupásu giyud ta íni kay nagsúgud na ang klási,</i><trans> Now we are going to have to pass in front of the whole class because the class has already started. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for one’s walk to be refined and slow, not rough or erratic. </trans>
<eg><i lang=""ceb"">Pásu ang linaktan sa rayna,</i><trans> The beauty queen walked elegantly. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> manner of walking, esp. a graceful walk. </trans>
<eg><i lang=""ceb"">Nausab ang pásu sa babáyi nga gitaghúyan,</i><trans> The woman lost her poise when the men whistled at her. </trans></eg>
</sense></hom>
<entry><form id=""pasupaxsu"" lang=""ceb"">pasupásu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> pace to and fro. </trans>
<eg><i lang=""ceb"">Nagpasupásu siya samtang nagbatì ang íyang asáwa,</i><trans> He paced to and fro while his wife was in labor.
</trans></eg>
</sense></hom></entry></entry>");
