INSERT INTO `wced_entry` VALUES (13878, "patak", "746", "<entry page=""746"" id=""13878""><form id=""paxtak"" lang=""ceb"">pátak</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; b6]</itype><trans> for a large number of things to be scattered over an area. </trans>
<eg><i lang=""ceb"">Daghang bitúun nga nagpátak sa lángit,</i><trans> A myriad of stars dotting the sky. </trans></eg>
</sense></hom>
<entry><form id=""patakpatak"" lang=""ceb"">patakpatak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B6; a]</itype><trans> be scattered or strewn over an area. </trans>
<eg><i lang=""ceb"">Nagpatakpatak ang tái sa bátà,</i><trans> The baby’s stools were scattered all over the place. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB6; a1]</itype><trans> break, tear to pieces, get broken, torn to pieces. </trans>
<eg><i lang=""ceb"">Nagpatakpatak na sa katagù ang ákung sinínà,</i><trans> My dress is almost tattered into pieces, the fabric is so weak. </trans></eg>
<eg><i lang=""ceb"">Patakpatakun ku ning hunub nga kúlun,</i><trans> I’ll break this leaky pot into pieces. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> produce a pitter-pattering sound like falling rain. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> pitter-patter of falling rain.
</trans>
</sense></hom></entry></entry>");
