INSERT INTO `wced_entry` VALUES (13884, "patas", "747", "<entry page=""747"" id=""13884""><form id=""paxtas"" lang=""ceb"">pátas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; b5]</itype><trans> <tr>even up</tr> a score, debt, wrong. </trans>
<eg><i lang=""ceb"">Nagkapátas ang duha ka tím,</i><trans> The two teams were tied. </trans></eg>
<eg><i lang=""ceb"">Mapátas na gánì átung iskur dì na ku mudúlà,</i><trans> I’ll quit as soon as the score is tied. </trans></eg>
<eg><i lang=""ceb"">Patásun (patásan) ku giyud ang insultu,</i><trans> I’ll get even for the insult. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2S; b6]</itype><trans> match, be the equal. </trans>
<eg><i lang=""ceb"">Way makapátas nímu sa ímung kamaldítu,</i><trans> There is no one as mean as you are. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> even in score. </trans>
<eg><i lang=""ceb"">Pátas ang ílang puntus sa tungàtúngà,</i><trans> Their score was even at half time. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> of equal ability or achievement. </trans>
<eg><i lang=""ceb"">Pátas giyud ang duha ka manuk,</i><trans> The two fighting cocks are exactly even in ability. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> have an equal share of s.t. unpleasant. </trans>
<eg><i lang=""ceb"">Pátas tang tanan. Púlus gikasab-an,</i><trans> We’re even. We were all scolded. </trans></eg>
</sense></hom>
<entry><form id=""pamaxtas"" lang=""ceb""><abbr expan=""památas"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; c6]</itype><trans> for a person who has suffered to harm others, innocent or not, so that they too will suffer as he has. </trans>
<eg><i lang=""ceb"">Mamátas na lang ku kay gidaugdáug kug maáyu,</i><trans> I’ve been oppressed enough. Now I will raise hell for everybody.
</trans></eg>
</sense></hom></entry></entry>");
