INSERT INTO `wced_entry` VALUES (13887, "pataw", "747", "<entry page=""747"" id=""13887""><form id=""pataw"" lang=""ceb"">pataw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>buoy</tr> tied to s.t.: buoy used to hold up fishing nets, used to mark a fish trap in the sea, used to mark an unattended fishing line tied to a rope with a harpoon (<ix>paladyaw</ix>) to hold the fish back, et al. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> use a float, fasten a float to a rope. </trans>
<eg><i lang=""ceb"">Ang ámung púkut gipatawan ug gúma,</i><trans> We tied rubber floats for our fishing net. </trans></eg>
</sense></hom>
<entry><form id=""pataxwan"" lang=""ceb""><abbr expan=""patáwan"" type=""lemma"">-an</abbr></form>
