INSERT INTO `wced_entry` VALUES (13888, "patay", "747", "<entry page=""747"" id=""13888""><form id=""patay"" lang=""ceb"">patay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b7]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>kill</tr>, <tr>slay</tr>. </trans>
<eg><i lang=""ceb"">Dì makapatay ning sakíta nímu,</i><trans> This sickness won’t kill you. </trans></eg>
<eg><i lang=""ceb"">Patyun ku siya,</i><trans> I’ll kill him. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> put an end to s.t. as if killing it. </trans>
<eg><i lang=""ceb"">Ang pagkapakyas makapatay sa kadásig,</i><trans> Failure can destroy one’s enthusiasm. </trans></eg>
<eg><i lang=""ceb"">Adtu sa Kamara Báha patya ang balaudnun,</i><trans> The bill will be killed in the Lower House. </trans></eg>
<eg><i lang=""ceb"">Angay patyun nang balitáa,</i><trans> That news should be suppressed. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> shut off an engine, light; put out a fire. </trans>
<eg><i lang=""ceb"">Patya nang sugà,</i><trans> Turn off the lights. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> neutralize chemicals or colors. </trans>
<eg><i lang=""ceb"">Putì ang ipatay niánang pula nga kulur,</i><trans> Neutralize that red color with white. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> consume time. </trans>
<eg><i lang=""ceb"">Maáyu ning duláa ipatayg úras,</i><trans> This game is good for killing time. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> whittle s.t. down to reduce its size or smoothen it. </trans>
<eg><i lang=""ceb"">Patyi ang ngilit sa lamísa,</i><trans> Round off the edges of the table. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[a3]</itype><trans> be all tails in a game of tossing coins. </trans>
<eg><i lang=""ceb"">Mapatay na ni rung antúga,</i><trans> This toss will be all tails. </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> in a game of <ix>sungkà</ix>, drop the last stone in an empty hole. </trans>
</sense>
<sense n=""7""><number>7</number><trans> in set phrases: </trans>
</sense>
<sense n=""a""><number>a</number>
</sense></hom>
<entry><form id=""patay_sa_baxhuq"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> sa báhù</form>
<hom>
<sense n=""0""> <itype>[A2P; a1]</itype><trans> mask a pungent smell. </trans>
<eg><i lang=""ceb"">Lamas ang ipatay sa báhù sa isdang langsa,</i><trans> Spices can cover the fishy taste of fish. </trans></eg>
</sense></hom></entry>
<entry><form id=""patay_ug_haxlas"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> ug hálas</form>
<hom>
<sense n=""b1""><number>b1</number><trans> for men to urinate. </trans>
</sense>
<sense n=""b2""><number>b2</number><trans> for men to masturbate. </trans>
</sense>
<sense n=""c""><number>c</number>
</sense></hom></entry>
<entry><form id=""patay_sa_kabugnaw"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> sa kabugnaw</form>
<hom>
<sense n=""0""> <itype>[A; a1]</itype><trans> heat water until it becomes tepid. </trans>
<eg><i lang=""ceb"">Patya úsà ang kabugnaw sa túbig nga idígù sa bátà,</i><trans> Warm the baby’s water before you bathe him. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>dead</tr>. </trans>
<eg><i lang=""ceb"">Patay na si Tátay,</i><trans> My father is dead. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for s.t. to have been <tr>killed</tr>, <tr>deadened</tr>. </trans>
<eg><i lang=""ceb"">Patay ang ákung pagláum,</i><trans> I have no more hope. </trans></eg>
<eg><i lang=""ceb"">Patay ang makina,</i><trans> The engine is dead. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for coins to come out tails. </trans>
</sense>
<sense n=""4""><number>4</number><trans> for the last stone to have been dropped in an empty hole in a game of <ix>sungkà</ix>. </trans>
</sense>
<sense n=""5""><number>5</number><trans> <tr>new moon</tr>. </trans>
<eg><i lang=""ceb"">Himatayun ang buwan run. Dì na madúgay patay na,</i><trans> We are in the last quarter now. Pretty soon it will be the new moon (no moon). </trans></eg>
</sense>
<sense n=""6""><number>6</number><trans> for nits to be hatched (lit. for the eggshell to be dead). </trans>
</sense>
<sense n=""7""><number>7</number><trans> be head over heels in love. </trans>
<eg><i lang=""ceb"">Patay siya nákù,</i><trans> She’s head over heels in love with me. </trans></eg>
</sense>
<sense n=""8""><number>8</number> <ix>in phrases</ix>: <form id=""patay_ug_duguq"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> ug dugù</form><trans> do s.t. in an unenthusiastic way. </trans>
<eg><i lang=""ceb"">Hinay siyang mangulitáwu kay patayg dugù. Kinahanglan hulhúgun,</i><trans> He isn’t doing a very good job in courting the girl. He is unenthusiastic and needs prodding. </trans></eg>
</sense></hom></entry>
<entry><form id=""patay_guxtum"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> gútum</form>
<hom>
<sense n=""0""><trans> poor as church mice. </trans>
<eg><i lang=""ceb"">Asa gud sila makapaiskuyla sa ílang mga bátang patay gútum man nà sila?</i><trans> How could they send their children to school when they are poor as church mice? </trans></eg>
</sense></hom></entry>
<entry><form id=""patay_nga_iruq"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> nga irù</form>
<hom>
<sense n=""0""><trans> <tr>miserable</tr>, <tr>wretched</tr>. </trans>
<eg><i lang=""ceb"">Patayng irù ang táwung way kwarta,</i><trans> A man who is penniless is miserable. </trans></eg>
</sense></hom></entry>
<entry><form id=""patay_ug_lamiq"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> ug lamì</form>
<hom>
<sense n=""0""><trans> having excessive sexual desires. </trans>
<eg><i lang=""ceb"">Patay kaáyu ug lamì nang bayhána maung kuyawng pangasaw-un,</i><trans> It’s dangerous to marry that woman because she has excessive sexual desires. </trans></eg>
</sense></hom></entry>
<entry><form id=""patay_ug_limud"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> ug limud</form>
<hom>
<sense n=""0""><trans> an <tr>inveterate liar</tr>. </trans>
</sense></hom></entry>
<entry><form id=""paxtay"" lang=""ceb""><abbr expan=""pátay"" type=""lemma"">(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> intense action of killing. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13]</itype><trans> for several killings to be going on. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[C; a12]</itype><trans> fight it out with killing. </trans>
<eg><i lang=""ceb"">Patáyun nátù ang átung dúmut,</i><trans> We’ll settle our hatred by fighting it out to the death. </trans></eg>
</sense></hom></entry>
<entry><form id=""lunud_luxnud_paxtay"" lang=""ceb"">lunud, <pb n=""748""/>lúnud <abbr expan=""pátay"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> <tr>die-hard</tr>, <tr>inveterate</tr>. </trans>
<eg><i lang=""ceb"">Lúnud pátay nga sugarul,</i><trans> An inveterate gambler. </trans></eg>
</sense></hom></entry>
<entry><form id=""pataxyan"" lang=""ceb""><abbr expan=""patáyan"" type=""lemma"">-an(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[C23; c6]</itype><trans> for roosters to fight it out to the death. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> play <ix>patáyan</ix>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> game of betting on heads or tails played by twirling a coin. </trans>
</sense></hom></entry>
<entry><form id=""pataypaxtay"" lang=""ceb"">pataypátay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c]</itype><trans> do s.t. intensely. </trans>
<eg><i lang=""ceb"">Pataypatáyun (ipataypátay) nákù ning ákung láwas sa trabáhu arun ku mabúhì,</i><trans> I wear myself out working just to live. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b(1)]</itype><trans> do, act slowly without energy or enthusiasm. </trans>
<eg><i lang=""ceb"">Ug magpataypátay ka, mabyaan ka sa trák,</i><trans> If you take so long, you’ll miss the bus. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AP]</itype><trans> pretend to be poor when one is rich, be a nobody when one is s.o. </trans>
<eg><i lang=""ceb"">Nagpapataypátay nang tawhána apan unásis diay,</i><trans> That man acts like a nobody but actually he’s an Onassis. </trans></eg>
</sense></hom></entry>
<entry><form id=""patyanay_pinatyaxnay"" lang=""ceb"">patyanay, pinatyánay</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#paxtay""><sc>pátay</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""palatyanan"" lang=""ceb"">palatyanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> place s.t. is killed. </trans>
</sense></hom></entry>
<entry><form id=""patay_sa_utug"" lang=""ceb""><abbr expan=""patay"" type=""lemma"">—</abbr> sa utug</form>
<hom>
<sense n=""0""><trans> girl used to satisfy one’s sexual desires (lit. s.t. to kill one’s erection on). </trans>
</sense>
<sense n=""2""><number>2</number><trans> total part of the body, place in the body which will cause instant death if struck. </trans>
</sense></hom></entry>
<entry><form id=""pamatay"" lang=""ceb""><abbr expan=""pamatay"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. used to kill. </trans>
<eg><i lang=""ceb"">Maáyung pamatay sa kágaw kanang sabúna,</i><trans> That soap is a good germicide.
</trans></eg>
</sense></hom></entry></entry>");
