INSERT INTO `wced_entry` VALUES (13893, "patid", "748", "<entry page=""748"" id=""13893""><form id=""paxtid"" lang=""ceb"">pátid</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> <tr>kick at</tr>. </trans>
<eg><i lang=""ceb"">Kusug mupátid ang plíyir sa sákir,</i><trans> A soccer player kicks hard. </trans></eg>
<eg><i lang=""ceb"">Patíri ang itlug sa kuntra,</i><trans> Kick your opponent in the balls. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c6]</itype><trans> move s.t. s.w. by kicking it. </trans>
<eg><i lang=""ceb"">Ipátid ra ákung sinílas diri,</i><trans> Kick my slippers over to me. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>kick</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> kick of drinks (humorous). </trans>
<eg><i lang=""ceb"">Pwirtig pátid ning tubáa dà,</i><trans> This toddy packs quite a kick. </trans></eg>
</sense></hom>
<entry><form id=""pamaxtid"" lang=""ceb""><abbr expan=""památid"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; a]</itype><trans> kick with intensity. </trans>
<eg><i lang=""ceb"">Nagpamatid siya sa kasukù,</i><trans> He was kicking in anger. </trans></eg>
</sense></hom></entry>
<entry><form id=""patidpaxtid"" lang=""ceb"">patidpátid</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> go on foot in a leisurely manner. </trans>
<eg><i lang=""ceb"">Magpatidpátid lang ku inigpaúlì,</i><trans> I’ll walk home leisurely. </trans></eg>
</sense></hom></entry>
<entry><form id=""patidpaxtid_sa_laxta"" lang=""ceb""><abbr expan=""patidpátid"" type=""lemma"">—</abbr> sa láta</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#patidpaxtid""><sc>patidpátid</sc></xr>, <i lang=""ceb"">v1.</i> </trans>
</sense>
<sense n=""2""><number>2</number><trans> play <ix>patidpátid</ix>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> children’s game of undoing knotted rubberbands with the feet. The one who separates one from the rest wins all of them.
</trans>
</sense></hom></entry></entry>");
