INSERT INTO `wced_entry` VALUES (13895, "patik1", "748", "<entry page=""748"" id=""13895""><form id=""paxtik"" lang=""ceb"">pátik<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>tattoo</tr>, mark with a brand. </trans>
<eg><i lang=""ceb"">Ákù siyang gipatíkan ug agila,</i><trans> I tattooed an eagle on him. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> implant kisses. </trans>
<eg><i lang=""ceb"">Patíkan kug hawuk ang ímung dughan,</i><trans> I’ll cover your breasts with kisses. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>print</tr> or <tr>publish</tr>. </trans>
<eg><i lang=""ceb"">Napátik ang íyang hulagway sa mantaláan,</i><trans> Her picture was published in the newspaper. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[c6]</itype><trans> be fixed indelibly s.w. </trans>
<eg><i lang=""ceb"">Napátik sa ákung kasingkásing ang ímung pangalyúpù,</i><trans> Your pleas have been imprinted in my heart. </trans></eg>
</sense></hom>
<entry><form id=""patik"" lang=""ceb""><abbr expan=""patik"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> implement used for marking animals. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>tattoo</tr>, <tr>brand</tr>. </trans>
<eg><i lang=""ceb"">May patik nga iks sa samput,</i><trans> There is an X branded on the rump. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> explanatory annotation on a land title that it has been made collateral for a loan. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[b(1)]</itype><trans> be so annotated. </trans>
<eg><i lang=""ceb"">Napatikan na giyud ang ákung titulu,</i><trans> I finally had to borrow on my land. (Lit. My land has finally gotten an annotation.) </trans></eg>
</sense></hom></entry>
<entry><form id=""patikaxnan"" lang=""ceb""><abbr expan=""patikánan"" type=""lemma"">-ánan</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>printing press</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pinatikan"" lang=""ceb""><abbr expan=""pinatikan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who has been tattooed, esp. ex-convicts. </trans>
</sense></hom></entry>
<entry><form id=""magpapatik_magpalatik"" lang=""ceb""><abbr expan=""magpapatik"" type=""lemma"">mag-r-(→)</abbr>, <abbr expan=""magpalatik"" type=""lemma"">mag-l-(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>publisher</tr>, <tr>printer</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one who brands or tattooes.
</trans>
</sense></hom></entry></entry>");
