INSERT INTO `wced_entry` VALUES (13900, "pating", "748", "<entry page=""748"" id=""13900""><form id=""pating"" lang=""ceb"">pating</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> general name for small sharks. </trans>
</sense></hom>
<entry><form id=""pating_nga_bungul"" lang=""ceb""><abbr expan=""pating"" type=""lemma"">—</abbr> nga bungul</form>
<hom>
<sense n=""1""><number>1</number><trans> k.o. shark. </trans>
</sense>
<sense n=""2""><number>2</number><trans> deaf as a door post (lit. like a <ix>pating</ix>). </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> unconcerned about what is right or wrong (from the notion that one acting this way is being deaf to what people say just as the <ix>pating</ix> is called <ix>bungul</ix> ‘deaf’). </trans>
<eg><i lang=""ceb"">Pating giyud nang batáa. Dì giyud magtamud bísag unsáug pína,</i><trans> That child doesn’t care to be good. He won’t obey no matter how much you tell him. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B46; c]</itype><trans> not give a damn about whether an action is right or not. </trans>
</sense></hom></entry>
<entry><form id=""papating"" lang=""ceb""><abbr expan=""papating"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1346; c16]</itype><trans> be deaf to s.t. </trans>
<eg><i lang=""ceb"">Nagpapating lang siya sa ákung pagpakiluuy,</i><trans> He was deaf to my pleas. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c16]</itype><trans> do s.t. regarded as wrong no matter what people think. </trans>
<eg><i lang=""ceb"">Nagpapating ang bigáun bísag bulgǎr sa kadaghánan,</i><trans> The over sexed woman didn’t care what people said any more. She went right ahead even though everybody knew about it. </trans></eg>
</sense></hom></entry>
<entry><form id=""patingpaxting"" lang=""ceb"">patingpáting</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12; b(1)]</itype><trans> ignore, pretend not to hear. </trans>
<eg><i lang=""ceb"">Ayúhag pamínaw kining ákung súgù. Ayaw kug patingpatíngi,</i><trans> Listen carefully to what I tell you to do. Don’t just ignore me.
</trans></eg>
</sense></hom></entry></entry>");
