INSERT INTO `wced_entry` VALUES (13920, "pat-ul1", "749", "<entry page=""749"" id=""13920""><form id=""pat-ul"" lang=""ceb"">pat-ul<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put s.t. where it can be chopped, hit, or broken. </trans>
<eg><i lang=""ceb"">Kining tadtaran mauy pat-úlan inigtadtad sa bukug,</i><trans> Put the bone on this chopping block, when you chop up the bones. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> put s.t. on top of s.t. for a short period of time. </trans>
<eg><i lang=""ceb"">Íyang gipat-úlan ug ínit nga hampul ang íyang bun-ug,</i><trans> He put a hot compress on his bruises. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> put the blame on s.o. </trans>
<eg><i lang=""ceb"">Íyang gipat-ul nákù ang tanang salà,</i><trans> She put all the blame on me. </trans></eg>
