INSERT INTO `wced_entry` VALUES (13924, "patung", "749", "<entry page=""749"" id=""13924""><form id=""paxtung"" lang=""ceb"">pátung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> place s.t. on top of s.t. else. </trans>
<eg><i lang=""ceb"">Ang lángaw nga makapatung sa kábaw magpakakábaw sad,</i><trans> A fly that alights on a carabao thinks he, too, is a carabao (becomes swell-headed). </trans></eg>
<eg><i lang=""ceb"">Patúngi ang mga papil arun dì manglúpad,</i><trans> Put a weight on the papers so they won’t get blown away. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pile</tr>. </trans>
<eg><i lang=""ceb"">Natumpag ang pátung sa mga diláta,</i><trans> The cans that were stacked up neatly came tumbling down. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>interest</tr> on money. </trans>
<eg><i lang=""ceb"">Pilay pátung sa kwartang ímung gihulaman?</i><trans> How much interest did they charge on the money you borrowed? </trans></eg>
</sense></hom>
<entry><form id=""patungpatung"" lang=""ceb"">patungpatung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB6; c1]</itype><trans> <tr>pile</tr>, be <tr>piled up</tr>, <tr>accumulated</tr>. </trans>
<eg><i lang=""ceb"">Nagpatungpatung ang ákung trabáhu, maung sígi kug ubirtayim,</i><trans> My work is piling up, so I keep having to work overtime. </trans></eg>
</sense></hom></entry>
<entry><form id=""hipatung_hapatung_hipaxtung_hapaxtung"" lang=""ceb""><abbr expan=""hipatung"" type=""lemma"">hi-</abbr>/<abbr expan=""hapatung"" type=""lemma"">ha-(→)</abbr>, <abbr expan=""hipátung"" type=""lemma"">hi-</abbr>/<abbr expan=""hapátung"" type=""lemma"">ha-</abbr></form>
<hom>
<sense n=""0""> <itype>[B1256]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be at the top of s.t. </trans>
<eg><i lang=""ceb"">Paghipátung níla sa bungtud,</i><trans> When they reached the top of the mountain. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> reach a certain height of affluence. </trans>
<eg><i lang=""ceb"">Nahipátung ku sa kahamugáway kay nakadaug kus swipstiks,</i><trans> I was on easy street when I won the sweepstakes.
</trans></eg>
</sense></hom></entry></entry>");
