INSERT INTO `wced_entry` VALUES (13925, "patupatu", "749", "<entry page=""749"" id=""13925""><form id=""patuqpaxtuq"" lang=""ceb"">patùpátù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> compose lines, extemporaneously, to form a rhyme. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> fabricate insidious gossip against others. </trans>
<eg><i lang=""ceb"">Maáyu <pb n=""750""/>kang mupatùpátù sa mga butang nga wà mahímù sa ímung isig ka táwu,</i><trans> You are good at inventing gossip about other people, things they couldn’t possibly have done. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> rhymes composed extemporaneously. </trans>
<eg><i lang=""ceb"">Sa balítaw ang ditsu patùpátù,</i><trans> In the courtship poems, the verses are extemporaneous. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fabrication made up against s.o.
</trans>
</sense></hom></entry>");
