INSERT INTO `wced_entry` VALUES (13929, "paud", "750", "<entry page=""750"" id=""13929""><form id=""paud"" lang=""ceb"">paud</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; bc]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> put s.t. against or over s.t. hard to steady it. </trans>
<eg><i lang=""ceb"">Pad-i ang libru sa ímung pagsulat,</i><trans> Write on top of the book. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> press s.t. against s.t. hard with one’s weight. </trans>
<eg><i lang=""ceb"">Gitabangan nílag paud ang búang sa bungbung,</i><trans> They all pressed the lunatic against the wall. </trans></eg>
<eg><i lang=""ceb"">Napaud ku sa pusti pagtulud niya,</i><trans> I was knocked against the post when he pushed me. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> press part of the body against s.t. </trans>
<eg><i lang=""ceb"">Íyang gipaud ang íyang dughan sa ákung likud,</i><trans> She pressed her breast against my back. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> fix the sight on s.t. </trans>
<eg><i lang=""ceb"">Gipaud ku sa kisami ang ákung mga mata,</i><trans> I fixed my eyes to the ceiling. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[b]</itype><trans> put the blame on s.o. </trans>
<eg><i lang=""ceb"">Ngánung aku may pad-an sa ímung salà<corr sic="","">?</corr></i><trans> Why do you put the blame on me for what you did? </trans></eg>
</sense></hom>
<entry><form id=""pad-anan"" lang=""ceb"">pad-anan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> buffer for s.t. one writes or applies pressure on.
</trans>
</sense></hom></entry></entry>");
