INSERT INTO `wced_entry` VALUES (13937, "paw-ang", "750", "<entry page=""750"" id=""13937""><form id=""paw-ang"" lang=""ceb"">paw-ang</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>gap</tr> between things that are normally solid or close to each other. </trans>
<eg><i lang=""ceb"">Daghang paw-ang ang pinugsan sa mais,</i><trans> The way they planted the corn the plants are too far apart. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> distance in time. </trans>
<eg><i lang=""ceb"">Dakù ang paw-ang sa idad sa magtiáyun,</i><trans> The couple are quite far apart in age. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; c1]</itype><trans> <tr>have spaces</tr> in between. </trans>
<eg><i lang=""ceb"">Ang bungbung mupaw-ang (mapaw-ang) ug dílì pakupsun ang káhuy,</i><trans> Cracks will develop in the wall if the wood is not aged beforehand. </trans></eg>
<eg><i lang=""ceb"">Nagpaw-ang ang pultahan maung nakasulud ang ilagà,</i><trans> The door was ajar and so a mouse managed to get in. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; c1]</itype><trans> <tr>miss</tr>, <tr>skip</tr>. </trans>
<eg><i lang=""ceb"">Nakapaw-ang siyag usa ka linya,</i><trans> He skipped a line.
</trans></eg>
</sense></hom></entry>");
