INSERT INTO `wced_entry` VALUES (13944, "pawpaw", "750", "<entry page=""750"" id=""13944""><form id=""pawpaw"" lang=""ceb"">pawpaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab7]</itype><trans> scoop s.t. off the surface of s.t. to remove it. </trans>
<eg><i lang=""ceb"">Pawpáwa ang nanglútaw nga buwà sa tubà,</i><trans> Scoop off the foam from the toddy. </trans></eg>
