INSERT INTO `wced_entry` VALUES (14033, "pigadu", "754", "<entry page=""754"" id=""14033""><form id=""pigaxdu"" lang=""ceb"">pigádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for an area to be too small for s.t. </trans>
<eg><i lang=""ceb"">Pigádu kaáyu ning baláya pára ninyu,</i><trans> This house is too small for you. </trans></eg>
<eg><i lang=""ceb"">Pigádu ra ning baláya sa dálan,</i><trans> This house is too close to the street. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> hard up financially. </trans>
<eg><i lang=""ceb"">Pigádu mi kay wà kuy trabáhu,</i><trans> We are hard up because I have no work. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for there not to be enough time. </trans>
<eg><i lang=""ceb"">Pigádu na rung ipaúlì,</i><trans> There is not enough time to get home any more. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> in billiards, for the cue ball to be touching another ball or be touching the edge of the billiard table. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B12; c1]</itype><trans> get to be too small in space or area. </trans>
<eg><i lang=""ceb"">Nagkapigádu ang ákung mga sinínà nga nanambuk na ku,</i><trans> My dresses are getting too tight as I gain weight. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12]</itype><trans> get to be hard up financially. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A]</itype><trans> give s.o. little time to do s.t. </trans>
<eg><i lang=""ceb"">Mipigádu siya ug paningil kay nanginahanglan giyud,</i><trans> He pressed his debtors for immediate payment because he needed the money.
</trans></eg>
</sense></hom></entry>");
