INSERT INTO `wced_entry` VALUES (14040, "pigit", "755", "<entry page=""755"" id=""14040""><form id=""pigit"" lang=""ceb"">pigit</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for the string of a musical instrument not to sound well because of s.t. that impedes proper vibration. </trans>
<eg><i lang=""ceb"">Ang tíngug sa íyang sista pigit kaáyu,</i><trans> His guitar doesn’t give a full sound. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for the voice to be cracked. </trans>
<eg><i lang=""ceb"">Pigit kaáyu ang íyang tíngug ug mutaas ang kanta,</i><trans> Her voice cracks in the upper register. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for rounded things not to be true, out of shape. </trans>
<eg><i lang=""ceb"">Ang íyang kasing pigit kaáyu,</i><trans> His top is very much out of true. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> be, become cracked, out of shape; fail to vibrate properly.
</trans>
</sense></hom></entry>");
