INSERT INTO `wced_entry` VALUES (14041, "pig-it1", "755", "<entry page=""755"" id=""14041""><form id=""pig-it"" lang=""ceb"">pig-it<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>narrow</tr>, <tr>tight</tr>. </trans>
<eg><i lang=""ceb"">Pig-it nga sinínà,</i><trans> A tight dress. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; a12]</itype><trans> become tight-fitting, be narrow. </trans>
<eg><i lang=""ceb"">Napig-it ang ákung sinínà kay mikúlù,</i><trans> My dress became tight because it shrunk. </trans></eg>
<eg><i lang=""ceb"">Ug pig-itun ang kalsáda dílì makaági ang trák,</i><trans> If the road is made too narrow, the bus won’t be able to use it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> press s.t. tightly in one’s hand or embrace. </trans>
<eg><i lang=""ceb"">Ang mga kandidátu kusug mupig-it ug kamut,</i><trans> The candidates are shaking hands for all they are worth. </trans></eg>
<eg><i lang=""ceb"">Ayaw pig-íta ang bátà pagkúgus,</i><trans> Don’t hold the baby too close. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> pressure s.o. into doing s.t. </trans>
<eg><i lang=""ceb"">Pig-íta arun musugut,</i><trans> Exert pressure on her so that she will accept you. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b5]</itype><trans> subject s.o. to strong disciplinary constraint. </trans>
<eg><i lang=""ceb"">Kinahanglan pig-ítan ang anak nga dalága,</i><trans> It is necessary to keep tight reins on one’s daughter. </trans></eg>
</sense></hom>
<entry><form id=""pinig-ixtan"" lang=""ceb""><abbr expan=""pinig-ítan"" type=""lemma"">-in-ay</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> press, shake each other’s hands. </trans>
<eg><i lang=""ceb"">Nagpinig-ítay sa kamut ang mga bisíta,</i><trans> The guests were shaking each other’s hands.
</trans></eg>
</sense></hom></entry></entry>");
