INSERT INTO `wced_entry` VALUES (14045, "pigsang", "755", "<entry page=""755"" id=""14045""><form id=""pigsang"" lang=""ceb"">pigsang</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for flowers to be in full bloom. </trans>
<eg><i lang=""ceb"">Mipigsang ang mga búlak sa hardin,</i><trans> The flowers in the garden bloomed. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> for s.t. to manifest itself to a great extent. </trans>
<eg><i lang=""ceb"">Nagpigsang ang íyang nawung sa kaúlaw,</i><trans> His face became flushed with shame. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for a sickness to be developing to a stage where a rash or skin inflammation will burst out. </trans>
<eg><i lang=""ceb"">Mipigsang na ang íyang tipdas,</i><trans> His measles is in the incubation period. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AB; a]</itype><trans> for pus to come out of infections; cause to do so. </trans>
<eg><i lang=""ceb"">Mupigsang nang hubag mu ug pislítun,</i><trans> The pus will come out of your boil if you press it. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> flourishing, manifesting itself in great quantities or to a great extent. </trans>
</sense>
<sense n=""2""><number>2</number><trans> full of pus.
</trans>
</sense></hom></entry>");
