INSERT INTO `wced_entry` VALUES (14055, "pig-ut", "755", "<entry page=""755"" id=""14055""><form id=""pig-ut"" lang=""ceb"">pig-ut</form>
<hom>
<sense n=""0""><trans> (from <ix>piut</ix>) </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>narrow</tr>, not affording enough space. </trans>
</sense>
<sense n=""2""><number>2</number><trans> hard up financially. </trans>
<eg><i lang=""ceb"">Pig-ut ang ámung kahimtang,</i><trans> We are in a tight financial situation now. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>ugly</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> become small, narrow in space. </trans>
<eg><i lang=""ceb"">Napig-ut ang kwartu sa mga butang,</i><trans> The room was crowded with so many things inside it. </trans></eg>
<eg><i lang=""ceb"">Nagkapig-ut ang dálan ngadtu sa búkid,</i><trans> The trail into the mountain gets narrower and narrower. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get financially hard up. </trans>
</sense>
<sense n=""3""><number>3</number><trans> become ugly. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> subject s.o. under one’s care to tight restrictions. </trans>
<eg><i lang=""ceb"">Dì ku mupig-ut ninyu basta magtárung mu,</i><trans> I won’t be too strict with you as long as you behave. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[A; b5]</itype><trans> <pb n=""756""/>pressure s.o. into s.t. </trans>
<eg><i lang=""ceb"">Dílì siya mubáyad ug dílì pig-útun (pig-útan),</i><trans> She won’t pay if you don’t press her.
</trans></eg>
</sense></hom></entry>");
