INSERT INTO `wced_entry` VALUES (14058, "pihar", "756", "<entry page=""756"" id=""14058""><form id=""pihar"" lang=""ceb"">pihar</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A12; b8]</itype><trans> notice s.t. </trans>
<eg><i lang=""ceb"">Wà ku makapihar nga miági siya,</i><trans> I did not notice that he passed by. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a12]</itype><trans> make sure of s.t. </trans>
<eg><i lang=""ceb"">Pihara ug náa ba giyud siya,</i><trans> Make sure if she is really there. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12]</itype><trans> have the edge or advantage in doing s.t. </trans>
<eg><i lang=""ceb"">Nakapihar siya sa tanang aplikanti kay paryinti man,</i><trans> He had the edge over the other applicants because he was a relative. </trans></eg>
</sense></hom>
<entry><form id=""pihaxdu"" lang=""ceb"">pihádu</form>
<hom>
<sense n=""0""><trans> be certain. </trans>
<eg><i lang=""ceb"">Pihádu kaáyu kung kawatan siya,</i><trans> I’m certain he is a thief. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1256; a12]</itype><trans> make, become sure of s.t. </trans>
<eg><i lang=""ceb"">Pihadúa úsag túa na ba siya,</i><trans> Make sure he’s gone first.
