INSERT INTO `wced_entry` VALUES (14059, "pihaw", "756", "<entry page=""756"" id=""14059""><form id=""pihaw"" lang=""ceb"">pihaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>embarrassed</tr>, <tr>self-conscious</tr>. </trans>
<eg><i lang=""ceb"">Pihaw kaáyu ang íyang linihukan,</i><trans> She acts in a very self-conscious manner. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>out of tune</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> embarrass slightly. </trans>
<eg><i lang=""ceb"">Napihaw ku kay hisakpan kung nagpasiklap,</i><trans> I was embarrassed because she caught me stealing a glance at her. </trans></eg>
</sense>
