INSERT INTO `wced_entry` VALUES (14067, "piit", "756", "<entry page=""756"" id=""14067""><form id=""piit"" lang=""ceb"">piit</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>too narrow</tr>. </trans>
<eg><i lang=""ceb"">Piit kaáyu siyag sinínà,</i><trans> She has a very tight dress on. </trans></eg>
<eg><i lang=""ceb"">Piit kaáyung dálan,</i><trans> Too narrow a street. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> close, not affording proper distance. </trans>
<eg><i lang=""ceb"">Piit kaáyu siya nga mubayli,</i><trans> He dances too close. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; a]</itype><trans> for an area to be too narrow or small, get into too narrow a place. </trans>
<eg><i lang=""ceb"">Napiit ang ilagà sa káhuy,</i><trans> The mouse was wedged tight in the firewood. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; a]</itype><trans> hold s.t. tightly, in a close embrace. </trans>
<eg><i lang=""ceb"">Gipiit ni Inting ang láwas ni Tabúra,</i><trans> Inting held Tabora’s body in a close embrace. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> compel s.o. to do s.t. with pressure. </trans>
<eg><i lang=""ceb"">Pit-un gánì ku, mutug-an na lang ku,</i><trans> If I’m pressed, I’ll tell the truth. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B; c1]</itype><trans> for a singing voice to be tight and forced on a high pitch. </trans>
<eg><i lang=""ceb"">Mupiit ang tíngug ug taas kaáyu ang núta,</i><trans> The singing voice becomes tight on very high notes. </trans></eg>
</sense></hom>
<entry><form id=""piixtan"" lang=""ceb""><abbr expan=""piítan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> contrivance to squeeze juice out of s.t. slowly, made of two pieces of wood, the top of which is weighed down.
</trans>
</sense></hom></entry></entry>");
