<eg><i lang=""ceb"">Human makapika sa táwu, nanágan sila,</i><trans> After beating the man, they fled. </trans></eg>
<eg><i lang=""ceb"">Pikhi nang tawhána,</i><trans> Give that fellow a beating. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> berate s.o. with stinging words. </trans>
<eg><i lang=""ceb"">Gipikahan ni Maryu ug insultu ang kandidátu sa upusisiyun,</i><trans> Mario insulted the opposition candidate with stinging criticisms. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> take a picture. </trans>
<eg><i lang=""ceb"">Gipikhan ku níya samtang nagsáyaw,</i><trans> He took a picture of me dancing. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; b]</itype><trans> have sexual intercourse (euphemism). </trans>
<eg><i lang=""ceb"">Makapika ka bag kalima?</i><trans> Can you do it five times? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> blow delivered. <pb n=""757""/></trans>
</sense>
<sense n=""2""><number>2</number><trans> action of having intercourse.
