INSERT INTO `wced_entry` VALUES (14075, "pik-ap4", "757", "<entry page=""757"" id=""14075""><form id=""pik-ap4"" lang=""ceb"">pik-ap<sub>4</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2N; a2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> pick s.o. up on the way s.w. </trans>
<eg><i lang=""ceb"">Kun makapik-ap ka nákus upisína, pik-ápa na lang ku kay dúna ka may sakyanan,</i><trans> If you can pick me up at the office, please do so, as you have a car. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pick up girls of easy virtue in public places. </trans>
<eg><i lang=""ceb"">Namik-ap mig babáyi sa pwinti,</i><trans> We found some pickups at the park.
</trans></eg>
</sense></hom></entry>");
