INSERT INTO `wced_entry` VALUES (14076, "pikas", "757", "<entry page=""757"" id=""14076""><form id=""pixkas"" lang=""ceb"">píkas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3P; a]</itype><trans> split, cut s.t. into halves lengthwise. </trans>
<eg><i lang=""ceb"">Siyay mipíkas sa kawáyan,</i><trans> He split the bamboos. </trans></eg>
<eg><i lang=""ceb"">Pikása ang isdang ibuwad,</i><trans> Split the fish you are going to dry. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C2; a2]</itype><trans> share half of s.t. with s.o. else. </trans>
<eg><i lang=""ceb"">Magpíkas ta áning pán,</i><trans> Let’s split this piece of bread. </trans></eg>
<eg><i lang=""ceb"">Pikási siyas ímung gikaun,</i><trans> Split what you’re eating with him. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> half of s.t. sliced in two. </trans>
<eg><i lang=""ceb"">Usa ka píkas kík,</i><trans> A piece of cake. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the other one of a pair. </trans>
<eg><i lang=""ceb"">Dakù ang íyang píkas tiil,</i><trans> His one foot is bigger than the other. </trans></eg>
<eg><i lang=""ceb"">Píkas tumuy,</i><trans> The other end. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> the other side. </trans>
<eg><i lang=""ceb"">Píkas kwartu,</i><trans> The next room. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> the other place (said of people who may be in either one of two places). </trans>
<eg><i lang=""ceb"">Túa siya sa píkas báy,</i><trans> He is in the other house. </trans></eg>
</sense></hom>
<entry><form id=""pikas"" lang=""ceb""><abbr expan=""pikas"" type=""lemma"">(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B456; a1]</itype><trans> get to be half undone, half the wrong thing. </trans>
<eg><i lang=""ceb"">Mupikas ang linung-ag ug dílì maángay ang kaláyu,</i><trans> The rice will get cooked on only one side if the fire is uneven. </trans></eg>
<eg><i lang=""ceb"">Nagpikas ang ímung sapátus,</i><trans> You’re wearing shoes of two different pairs. </trans></eg>
<eg><i lang=""ceb"">Nagpikas ang sawug kay katungà ray gilampasúhan,</i><trans> The floor is unevenly cleaned because only half of it was polished. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for s.t. to be uneven and half-done or in pairs. </trans>
