<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> part in the hair. </trans>
<eg><i lang=""ceb"">Náa sa tungà ang íyang piníkas,</i><trans> His hair is parted in the middle. </trans></eg>
