<sense n=""2""><number>2</number><trans> combing the hair with a part. </trans>
<eg><i lang=""ceb"">Piníkas ang íyang sinudlayan,</i><trans> He wears his hair parted. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
