INSERT INTO `wced_entry` VALUES (14077, "pikat1", "757", "<entry page=""757"" id=""14077""><form id=""pikat"" lang=""ceb"">pikat<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; a2]</itype><trans> draw down the lower eyelid either to get s.t. out of it or to make faces at a person in a gesture of disrespect. </trans>
<eg><i lang=""ceb"">Ug dì ka mupikat sa ímung mata unsáun man pagkúhà sa puling,</i><trans> If you do not pull the lower eyelid down, how can I get the particle out. </trans></eg>
<eg><i lang=""ceb"">Pikatan ta ka ug dílì musalir nang ímung kaláki,</i><trans> I will make faces at you (by pulling my eyelid down) if your idea does not work right. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B]</itype><trans> for the eyelids to get deformed. </trans>
<eg><i lang=""ceb"">Mapikat ang mata ug hubagan ang tabuntábun,</i><trans> The eyes will get deformed if the eyelids have a boil. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for the eyes to be slightly deformed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> interjection used to embarrass s.o. who made a mistake or who has been denied s.t., uttered together with the gesture of putting the index finger to the lower eyelid and drawing it down. </trans>
<eg><i lang=""ceb"">Pikat! Wà siya tagáig kwarta, Nma!</i><trans> You didn’t get any money.
</trans></eg>
</sense></hom></entry>");
