INSERT INTO `wced_entry` VALUES (14087, "pikit1", "758", "<entry page=""758"" id=""14087""><form id=""pixkit"" lang=""ceb"">píkit<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> hold s.t. by clipping or joining it in some way. </trans>
<eg><i lang=""ceb"">Pikítun (ipíkit) nátù nang ímung sinínà ug alpilir,</i><trans> Let us fasten your dress with a pin. </trans></eg>
<eg><i lang=""ceb"">Pikíti ang ímung buhuk arun dílì ilupad sa hángin,</i><trans> Put a clasp in your hair so it will not fly in the wind. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AC; c1]</itype><trans> glue s.t., stick together. </trans>
<eg><i lang=""ceb"">Pikíta (ipíkit) nang nagísing mápa,</i><trans> Paste the torn map back together. </trans></eg>
<eg><i lang=""ceb"">Nagkapíkit núun ning mga silyu,</i><trans> The stamps are all stuck together. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[AC; c1]</itype><trans> make s.t. close, tight. </trans>
<eg><i lang=""ceb"">Nagkapíkit mig lingkud,</i><trans> We sat too close to each other. </trans></eg>
<eg><i lang=""ceb"">Ug ímung pikítun (ipíkit) ang ímung sinínà mulakra ang ímung samput,</i><trans> If your dress is too tight, your buttocks will show. </trans></eg>
</sense></hom>
<entry><form id=""pikit"" lang=""ceb""><abbr expan=""pikit"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> clip or ferrule tied around s.t. to hold it together: handle of knives, swords, and the like, hoop of a barrel, loop to hold the outriggers to the body of the boat. </trans>
</sense>
<sense n=""2""><number>2</number><trans> glue or s.t. used to fasten things in place or together. </trans>
</sense>
<sense n=""3""><number>3</number><trans> ring (slang). </trans>
<eg><i lang=""ceb"">Gitagáan siya sa iyang bána ug pikit nga diyamanti,</i><trans> Her husband gave her a diamond ring. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>sticking</tr>, <tr>stuck</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B6]</itype><trans> become stuck. </trans>
<eg><i lang=""ceb"">Mupikit ang buling ug dì ka malígù,</i><trans> The dirt will stick to you if you don’t bathe. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C; c]</itype><trans> wear a ring (slang).
</trans>
</sense></hom></entry></entry>");
