INSERT INTO `wced_entry` VALUES (14091, "pikpik", "758", "<entry page=""758"" id=""14091""><form id=""pikpik"" lang=""ceb"">pikpik</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3; a12]</itype><trans> <tr>pat</tr>, <tr>tap</tr> lightly on the body. </trans>
<eg><i lang=""ceb"">Dinhay nagpikpik sa ákung abága,</i><trans> S.o. tapped me on the shoulder. </trans></eg>
<eg><i lang=""ceb"">Pikpíka ang tiyan sa bátà ug dì ba butud,</i><trans> Tap the child’s stomach to see if he doesn’t have gas. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> make pottery by tapping with a flat wooden paddle. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A13; a12]</itype><trans> hammer out dents in a car. </trans>
<eg><i lang=""ceb"">Kinsay nagpikpik sa mga lumping sa tapalúdus awtu?</i><trans> Who hammered out the dents in the car fender? </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> small and short wooden paddle used by the potters in shaping pots. </trans>
</sense>
<sense n=""2""><number>2</number><trans> k.o. sorcery inflicted by tapping s.o. on the back, counteracted by tapping the person who sent it on his back. </trans>
</sense></hom>
<entry><form id=""mamimikpik"" lang=""ceb""><abbr expan=""mamimikpik"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>potter</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> person who removes dents from an automotive vehicle body. </trans>
</sense></hom></entry>
<entry><form id=""mamilikpik"" lang=""ceb""><abbr expan=""mamilikpik"" type=""lemma"">maN-l-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>sorcerer</tr> who causes illness by means of <ix>pikpik</ix>.
</trans>
</sense></hom></entry></entry>");
