INSERT INTO `wced_entry` VALUES (14099, "pikut1", "758", "<entry page=""758"" id=""14099""><form id=""pixkut"" lang=""ceb"">píkut<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
