INSERT INTO `wced_entry` VALUES (14113, "pilaw", "759", "<entry page=""759"" id=""14113""><form id=""pilaw"" lang=""ceb"">pilaw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>vigil</tr>. </trans>
<eg><i lang=""ceb"">Dúgay kaáyu ang ámung pilaw sa minatay,</i><trans> We held a long vigil for the dead. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>drowsy</tr>, <tr>sleepy</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> not having sleep. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A123P; a4]</itype><trans> become drowsy or feel sleepy. </trans>
<eg><i lang=""ceb"">Makapilaw (makapapilaw) man ning trabahúa,</i><trans> This work makes you sleepy. </trans></eg>
<eg><i lang=""ceb"">Gipilaw na ku,</i><trans> I’m sleepy. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> take a <tr>nap</tr>, snatch <tr>sleep</tr>. </trans>
<eg><i lang=""ceb"">Mipilaw kug kadalì únà mutrabáhu,</i><trans> I took a quick nap before I went to work. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> go without sleep, have a vigil. </trans>
<eg><i lang=""ceb"">Pilawan námug bantay ang kawatan,</i><trans> We will stay up all night watching for the robber. </trans></eg>
</sense></hom>
<entry><form id=""tagpilaw"" lang=""ceb""><abbr expan=""tagpilaw"" type=""lemma"">tag-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> take a quick nap. </trans>
<eg><i lang=""ceb"">Mutagpilaw ku kadiyut,</i><trans> I’ll take a quick nap. </trans></eg>
</sense></hom></entry>
<entry><form id=""hatagpilaw_hitagpilaw"" lang=""ceb""><abbr expan=""hatagpilaw"" type=""lemma"">hatag-</abbr>, <abbr expan=""hitagpilaw"" type=""lemma"">hitag-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1246; b8]</itype><trans> <tr>doze off</tr>. </trans>
<eg><i lang=""ceb"">Nahitagpilaw ku sa sinihan,</i><trans> I dozed off in the movies.
</trans></eg>
</sense></hom></entry></entry>");
