INSERT INTO `wced_entry` VALUES (14114, "pilay", "759", "<entry page=""759"" id=""14114""><form id=""pixlay"" lang=""ceb"">pílay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2S6; a]</itype><trans> <tr>bend</tr> or <tr>droop</tr> at its base <pb n=""760""/>limply. </trans>
<eg><i lang=""ceb"">Nagpilay ang bátà nga nahikatulug sa silya,</i><trans> The child drooped his head when he fell asleep in his seat. </trans></eg>
<eg><i lang=""ceb"">Nagpílay ang humay nga naagian sa bahà,</i><trans> The rice plants were bent double after the flood rushed over them. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> fell trees. </trans>
<eg><i lang=""ceb"">Mangadtu ta sa lasang magpílay ug káhuy,</i><trans> Let’s go to the forest to cut trees. </trans></eg>
</sense></hom>
<entry><form id=""pilaypixlay"" lang=""ceb"">pilaypílay</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> be swaying to and fro. </trans>
<eg><i lang=""ceb"">Nagpilaypílay ang uhay,</i><trans> The rice stalks are swaying. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>spineless</tr>, as a person without conviction. </trans>
<eg><i lang=""ceb"">Pilaypílay nà sa pulitika,</i><trans> He has no convictions in his politics. †
</trans></eg>
</sense></hom></entry></entry>");
