INSERT INTO `wced_entry` VALUES (14116, "pildi", "760", "<entry page=""760"" id=""14116""><form id=""pildi"" lang=""ceb"">pildi</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3P; a]</itype><trans> <tr>lose</tr> in a contest. </trans>
<eg><i lang=""ceb"">Mupildi siyag nilibu,</i><trans> He loses by the thousands. </trans></eg>
<eg><i lang=""ceb"">Wà pay nakapildi sa kampiyun,</i><trans> No one has beaten the champion yet. </trans></eg>
<eg><i lang=""ceb"">Mu ra ka mag napildi sa sugal,</i><trans> You look as if you lost in gambling. </trans></eg>
<eg><i lang=""ceb"">Gipildi ang ílang kandidáta sa ámù,</i><trans> Our candidate beat theirs. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B126; a4]</itype><trans> die of a sickness. </trans>
<eg><i lang=""ceb"">Pildíhun (mapildi) ka sa tísis ug dì ka mupatambal,</i><trans> You’ll die of <asc>TB</asc> if you don’t get treatment. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> cause a woman to lose her virtue. </trans>
<eg><i lang=""ceb"">Ang uyuan ray mipildi ánang bayhána,</i><trans> That woman was despoiled by her own uncle. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>loser</tr>. </trans>
<eg><i lang=""ceb"">Kinsay pildi?</i><trans> Who lost? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>loss</tr>, as in gambling, business, crops. </trans>
<eg><i lang=""ceb"">Dakù ang pildi sa ákung humay pagbagyu,</i><trans> The rice field suffered a big loss because of the storm. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>outclassed</tr>. </trans>
<eg><i lang=""ceb"">Pildi kaáyu ang tím ninyu,</i><trans> Your team was severely beaten. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> an exclamation of disgust, disappointment. </trans>
<eg><i lang=""ceb"">‘Pildi!’ nakasinggit si Isku. ‘Gihabhab ang ákung karsúnis sa bábuy,’</i><trans> ‘Damn!’ shouted Esco. ‘The pig ate my trousers.’ </trans></eg>
</sense></hom>
<entry><form id=""kapildixhan"" lang=""ceb"">kapildíhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>loss</tr>, <tr>defeat</tr>. </trans>
<eg><i lang=""ceb"">Angkúna ang ímung kapildíhan,</i><trans> Concede your defeat. </trans></eg>
</sense></hom></entry>
<entry><form id=""pildixru"" lang=""ceb""><abbr expan=""pildíru"" type=""lemma"">-ru</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> loser (male). </trans>
<eg><i lang=""ceb"">Pildíru sa iliksiyun,</i><trans> The losers in the election. </trans></eg>
</sense></hom></entry>
<entry><form id=""pildixra"" lang=""ceb""><abbr expan=""pildíra"" type=""lemma"">-ra</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#pildixru""><sc>pildíru</sc></xr> (female). †
</trans>
</sense></hom></entry></entry>");
