INSERT INTO `wced_entry` VALUES (14120, "pilhuk1", "760", "<entry page=""760"" id=""14120""><form id=""pilhuk"" lang=""ceb"">pilhuk<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
