<eg><i lang=""ceb"">Mupilhuk kug kadiyut kay dúna kuy pamuwáwan,</i><trans> I’ll take a catnap because I have to work all night through. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1]</itype><trans> for the eyes to droop in drowsiness. </trans>
<eg><i lang=""ceb"">Katū́g na kay nagpilhuk na nang ímung mata,</i><trans> You’d better go to sleep now because your eyes are drooping.
