INSERT INTO `wced_entry` VALUES (14126, "piligru", "760", "<entry page=""760"" id=""14126""><form id=""piligru"" lang=""ceb"">piligru</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> offering or exposed to danger. </trans>
<eg><i lang=""ceb"">Piligru ang kahimtang sa masakitun,</i><trans> The patient’s condition is critical. </trans></eg>
<eg><i lang=""ceb"">Piligru ang kinabúhì sa ismaglir,</i><trans> A smuggler’s life is full of danger. </trans></eg>
<eg><i lang=""ceb"">Piligru ning baláya,</i><trans> This house is unsafe. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>danger</tr>. </trans>
<eg><i lang=""ceb"">Ginúu ilikay ku sa mga piligru!</i><trans> Lord, keep me safe from danger. </trans></eg>
