INSERT INTO `wced_entry` VALUES (14146, "pilit", "761", "<entry page=""761"" id=""14146""><form id=""pilit"" lang=""ceb"">pilit</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC3; b6]</itype><trans> <tr>stick on</tr>. </trans>
<eg><i lang=""ceb"">Mipilit ang tikì sa ákung tangkúgù,</i><trans> The gecko stuck to the nape of my neck. </trans></eg>
<eg><i lang=""ceb"">Nagpílit ang mga silyu,</i><trans> The stamps got stuck to each other. </trans></eg>
<eg><i lang=""ceb"">Pitlan tag istíkir ang kutsi,</i><trans> Let’s stick a sticker on the car. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A23]</itype><trans> stick to one’s lover (slang). </trans>
<eg><i lang=""ceb"">Mupilit nà siya nímu ug ímung makúhà,</i><trans> She’ll stick to you once you manage to get her to go to bed with you. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6]</itype><trans> for one’s gaze to be fixed. </trans>
<eg><i lang=""ceb"">Mipilit ang ákung panan-aw sa íyang atubangan,</i><trans> My gaze rested on her front (genital region). </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> sticky so as to adhere. </trans>
<eg><i lang=""ceb"">Pilit kaáyu ning papilíta,</i><trans> This paste is very sticky. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sticky rice, used for sweets. </trans>
</sense></hom>
<entry><form id=""pilit_mais"" lang=""ceb""><abbr expan=""pilit"" type=""lemma"">—</abbr> mais</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> k.o. corn that produces sticky grits, used for making desserts. </trans>
</sense></hom></entry>
<entry><form id=""pilit_ug_kamut"" lang=""ceb""><abbr expan=""pilit"" type=""lemma"">—</abbr> ug kamut</form>
<hom>
<sense n=""0""><trans> <tr>thieving</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pilit_ug_dixlaq"" lang=""ceb""><abbr expan=""pilit"" type=""lemma"">—</abbr> ug dílà</form>
<hom>
<sense n=""0""><trans> having difficulty pronouncing. </trans>
</sense></hom></entry>
<entry><form id=""pixlit"" lang=""ceb""><abbr expan=""pílit"" type=""lemma"">(←)</abbr><sub>1</sub></form></entry>
<entry><form id=""pixlit_ang_dixlaq"" lang=""ceb""><abbr expan=""pílit"" type=""lemma"">—</abbr> ang dílà</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> have difficulty pronouncing. </trans>
<eg><i lang=""ceb"">Nagpílit ang ákung dílag pangatarúngan,</i><trans> I got all tongue-tied trying to explain. </trans></eg>
</sense></hom></entry>
<entry><form id=""papilit"" lang=""ceb""><abbr expan=""papilit"" type=""lemma"">pa-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> <tr>paste</tr>, stick s.t. to s.t. </trans>
<eg><i lang=""ceb"">Mipapilit siyag pahibalu sa bungbung,</i><trans> She pasted an announcement on the wall. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>paste</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pilitpixlit"" lang=""ceb"">pilitpílit</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> having difficulty enunciating. </trans>
<eg><i lang=""ceb"">Walay pilitpílit nga pamatíun,</i><trans> He speaks glibly. (Lit. You don’t hear the tongue sticking.) †
</trans></eg>
</sense></hom></entry></entry>");
