INSERT INTO `wced_entry` VALUES (14159, "pilu", "762", "<entry page=""762"" id=""14159""><form id=""piluq"" lang=""ceb"">pilù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> fold s.t. flat. </trans>
<eg><i lang=""ceb"">Pil-a (pilua) ang mga lampin,</i><trans> Fold the diapers. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> crease, get creased. </trans>
<eg><i lang=""ceb"">Napilù ang litrátu kay gipasuk lang sa subri,</i><trans> The photo got creased because it was just stuffed into the envelope. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> make a crease in; turn a hem up. </trans>
<eg><i lang=""ceb"">Nahíwì man pagpilù ang sidsid,</i><trans> The hem is crooked. </trans></eg>
<eg><i lang=""ceb"">Ayawg pil-i ang karsúnis,</i><trans> Don’t put a crease in the trousers. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B25; a12]</itype><trans> be doubled, multiplied several times. </trans>
<eg><i lang=""ceb"">Patubúun kini hangtud mupilù ang gidak-un,</i><trans> Let it rise until there is double the amount. </trans></eg>
<eg><i lang=""ceb"">Katulu piluun (pil-un) ang ákung gastu kay sa imúha,</i><trans> My expenses are three times greater than yours. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <form id=""piluq_sa_ang_tuxhud"" lang=""ceb""><abbr expan=""pilù"" type=""lemma"">—</abbr> sa, ang túhud</form><trans> <itype>[A3; c1]</itype> bend one’s knees to ask forgiveness. </trans>
<eg><i lang=""ceb"">Dì ku pasaylúun ang ákung asáwa bísag magpilù pa siya sa íyang túhud,</i><trans> I will never forgive my wife even if she crawls to me on hands and knees. </trans></eg>
</sense>
<sense n=""6""><number>6</number> <itype>[B3]</itype><trans> for the eyes to close in falling asleep. </trans>
<eg><i lang=""ceb"">Duyána ang bátà kay nagpilù na ang mata,</i><trans> Put the baby in the cradle because it’s asleep. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the hem or fold in s.t. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the crease. </trans>
</sense>
<sense n=""3""><number>3</number><trans> the number of times s.t. increases. </trans>
<eg><i lang=""ceb"">Pila ka pilù ang pagdaghan sa liwat?</i><trans> How much has the stock multiplied by now? </trans></eg>
</sense></hom>
<entry><form id=""piluq_sa_--"" lang=""ceb""><abbr expan=""pilù"" type=""lemma"">—</abbr> sa —</form>
<hom>
<sense n=""0""><trans> to the fullest extent. </trans>
<eg><i lang=""ceb"">Pilù sa pilù ang ákung pagbásul, paghigugma, pag-úyun, pagláum,</i><trans> I regret, love, agree, hope (etc.) with all my heart and soul. </trans></eg>
</sense></hom></entry>
<entry><form id=""piluqpiluq"" lang=""ceb"">pilùpilù</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B456; a]</itype><trans> be doubled or multiplied several times. </trans>
<eg><i lang=""ceb"">Mupilùpilù ang panalángin ug manggihatágun ka,</i><trans> Your blessings will be multiplied if you are generous. </trans></eg>
</sense></hom></entry>
<entry><form id=""pinil-an"" lang=""ceb"">pinil-an</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the crease or mark made by folding. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.t. on which a hem or fold has been made.
</trans>
</sense></hom></entry></entry>");
