INSERT INTO `wced_entry` VALUES (14160, "piluk", "762", "<entry page=""762"" id=""14160""><form id=""piluk"" lang=""ceb"">piluk</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>eyelash</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> fringe, trimming of cords or threads hanging like eyelashes. </trans>
</sense></hom>
<entry><form id=""piluk_sa_nixpaq"" lang=""ceb""><abbr expan=""piluk"" type=""lemma"">—</abbr> sa nípà</form>
<hom>
<sense n=""0""><trans> end tips of nipa shingles. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>wink</tr> or <tr>blink</tr> of an eye. </trans>
</sense>
<sense n=""4""><number>4</number><trans> first few days of the third quarter (so called because only the width of the eyelash has been taken away from the moon). </trans>
<eg><i lang=""ceb"">Primírung, ikaduhang piluk,</i><trans> The first, second day of the third quarter. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2N; c1]</itype><trans> wink or blink the eyes. </trans>
<eg><i lang=""ceb"">Ayawg ipiluk (piluka) ímung mata ug han-an ka,</i><trans> Don’t blink when he raises his fist to strike you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> put eyelashes, a fringe on s.t. </trans>
</sense></hom></entry>
<entry><form id=""pinilukan"" lang=""ceb""><abbr expan=""pinilukan"" type=""lemma"">-in-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. adorned with fringes. </trans>
</sense>
