INSERT INTO `wced_entry` VALUES (14239, "pinta1", "765", "<entry page=""765"" id=""14239""><form id=""pinta"" lang=""ceb"">pinta<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; abc]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> do s.t. all at once. </trans>
<eg><i lang=""ceb"">Pintáha paghákut ang káhuy,</i><trans> Carry the firewood all together. </trans></eg>
<eg><i lang=""ceb"">Pintáhig báyad ang iskuyláhan,</i><trans> Pay the school fees all at once. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. in large quantities. </trans>
<eg><i lang=""ceb"">Pintáhag palit arun mabarátu,</i><trans> Buy it in large quantities so it will be cheap. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; a12]</itype><trans> hit s.t. squarely such that it has complete effect. </trans>
<eg><i lang=""ceb"">Ug mapintag búnal ang irù mamatay giyud,</i><trans> If you hit the dog squarely, you’ll kill him. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> be hit squarely. </trans>
</sense></hom>
<entry><form id=""pintaxda"" lang=""ceb""><abbr expan=""pintáda"" type=""lemma"">-da</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#pinta""><sc>pinta</sc></xr>.
</trans>
</sense></hom></entry></entry>");
