INSERT INTO `wced_entry` VALUES (14251, "pintul", "766", "<entry page=""766"" id=""14251""><form id=""pintul"" lang=""ceb"">pintul</form>
<hom>
<sense n=""0""><trans> (from <ix>putul</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> pieces of wood left over after carpentry. </trans>
<eg><i lang=""ceb"">Magámit pa ning pintul pára sa bangkítu,</i><trans> We can use these <corr sic=""piece"">pieces</corr> of wood for a stool. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> cut wood into short lengths, chop logs crosswise. </trans>
<eg><i lang=""ceb"">Nagpintul siya sa mga sugnud,</i><trans> He is cutting the firewood into lengths. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> shorten or stub s.t. by cutting off a length. </trans>
<eg><i lang=""ceb"">Gipintúlan níya ang mga tabákù,</i><trans> She cut off the tops of the tobacco. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> cut off short, into short lengths. </trans>
<eg><i lang=""ceb"">Irù nga pintul ug íkug,</i><trans> A dog with a stubbed tail.
</trans></eg>
</sense></hom></entry>");
