INSERT INTO `wced_entry` VALUES (14255, "pinu1", "766", "<entry page=""766"" id=""14255""><form id=""pixnu"" lang=""ceb"">pínu<sub>1</sub></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> refined, not coarse in manners. </trans>
<eg><i lang=""ceb"">Pínug linihukan,</i><trans> Refined in movement. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> fine, of delicate composition. </trans>
<eg><i lang=""ceb"">Pínug lís,</i><trans> Fine lace. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fine, not coarse in texture. </trans>
<eg><i lang=""ceb"">Pínug kútis,</i><trans> Soft skin. </trans></eg>
<eg><i lang=""ceb"">Pínug buhuk,</i><trans> Fine hair. </trans></eg>
<eg><i lang=""ceb"">Pínung pagkagaling,</i><trans> Milled finely. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> done in small pieces. </trans>
<eg><i lang=""ceb"">Pínung pagkahíwà,</i><trans> Cut up fine. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number><trans> closely spaced. </trans>
<eg><i lang=""ceb"">Ang súlud usa ka sudlay nga pínug tangu,</i><trans> The comb for lice is a very fine-toothed comb. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number><trans> very tiny. </trans>
