INSERT INTO `wced_entry` VALUES (14292, "pirhwisyu", "767", "<entry page=""767"" id=""14292""><form id=""pirhwisyu"" lang=""ceb"">pirhwisyu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> making a nuisance of oneself. </trans>
<eg><i lang=""ceb"">Pahatud ka sa iskuylahan. Pakúhà. Pirhwisyu ka kaáyu,</i><trans> I have to bring you to school and get you. You’re a nuisance. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; a2]</itype><trans> make a nuisance of oneself. </trans>
<eg><i lang=""ceb"">Nagpirhwisyu ang bátà kay giinítan,</i><trans> The child is crying in an annoying way because he feels hot. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> be put to useless effort or inconvenience. </trans>
<eg><i lang=""ceb"">Napirhwisyu kug adtu sa Karkar kay wà didtu ag ámung túyù,</i><trans> I went to a lot of trouble for nothing when I went to Carcar because the person we wanted to see was not there.
</trans></eg>
</sense></hom></entry>");
