<sense n=""2""><number>2</number><trans> <tr>steadily</tr>, <tr>consistent</tr>. </trans>
<eg><i lang=""ceb"">Ug pirmi ang inandaran sa mutur, way daut,</i><trans> If the motor runs steadily, there’s nothing wrong. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ac]</itype><trans> do s.t. always or regularly all the time. </trans>
<eg><i lang=""ceb"">Nagpirmi lang siyag katúlug,</i><trans> He is sleeping all the time. </trans></eg>
<eg><i lang=""ceb"">Pirmíha ang ímung maáyung gáwì,</i><trans> Maintain your good ways. </trans></eg>
<eg><i lang=""ceb"">Ipirmi ang ímung kamut sa ákung tiyan,</i><trans> Keep your hand on my stomach. </trans></eg>
</sense></hom>
<entry><form id=""pirmi_ang_taxku"" lang=""ceb""><abbr expan=""pirmi"" type=""lemma"">—</abbr> ang táku</form>
<hom>
<sense n=""1""><number>1</number><trans> hold on to the cue in billiards—i.e., not lose the play. (When one misses, the cue is passed to the next players.) </trans>
</sense>
<sense n=""2""><number>2</number><trans> go steady with a girl. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> have intercourse steadily. </trans>
</sense>
<sense n=""3""><number>3</number><trans> be employed steadily in one job. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB6; c16]</itype><trans> keep the cue in billiards. </trans>
</sense>
<sense n=""2""><number>2</number><trans> go steady with s.o. </trans>
<eg><i lang=""ceb"">Mupirmi (mapirmi) ang táku nátù kun pahagkun ku nímu,</i><trans> I will go steady with you if you will let me kiss you. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; c16]</itype><trans> have sexual intercourse regularly. </trans>
<eg><i lang=""ceb"">Nagpirmi ang ílang táku kay nahigám,</i><trans> They always make love because they have come to learn how much fun it is. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B6; c16]</itype><trans> become permanent in a job. </trans>
<eg><i lang=""ceb"">Mapirmi ang ímung táku basta maáyu ang ímung ági,</i><trans> I will keep employing you if you do well.
</trans></eg>
</sense></hom></entry></entry>");
