<entry><form id=""pirukpiruk"" lang=""ceb"">pirukpiruk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> for the eyes to keep blinking. </trans>
<eg><i lang=""ceb"">Dì na mupirukpiruk ang ákung tabuntabun sukad ákung gihílut,</i><trans> My eyelids don’t blink anymore after I massaged them. </trans></eg>
