<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>muddy ground</tr>, <tr>mire</tr>. </trans>
<eg><i lang=""ceb"">Pisak kaáyu ang dálan kay nag-ulan man,</i><trans> The street has turned to mud because it was raining. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B; c6]</itype><trans> become a mire. </trans>
<eg><i lang=""ceb"">Mupisak (mapisak) nang silung ug pirmihag yabu sa hinúgas,</i><trans> The ground underneath the kitchen will turn into a mire if you keep throwing the dishwater on it. </trans></eg>
</sense></hom>
<entry><form id=""pisakpisak"" lang=""ceb"">pisakpisak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> spatter or splatter dirt or liquid. </trans>
<eg><i lang=""ceb"">Nabasà ang sawug kay nagpisakpisak ang bátà sa banyu,</i><trans> The floor got wet because the children were splashing around in the bathtub. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c16]</itype><trans> make a spattering sound. </trans>
<eg><i lang=""ceb"">Hilabihan nga nakapisakpisak ang ulan sa gawas,</i><trans> How the rain went pat, pat, pat. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> spattering, wet spot caused by spattering. </trans>
</sense>
<sense n=""2""><number>2</number><trans> spattering sound.
</trans>
</sense></hom></entry></entry>");
