INSERT INTO `wced_entry` VALUES (14363, "pisil, pisil", "770", "<entry page=""770"" id=""14363""><form id=""pisil_pixsil"" lang=""ceb"">pisil, písil</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; ab2]</itype><trans> squeeze s.t. with the tips of the fingers fairly far apart. </trans>
<eg><i lang=""ceb"">Pisíla (pisla) ang mangga ug humuk na ba,</i><trans> Squeeze the mango to see if it is ripe yet. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> squeeze with the fingers to massage or convey a feeling. </trans>
<eg><i lang=""ceb"">Kamau kang mamísil (mupísil) sa gilabdan ug úlu?</i><trans> Do you know how to massage a headache? </trans></eg>
<eg><i lang=""ceb"">Gipisil níya ang kamut sa dalága,</i><trans> She gently squeezed the girl’s hand.
