INSERT INTO `wced_entry` VALUES (14367, "piskat1", "770", "<entry page=""770"" id=""14367""><form id=""piskat"" lang=""ceb"">piskat<sub>1</sub></form>
<hom>
<sense n=""0""><trans> (euphemism for <ix>pisti</ix>) </trans>
</sense>
