INSERT INTO `wced_entry` VALUES (14369, "piskay", "770", "<entry page=""770"" id=""14369""><form id=""piskay"" lang=""ceb"">piskay</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> alert, active and full of energy. </trans>
</sense>
<sense n=""2""><number>2</number><trans> full of life. </trans>
<eg><i lang=""ceb"">Piskay ang plásag maduminggu,</i><trans> The plaza is lively on Sundays. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> good-looking or well-dressed woman. </trans>
</sense>
<sense n=""4""><number>4</number><trans> pretty in general. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2]</itype><trans> active and full of energy, sprightly. </trans>
<eg><i lang=""ceb"">Mupiskay ang átung láwas basta hustug túlug,</i><trans> You are full of vim and vigor if you get the right amount of sleep. </trans></eg>
<eg><i lang=""ceb"">Nagkapiskay <pb n=""771""/>na ang masakitun,</i><trans> The patient is getting stronger. </trans></eg>
<eg><i lang=""ceb"">Gipiskáyan ku sa ákung gibátì karun,</i><trans> I feel sprightly now. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[AB; a]</itype><trans> do s.t. briskly or hurriedly. </trans>
<eg><i lang=""ceb"">Nagkapiskay ang ámung paglakaw pagtaligsik,</i><trans> We walked faster when it started to rain. </trans></eg>
<eg><i lang=""ceb"">Piskáya ang pagkuwinta kay naghulat siya,</i><trans> Hurry up with your counting because she is waiting. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get lively and bright. </trans>
<eg><i lang=""ceb"">Kining mga búlak ang nakapiskay sa ámung panimalay,</i><trans> These flowers made our home lively. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B12; a1]</itype><trans> get nice looking, pretty. </trans>
</sense></hom>
<entry><form id=""piskayun"" lang=""ceb""><abbr expan=""piskayun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> of a lively, alert, cheerful sort.
</trans>
</sense></hom></entry></entry>");
