INSERT INTO `wced_entry` VALUES (14373, "pisla", "771", "<entry page=""771"" id=""14373""><form id=""pislaq"" lang=""ceb"">pislà</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6c1]</itype><trans> spurt s.t. out. </trans>
<eg><i lang=""ceb"">Ang mga táwung dilì idukádu mupislà lang sa bungbung ug manlúwà,</i><trans> Uneducated people go out and spit their saliva against the walls. </trans></eg>
<eg><i lang=""ceb"">Magpislà ang núkus sa íyang átà ug matugaw,</i><trans> Squids spurt out ink if you disturb them. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3P; c1]</itype><trans> produce a splattering, plopping sound. </trans>
<eg><i lang=""ceb"">Mupislà ang lápuk ug tunubtunuban,</i><trans> Mud produces a plopping sound when you step in it.
</trans></eg>
</sense></hom></entry>");
