INSERT INTO `wced_entry` VALUES (14374, "pislangu", "771", "<entry page=""771"" id=""14374""><form id=""pislanguq"" lang=""ceb"">pislangù</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> having a stuffy nose. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>flat-nosed</tr>. </trans>
<eg><i lang=""ceb"">Madaníhun nang bayhána bísag pislangù,</i><trans> She’s charming even if she’s flat-nosed. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> ugly in manner or looks. </trans>
<eg><i lang=""ceb"">Wà tay pagaunúhan kay gawas nga pislangù ug dagway, pislangù pa giyud ug batásan,</i><trans> She doesn’t have a single redeeming feature because aside from being homely she has an unpleasant disposition as well. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> light disease of chickens similar to colds. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B1; a4]</itype><trans> have a nasal voice due to cold. </trans>
<eg><i lang=""ceb"">Nagpislangù (gipislangù) ku kay giulanan,</i><trans> I have a bad cold because I got caught in the rain.
</trans></eg>
</sense></hom></entry>");
