INSERT INTO `wced_entry` VALUES (14375, "pislat", "771", "<entry page=""771"" id=""14375""><form id=""pislat"" lang=""ceb"">pislat</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>squash</tr>, <tr>flatten</tr> and mash s.t. </trans>
<eg><i lang=""ceb"">Pisláta ang ságing nga ipakáun sa bátà,</i><trans> Crush the banana to feed to the baby. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B16; b6]</itype><trans> have a <tr>flat nose</tr>. </trans>
<eg><i lang=""ceb"">Ug ang mga ginikánan pislat, mapislat pud ang anak,</i><trans> If the parents are flat-nosed, the offspring will also be flat-nosed. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>flat-nosed</tr>. </trans>
<eg><i lang=""ceb"">Ayaw ug panaway kay pislat ka man sad kaáyu,</i><trans> Don’t ever criticize for your nose is flat, too.
</trans></eg>
</sense></hom></entry>");
