<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2b2]</itype><trans> <tr>press</tr> s.t. hard with the fingers. </trans>
<eg><i lang=""ceb"">Kinsay mipislit sa timbri?</i><trans> Who pushed the buzzer? </trans></eg>
