INSERT INTO `wced_entry` VALUES (14388, "pistayim", "772", "<entry page=""772"" id=""14388""><form id=""pistayim"" lang=""ceb"">pistayim</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the period immediately after the war. </trans>
<eg><i lang=""ceb"">Pistayim na kug maminyù,</i><trans> I got married after the war. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126C]</itype><trans> be in good terms after a quarrel or misunderstanding, usually said of couples. </trans>
<eg><i lang=""ceb"">Nagkapistayim na ang magtiáyung nag-áway,</i><trans> The quarreling couple are in good terms again.
</trans></eg>
</sense></hom></entry>");
