INSERT INTO `wced_entry` VALUES (14389, "pisti", "772", "<entry page=""772"" id=""14389""><form id=""pisti"" lang=""ceb"">pisti</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>pestilence</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> s.o. or s.t. who causes a pestilence. </trans>
<eg><i lang=""ceb"">Tambal bátuk sa mga pisti,</i><trans> Medicine against germs. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> strong curse expressing anger or disgust. </trans>
<eg><i lang=""ceb"">Pisting yáwà gikáwat ang mga búnga,</i><trans> God damn it to hell. They stole the fruits. </trans></eg>
<eg><i lang=""ceb"">Pisti ning kinabuhía. Kanúnay lang way kwarta,</i><trans> What a goddamned life! We never have money. </trans></eg>
</sense></hom>
<entry><form id=""pisting_yaxwaq"" lang=""ceb""><abbr expan=""pisting"" type=""lemma"">-ng</abbr> yáwà</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> strong curse expressing anger or disgust. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a4]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> be affected with pestilence. </trans>
<eg><i lang=""ceb"">Ang ginharían nalúpig dihang gipisti ang mga ginsakpan,</i><trans> The kingdom was vanquished when a pestilence hit the people. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> go to hell. </trans>
<eg><i lang=""ceb"">Pistihun ka pa untà,</i><trans> Go to hell! (Lit. I hope a pestilence takes you.)
</trans></eg>
</sense></hom></entry></entry>");
