INSERT INTO `wced_entry` VALUES (14421, "pitik", "773", "<entry page=""773"" id=""14421""><form id=""pitik"" lang=""ceb"">pitik</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> <tr>flick</tr> s.t. with the thumb and forefinger. </trans>
<eg><i lang=""ceb"">Kinsay nagpitik sa ákung dawunggan?</i><trans> Who flicked my ear? </trans></eg>
<eg><i lang=""ceb"">Gipitkan níyang ákung kúmù,</i><trans> He flicked my knuckles. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; c]</itype><trans> <tr>flick</tr> s.t. away with the fingers. </trans>
<eg><i lang=""ceb"">Anhà sa astri ipitik ang sigarilyu,</i><trans> Flick your ashes into the ash tray. </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A; b]</itype><trans> in carpentry, mark a line on a piece of wood by stretching a string soaked in dye or soot and letting it snap onto the wood. </trans>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A; ab2]</itype><trans> <tr>shot</tr> with a slingshot. </trans>
<eg><i lang=""ceb"">Pitkun ku nang manuk ihálas,</i><trans> I’ll shoot that wild chicken with a slingshot. </trans></eg>
</sense>
<sense n=""1d""><number>1d</number> <itype>[A; b6]</itype><trans> <tr>whip</tr> s.o. with s.t. small, making a snapping sound. </trans>
<eg><i lang=""ceb"">Ákung gipitkan ang íyang tiil ug tualya,</i><trans> I flicked a towel at his legs. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> for the heart or pulse to <tr>beat</tr>. </trans>
<eg><i lang=""ceb"">Nagpitik pa ang íyang pulsu,</i><trans> His pulse is still beating. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A]</itype><trans> for the heart to <tr>beat</tr> for s.o. </trans>
<eg><i lang=""ceb"">Mupitik lang ang ákung kasingkásing kang Artúru,</i><trans> My heart beats only for Arturo. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c1]</itype><trans> make a click, as when a mechanism is released. </trans>
<eg><i lang=""ceb"">Mipitik lang ang pistúla. Wà nay bála,</i><trans> The pistol clicked. There were no more bullets. </trans></eg>
<eg><i lang=""ceb"">Pahíyum kay ákù nang pitkun (ipitik) ang kamira,</i><trans> Smile because I’m going to snap the camera now. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> s.t. which flicks or snaps: slingshot, chalk line in carpentry, et al. </trans>
</sense>
<sense n=""2""><number>2</number><trans> beating of the heart. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>clicking</tr>, <tr>snapping</tr> sound. </trans>
</sense>
<sense n=""4""><number>4</number><trans> action of flicking or snapping. </trans>
</sense></hom>
<entry><form id=""pinitik"" lang=""ceb""><abbr expan=""pinitik"" type=""lemma"">-in-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> continuous sound of the heartbeat. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the dictates of the heart. </trans>
<eg><i lang=""ceb"">Sunda ang pinitik sa ímung kasingkásing,</i><trans> Follow the dictates <pb n=""774""/>of your heart.
</trans></eg>
</sense></hom></entry></entry>");
