INSERT INTO `wced_entry` VALUES (14434, "pitpit1", "774", "<entry page=""774"" id=""14434""><form id=""pitpit"" lang=""ceb"">pitpit<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B46N]</itype><trans> be wet through so that clothing, hair or feathers stick to the body. </trans>
<eg><i lang=""ceb"">Nagpitpit siyang miabut sa balay,</i><trans> She was dripping wet when she arrived in the house. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[BN; a4]</itype><trans> for the eyes to get sticky with yellowish discharge. </trans>
<eg><i lang=""ceb"">Mupitpit (mapitpit, pitpítun) ang ímung mata ug tagimatahun ka,</i><trans> Your eyes get filled with yellowish discharge if you have sore eyes. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2N; b(1)]</itype><trans> for the strands of hair to be thick with nits. </trans>
<eg><i lang=""ceb"">Mupitpit (mamitpit) ang buhuk sa lusà ug dílì hugútan,</i><trans> The hair gets thick with nits if you don’t get rid of them. </trans></eg>
</sense></hom>
<entry><form id=""pitpitun"" lang=""ceb""><abbr expan=""pitpitun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
