INSERT INTO `wced_entry` VALUES (14462, "pituk2", "775", "<entry page=""775"" id=""14462""><form id=""pituk2"" lang=""ceb"">pituk<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> for the eyes to <tr>stare</tr> blankly into space. </trans>
<eg><i lang=""ceb"">Nagpituk ang íyang mata kay lawum ang íyang gipinsar,</i><trans> He stared blankly into space because he was absorbed in deep thought. </trans></eg>
</sense></hom>
<entry><form id=""pitukpituk"" lang=""ceb"">pitukpituk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3; c1]</itype><trans> <tr>stare</tr> without thought, blinking the eyes. </trans>
<eg><i lang=""ceb"">Mupitukpituk lang nang batáa ug latiguhun, dílì muhílak,</i><trans> The child will just stare and blink his eyes if you whip him. He won’t cry. </trans></eg>
<eg><i lang=""ceb"">Nagpitukpituk lang ang búang nga gisultíhan,</i><trans> The deranged man just kept staring and blinking his eyes as they talked to him. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B46]</itype><trans> for a light to <tr>blink</tr> on and off. </trans>
<eg><i lang=""ceb"">Mipitukpituk ang síga sa lamparilya kay wà may gas,</i><trans> The light of the kerosene lamp is flickering because it has no more kerosene. </trans></eg>
<eg><i lang=""ceb"">Pitukpitukun (ipitukpituk) gánì níya ang plaslayit, kanà libri na ta pagsulud,</i><trans> When he blinks the flashlight, that will mean that we are free to enter.
</trans></eg>
</sense></hom></entry></entry>");
