INSERT INTO `wced_entry` VALUES (14466, "pit-us", "775", "<entry page=""775"" id=""14466""><form id=""pit-us"" lang=""ceb"">pit-us</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> not affording enough space. </trans>
<eg><i lang=""ceb"">Pit-us nga kwartu,</i><trans> A room that is too small. </trans></eg>
<eg><i lang=""ceb"">Pit-us ang dálan ngadtu sa búkid,</i><trans> It’s a narrow road that goes into the mountains. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> hard up financially. </trans>
<eg><i lang=""ceb"">Pit-us kaáyu mi kay wà kuy trabáhu,</i><trans> We’re very hard up because I don’t have a job. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B12; a]</itype><trans> make s.t. narrow. </trans>
<eg><i lang=""ceb"">Nagkapit-us ang asíras sa mga tinda,</i><trans> The sidewalks are getting jammed because of all the goods for sale. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12]</itype><trans> be hard up financially. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[b8]</itype><trans> be in a difficult situation, in a tight corner, etc. </trans>
<eg><i lang=""ceb"">Musúkul ku ug mapit-usan,</i><trans> I’ll fight back if I am cornered. </trans></eg>
</sense></hom>
<entry><form id=""kapit-us"" lang=""ceb""><abbr expan=""kapit-us"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>tightness</tr>, esp. of one’s financial condition.
<pb n=""776""/>
</trans>
</sense></hom></entry></entry>");
