INSERT INTO `wced_entry` VALUES (14479, "piyas", "776", "<entry page=""776"" id=""14479""><form id=""pixyas"" lang=""ceb"">píyas</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for s.t. which was full to be without its contents and flat and crinkled. </trans>
<eg><i lang=""ceb"">Dì na píyas ang tiyan sa bátà nga nakakaun na,</i><trans> Now that the child has eaten, his stomach isn’t sunken. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; c1]</itype><trans> cause s.t. that was bulging to flatten out. </trans>
<eg><i lang=""ceb"">Mapíyas ang ligid sa awtu ug way hángin,</i><trans> The tire of the car goes flat when there is no air. </trans></eg>
<eg><i lang=""ceb"">Nagpíyas ang sáku nga way sulud,</i><trans> The empty sack was crinkled. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>split</tr> s.t. laterally or <tr>peel</tr> around the edges. </trans>
<eg><i lang=""ceb"">Gipíyas níya ang íyang pitáka ug gipakítà ang sulud,</i><trans> He opened his wallet to show the contents. </trans></eg>
<eg><i lang=""ceb"">Gipíyas níya ang ságing nga mantikaan,</i><trans> She cut the bananas in half to fry them.
</trans></eg>
</sense></hom></entry>");
