INSERT INTO `wced_entry` VALUES (14480, "piyatpiyat", "776", "<entry page=""776"" id=""14480""><form id=""piyatpiyat"" lang=""ceb"">piyatpiyat</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> variation of <tr>poker</tr> with up to four players, each of which is dealt thirteen cards, which are divided into three groups, two with five cards each, and one with three cards. The players’ three different hands are pitted against each other, and the player who has two winning hands gets the pot. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> play this sort of poker.
</trans>
</sense></hom></entry>");
