INSERT INTO `wced_entry` VALUES (14519, "plasibu", "778", "<entry page=""778"" id=""14519""><form id=""plasixbu"" lang=""ceb"">plasíbu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> feast celebrated in the evening before All Souls’ Day where food is prepared as an offering to the departed. Originally it was unsalted and put at the altar or before a grave. It marks the end of a novena. </trans>
</sense>
<sense n=""2""><number>2</number><trans> the food prepared for this occasion. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>funeral rites</tr> preceding a burial accompanied or followed by a solemn tolling of bells. </trans>
<eg><i lang=""ceb"">Human sa plasíbu dad-un sa mintiryu ang minatay,</i><trans> After the church ceremony the body will be taken to the cemetery. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> the tolling of the bells for the dead. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> hold this feast or funeral ceremony. </trans>
</sense></hom>
<entry><form id=""pamlasixbu"" lang=""ceb""><abbr expan=""pamlasíbu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6(1)]</itype><trans> partake of this feast. </trans>
<eg><i lang=""ceb"">Mamlasíbu ta karung gabíi sa íla,</i><trans> We will participate in their All Souls’ Eve celebration.
</trans></eg>
</sense></hom></entry></entry>");
