INSERT INTO `wced_entry` VALUES (14529, "plat", "778", "<entry page=""778"" id=""14529""><form id=""plaxt"" lang=""ceb"">plát</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>flat</tr>, not having depressions or elevations on it. </trans>
<eg><i lang=""ceb"">Plát ug dughang bayhána,</i><trans> A flat-chested woman. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> completely without money, <tr>penniless</tr>. </trans>
<eg><i lang=""ceb"">Plát kaáyu ku run,</i><trans> I am completely broke. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>flat tire</tr>. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> tire without enough air. </trans>
<eg><i lang=""ceb"">Bumbáhi pa kay plát pa,</i><trans> Put more air in it because it still is flat. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> flat-heeled shoes. </trans>
</sense>
<sense n=""5""><number>5</number><trans> be knocked flat. </trans>
<eg><i lang=""ceb"">Naigù sa ákung liphuk, dà plát lagi,</i><trans> I hit him with my left hook and he was knocked out flat. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B]</itype><trans> get to be flat. </trans>
<eg><i lang=""ceb"">Maplát ang bisiklíta ug sakyan ug tambuk,</i><trans> The bicycle tires will get pressed down flat if a fat person rides on it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B; a]</itype><trans> get a flat tire. </trans>
<eg><i lang=""ceb"">Naplátan mi, maung nadúgay mi,</i><trans> We had a flat tire, and so we were delayed. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A1]</itype><trans> wear flat shoes, slippers. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[A2; a12]</itype><trans> <tr>refuse</tr> s.o. flatly. </trans>
<eg><i lang=""ceb"">Giplát ku níya dáyun nga wà kuy ispiransa,</i><trans> She told me flatly that I had no hope. </trans></eg>
</sense></hom>
<entry><form id=""plaxt_syus"" lang=""ceb""><abbr expan=""plát"" type=""lemma"">—</abbr> syus</form>
<hom role=""n""><pos>n</pos>
