INSERT INTO `wced_entry` VALUES (14604, "praktis", "780", "<entry page=""780"" id=""14604""><form id=""praktis"" lang=""ceb"">praktis</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a2]</itype><trans> <tr>rehearse</tr>, <tr>train</tr> s.o. </trans>
<eg><i lang=""ceb"">Akuy mupraktis sa mga bátà ug kanta,</i><trans> I’ll train the children how to sing. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>practice</tr>, <tr>rehearse</tr>. </trans>
<eg><i lang=""ceb"">Magpraktis ta sa átung drama,</i><trans> Let’s practice our drama. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6]</itype><trans> <tr>practice</tr> one’s profession. </trans>
<eg><i lang=""ceb"">Mupraktis kug makapasar ku sa bár,</i><trans> I will practice law if I pass the bar. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>practice</tr> or <tr>rehearsal</tr>. </trans>
<eg><i lang=""ceb"">Lisdan ku magkinatsilà kay wà na kuy praktis,</i><trans> I have a hard time speaking Spanish because I don’t have practice. </trans></eg>
</sense></hom>
<entry><form id=""walay_praktis"" lang=""ceb"">walay <abbr expan=""praktis"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>unskilled</tr> (as if lacking practice). </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>rough</tr>, accustomed to inflicting pain (derived from the sarcastic usage where s.o. good in fighting refers to himself as <ix>walay praktis</ix> ‘unpracticed’). </trans>
<eg><i lang=""ceb"">Makatilaw ka giyud íning kúmù kung way praktis,</i><trans> If you don’t watch out, I’ll smack you one with my ‘unpracticed’ fists. </trans></eg>
</sense></hom></entry>
<entry><form id=""praktis_titsing"" lang=""ceb""><abbr expan=""praktis"" type=""lemma"">—</abbr> titsing</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>practice teaching</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b(1)]</itype><trans> do practice teaching. </trans>
</sense></hom></entry>
<entry><form id=""praktisaxdu"" lang=""ceb"">praktisádu</form>
<hom role=""a""><pos>a</pos>
<sense n=""0"">
<eg><i lang=""ceb"">1</i><trans> <tr>proficient</tr> from having practiced. </trans></eg>
<eg><i lang=""ceb"">Praktisádu nà siya sa karáti,</i><trans> He is proficient in karate. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>brawny</tr> due to constant body-building. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126]</itype><trans> be, become <tr>well-practiced</tr> or <tr>trained</tr> in s.t.
</trans>
</sense></hom></entry></entry>");
