<sense n=""1""><number>1</number><trans> <tr>capital</tr> invested. </trans>
<eg><i lang=""ceb"">Ígù ra kung nakabawì sa prinsipal,</i><trans> I barely recovered the capital. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> amount of <tr>money</tr> for a large expense. </trans>
<eg><i lang=""ceb"">Wà silay prinsipal nga ipatunghà námù,</i><trans> They have no funds to send us to school. </trans></eg>
