<sense n=""1""><number>1</number><trans> <tr>prepare</tr>, get s.t. <tr>ready</tr>. </trans>
<eg><i lang=""ceb"">Priparaha ang pagkáun sa bisíta,</i><trans> Prepare the food for the visitors. </trans></eg>
