<sense n=""2""><number>2</number> <itype>[A]</itype><trans> hold a <tr>feast</tr>. </trans>
<eg><i lang=""ceb"">Magpriparar giyud mig adlaw nákù,</i><trans> We always hold a dinner party on my birthday. </trans></eg>
