<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>preparation</tr>. </trans>
<eg><i lang=""ceb"">Kining duláa nagkinahanglan maáyung priparasiyun,</i><trans> This play requires a lot of preparation. </trans></eg>
