<eg><i lang=""ceb"">Muprisku (maprisku) ang átung památì human malígù,</i><trans> We feel fresh and vigorous after we take a bath. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1; b6]</itype><trans> be, become rude or ill-mannered.
</trans>
</sense></hom></entry>");
