INSERT INTO `wced_entry` VALUES (14692, "prisu", "784", "<entry page=""784"" id=""14692""><form id=""prixsu"" lang=""ceb"">prísu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>prisoner</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3P; a2]</itype><trans> put in <tr>jail</tr>. </trans>
<eg><i lang=""ceb"">Unsang saláay nakaprísu (nakapaprísu) nímu?</i><trans> What crime did you commit that you went to jail? </trans></eg>
<eg><i lang=""ceb"">Prisúha ang nakapatay,</i><trans> Send the murderer to jail. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB16]</itype><trans> <tr>confine</tr>, be confined. </trans>
<eg><i lang=""ceb"">Siyay nagprísu sa bábuy sa álad,</i><trans> She locked the pig in the pen. </trans></eg>
<eg><i lang=""ceb"">Nagprísu siya sa kwartu tibuuk adlaw,</i><trans> She locked herself in her room the whole day. </trans></eg>
<eg><i lang=""ceb"">Naprísu ang mga isdà sa bungsud,</i><trans> The fishes got caught in the fish corral. </trans></eg>
</sense></hom>
<entry><form id=""prixsu_kabalyixru"" lang=""ceb""><abbr expan=""prísu"" type=""lemma"">—</abbr> kabalyíru</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> trustee in a prison. </trans>
</sense>
<sense n=""2""><number>2</number><trans> person under house arrest. </trans>
</sense></hom></entry>
<entry><form id=""prisuhan"" lang=""ceb"">prisuhan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>jail</tr>.
</trans>
</sense></hom></entry></entry>");
