INSERT INTO `wced_entry` VALUES (14775, "publiku", "787", "<entry page=""787"" id=""14775""><form id=""publiku"" lang=""ceb"">publiku</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>public</tr>. </trans>
<eg><i lang=""ceb"">Makiglantúgì ku nímu sa publiku,</i><trans> I want to debate you in public. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> public, not private. </trans>
<eg><i lang=""ceb"">Salakyanan nga (sa) publiku,</i><trans> <tr>Public transportation</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>audience</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B1256; c1]</itype><trans> be, become s.t. for public use. </trans>
<eg><i lang=""ceb"">Napubliku na ang ílang bumba tungud sa kadaghang mugámit,</i><trans> Their water pump has become public property since so many people use it. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a3]</itype><trans> have an audience; be an audience. </trans>
<eg><i lang=""ceb"">Nakapubliku siyag ubay-ubay,</i><trans> She drew a large audience.
</trans></eg>
</sense></hom></entry>");
