INSERT INTO `wced_entry` VALUES (14785, "pudlus1", "788", "<entry page=""788"" id=""14785""><form id=""pudlus"" lang=""ceb"">pudlus<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b6]</itype><trans> <tr>run away</tr> fast from s.t. usually in a temper tantrum. </trans>
<eg><i lang=""ceb"">Mipudlus siya pagkakità sa dintista,</i><trans> She fled when she saw the dentist. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> for animals that are tied to run about restlessly in excitement. </trans>
<eg><i lang=""ceb"">Mupudlus ning ákung túru ug makakitag bayi,</i><trans> The bull that is tied keeps running back and forth when it sees a female.
</trans></eg>
</sense></hom></entry>");
