INSERT INTO `wced_entry` VALUES (14789, "pudpud1", "788", "<entry page=""788"" id=""14789""><form id=""pudpud"" lang=""ceb"">pudpud<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[APB1; a12]</itype><trans> <tr>wear</tr> down or <tr>decay</tr> at the ends or tips, become so. </trans>
<eg><i lang=""ceb"">Dulsi ang nagpudpud (nagpapudpud) sa íyang ngípun,</i><trans> Her teeth decayed from all the candy. </trans></eg>
<eg><i lang=""ceb"">Nagkapudpud ang halígi sa ulan ug ínit,</i><trans> The post is getting decayed from the rain and the sun. </trans></eg>
<eg><i lang=""ceb"">Nagkapudpud na ang íyang bakyà,</i><trans> His wooden slippers are becoming worn out. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> knock the ashes off s.t. burning slowly. </trans>
