<eg><i lang=""ceb"">Syáru dì giyud ka makapudyut nákug dyútayng isdà,</i><trans> Surely you can give me a little <tr>bit</tr> of your fish. </trans></eg>
<eg><i lang=""ceb"">Pudyútig asin,</i><trans> Add a <tr>pinch</tr> of salt. </trans></eg>
