INSERT INTO `wced_entry` VALUES (14794, "puga1", "788", "<entry page=""788"" id=""14794""><form id=""puxga"" lang=""ceb"">púga<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b26]</itype><trans> <tr>escape</tr> from prison. </trans>
<eg><i lang=""ceb"">Nakapúga ang bitayúnun,</i><trans> The prisoner escaped from death row. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> escapee from a prison. </trans>
</sense></hom>
