INSERT INTO `wced_entry` VALUES (14801, "pugas", "788", "<entry page=""788"" id=""14801""><form id=""pugas"" lang=""ceb"">pugas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> <tr>plant</tr> grains or seeds in a hole. </trans>
<eg><i lang=""ceb"">Akuy nagpugas ánang lísu sa kapáyas dihà,</i><trans> I was the one who planted the papaya seeds there. </trans></eg>
<eg><i lang=""ceb"">Íyang gipugsan ug munggus ang usa ka parsíla,</i><trans> He planted one lot to mung beans. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>seed</tr> that has been planted. </trans>
<eg><i lang=""ceb"">Giánud ang mga pugas sa bahà,</i><trans> The seeds were washed away in the flood. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the amount of seeds planted to a given area. </trans>
<eg><i lang=""ceb"">Pugas ug tulu ka gantang ang ákung baul,</i><trans> I can plant three <pb n=""789""/>gantas of grain in my field. </trans></eg>
</sense></hom>
<entry><form id=""pugaspuxgas"" lang=""ceb"">pugaspúgas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c1]</itype><trans> do s.t. with the expectation of a return in the future. </trans>
<eg><i lang=""ceb"">Kanang íyang paghátag namugaspúgas nà arun hiayunan sa ginikánan,</i><trans> His gift is actually an investment so that her parents would like him. </trans></eg>
</sense></hom></entry>
<entry><form id=""pugsanan"" lang=""ceb"">pugsanan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> place to be planted. </trans>
</sense></hom></entry>
<entry><form id=""igapugas_igpupuxgas_igpuluxgas"" lang=""ceb""><abbr expan=""igapugas"" type=""lemma"">iga-</abbr>, <abbr expan=""igpupúgas"" type=""lemma"">ig-r-(←)</abbr>, <abbr expan=""igpulúgas"" type=""lemma"">ig-l-(←)</abbr></form>
<hom>
<sense n=""1""><number>1</number><trans> thing to <tr>sow</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> = <xr lang=""ceb"" target=""#tingpuluxgas""><sc><abbr expan=""tingpulúgas"" type=""lemma"">ting-l-</abbr></sc></xr>. </trans>
