INSERT INTO `wced_entry` VALUES (14818, "pugtas2", "789", "<entry page=""789"" id=""14818""><form id=""pugtas2"" lang=""ceb"">pugtas<sub>2</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB; ab8]</itype><trans> <tr>snap</tr> or <tr>break</tr> off suddenly. </trans>
<eg><i lang=""ceb"">Pagpílì ug alambri nga dílì tayaun arun dílì mapugtas,</i><trans> Choose a wire that’s not rusty so that it will not break easily. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>kill</tr>, cause s.t. or s.o. to die with suddenness and force. </trans>
<eg><i lang=""ceb"">Si Dyíma nagpugtas sa íyang kaugalíngun,</i><trans> Gemma killed herself. </trans></eg>
<eg><i lang=""ceb"">Ang kasukù dílì ígù makapugtas sa ákung gugma nímu,</i><trans> Anger cannot kill my love for you.
