INSERT INTO `wced_entry` VALUES (14822, "pug-uk", "789", "<entry page=""789"" id=""14822""><form id=""pug-uk"" lang=""ceb"">pug-uk</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A3P; a12]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> hold s.t. back to prevent <pb n=""790""/>growth or development. </trans>
<eg><i lang=""ceb"">Ang maung baláud nagpug-uk sa átung nasudnun nga pag-uswag,</i><trans> Such a law stifles the progress of our nation. </trans></eg>
<eg><i lang=""ceb"">Gipug-uk sa Insik ang kámay arun silay magbuut sa prisyu,</i><trans> The Chinese hoarded the sugar so that they could determine the price. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> cut a branch too close to the trunk. </trans>
<eg><i lang=""ceb"">Ug ímung pug-úkun ang sanga pagputul, madáut ang tanum,</i><trans> If you cut the branch too close to the trunk, it will ruin the plant. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>acquire</tr> s.t. surreptitiously. </trans>
<eg><i lang=""ceb"">Nakapug-uk ang lídir ug daghang kwarta,</i><trans> The politician managed to get his hands on a lot of money. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> manipulate cards one is dealing. </trans>
<eg><i lang=""ceb"">Maáyu kaáyu siyang mupug-uk sa baráha,</i><trans> He is very good in manipulating the cards. </trans></eg>
</sense>
<sense n=""5""><number>5</number> <itype>[a12]</itype><trans> be stung by the truth of what s.o. says. </trans>
<eg><i lang=""ceb"">Napug-uk siya sa ákung gisulti kay namatud-an,</i><trans> He was stung by what I said because it was true.
</trans></eg>
</sense></hom></entry>");
