<eg><i lang=""ceb"">Nagpúgul ang asu sa kwartu,</i><trans> The room is <tr>full</tr> of smoke. </trans></eg>
<eg><i lang=""ceb"">Nagpúgul ang mga babáyi sulud sa kwartu,</i><trans> The women were all <tr>huddled</tr> together in the bedroom. </trans></eg>
<eg><i lang=""ceb"">Dugung nagpúgul sa inunlan,</i><trans> Placenta <tr>filled</tr> with a big clot of blood. </trans></eg>
<eg><i lang=""ceb"">Gipugúlan siya sa kasukù,</i><trans> She is filled with anger.
