INSERT INTO `wced_entry` VALUES (14825, "pugung", "790", "<entry page=""790"" id=""14825""><form id=""pugung"" lang=""ceb"">pugung</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> hold or keep in place, <tr>restrain</tr> the movement of. </trans>
<eg><i lang=""ceb"">Gitabangan pagpugung ang búang nga gustung mugawas,</i><trans> The people held the lunatic that wanted to escape back. </trans></eg>
<eg><i lang=""ceb"">Pugngi ang hagdanan kay musaka ku,</i><trans> Hold the ladder because I’m going up. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a2b2]</itype><trans> keep s.o. from doing s.t. </trans>
<eg><i lang=""ceb"">Dílì ku ikaw pugngan sa ímung buut buhátun,</i><trans> I won’t <tr>prevent</tr> you from doing what you want. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A1]</itype><trans> <tr>control</tr> oneself. </trans>
<eg><i lang=""ceb"">Nagpugung lang ku arun way mahitabù,</i><trans> I’m just keeping myself under control so nothing happens. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b]</itype><trans> <tr>clip</tr>, tie the hair in place or clip clothes to the line. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> clip or <tr>safety pin</tr>. </trans>
</sense></hom>
<entry><form id=""pamugung"" lang=""ceb""><abbr expan=""pamugung"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S]</itype><trans> clip, tie one’s own hair in place. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> s.t. to tie the hair with or clothespins. </trans>
</sense></hom></entry>
<entry><form id=""pinugngan"" lang=""ceb"">pinugngan</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>suppressed</tr>. </trans>
<eg><i lang=""ceb"">Pinugngang katáwa,</i><trans> Suppressed laughter. </trans></eg>
</sense></hom></entry>
<entry><form id=""mapugngaxnun"" lang=""ceb"">mapugngánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> tending to be strict, having a restrictive attitude. </trans>
