INSERT INTO `wced_entry` VALUES (14826, "pugus", "790", "<entry page=""790"" id=""14826""><form id=""pugus"" lang=""ceb"">pugus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3PN; a1cN]</itype><trans> <tr>compel</tr> s.o. to do s.t. </trans>
<eg><i lang=""ceb"">Dì untà ku mupalit, apan mamugus giyud ang ákung asáwa,</i><trans> I didn’t want to buy any, but my wife insisted. </trans></eg>
<eg><i lang=""ceb"">Way nagpugus nímu pagpakasalà,</i><trans> No one is forcing you to commit a sin. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <form id=""pugsun_ug_pugus"" lang=""ceb"">pugsun ug <abbr expan=""pugus"" type=""lemma"">—</abbr></form><trans> it cannot be helped that [such-and-such] is the case. </trans>
<eg><i lang=""ceb"">Pugsun ug daghang mangulitáwu nákù,</i><trans> Can I <tr>help</tr> it if lots of men fall for me? </trans></eg>
<eg><i lang=""ceb"">Pugsun ug nasayup ku,</i><trans> I couldn’t help making a mistake. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> <tr>force</tr> s.t. to give way. </trans>
<eg><i lang=""ceb"">Ayaw pugsa (ipugus) pagpasulud kay mabúngì,</i><trans> Don’t force it in or you might break it. </trans></eg>
<eg><i lang=""ceb"">Mabugtù nà ug pugsun pag-ínat,</i><trans> It will snap if you stretch it too far. </trans></eg>
</sense></hom>
<entry><form id=""pugsunun"" lang=""ceb"">pugsunun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> needing to be urged or told to do s.t. </trans>
<eg><i lang=""ceb"">Ang mutsatsang pugsunun maáyung ikurindu,</i><trans> You might as well get rid of a maid that you have to keep telling to get to work. </trans></eg>
</sense></hom></entry>
<entry><form id=""pugsunun_ug_uxtuk"" lang=""ceb"">pugsunun ug útuk</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>slow</tr> in comprehension. </trans>
<eg><i lang=""ceb"">Intirisádu siya muiskuyla apan pugsunun kaáyug útuk,</i><trans> He likes to study, but he is very slow. </trans></eg>
</sense></hom></entry>
<entry><form id=""mapugsaxnun_mapinugsaxnun"" lang=""ceb"">mapugsánun, mapinugsánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>insistent</tr> (literary). </trans>
<eg><i lang=""ceb"">Usa ka mapugsánung maghahálad,</i><trans> He is a persistent suitor. </trans></eg>
</sense></hom></entry>
<entry><form id=""puguxsu"" lang=""ceb""><abbr expan=""pugúsu"" type=""lemma"">-u(←)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> insistent, <tr>demanding</tr> of oneself or others. </trans>
<eg><i lang=""ceb"">Pugúsu ka man gud. Ímung pugsun bísag dì mahímù,</i><trans> You are highly demanding. You try to force people to do things they can’t do. </trans></eg>
<eg><i lang=""ceb"">Pugúsu nang pliyíra, mulusut bísag blakíngan,</i><trans> He is a persistent player. He forces his way through to the basket even if he is blocked. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12]</itype><trans> become insistent, persistent in doing s.t.
</trans>
</sense></hom></entry></entry>");
