INSERT INTO `wced_entry` VALUES (14828, "pugwat", "790", "<entry page=""790"" id=""14828""><form id=""pugwat"" lang=""ceb"">pugwat</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A36; a1]</itype><trans> <tr>startle</tr> s.o. that is asleep or so engrossed in s.t. that he is oblivious of his surroundings. </trans>
<eg><i lang=""ceb"">Napugwat ang bátà sa pagbutu sa libintadur,</i><trans> The child was startled out of his sleep when the firecracker exploded. </trans></eg>
<eg><i lang=""ceb"">Pugwátun ku siya sa íyang paghinuktuk,</i><trans> I’ll startle her out of her deep thought.
</trans></eg>
</sense></hom></entry>");
