INSERT INTO `wced_entry` VALUES (14829, "puhag", "790", "<entry page=""790"" id=""14829""><form id=""puxhag"" lang=""ceb"">púhag</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>scatter</tr> a large group of s.t. </trans>
<eg><i lang=""ceb"">Napúhag ang mga táwu sa plása pag-ulan,</i><trans> The people in the plaza scattered when it started to rain. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>destroy</tr> completely. </trans>
<eg><i lang=""ceb"">Napúhag ang syudad sa bumba,</i><trans> The city was destroyed by bombs. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> get honey from a beehive (for which one must destroy the hive). </trans>
<eg><i lang=""ceb"">Ang mipúhag sa putyúkan wà hipaaki,</i><trans> He got the honey but he was not bitten.
</trans></eg>
</sense></hom></entry>");
