INSERT INTO `wced_entry` VALUES (14830, "puhal", "790", "<entry page=""790"" id=""14830""><form id=""puhal"" lang=""ceb"">puhal</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b(1)]</itype><trans> <tr>undersell</tr> s.o. or bid a higher price for s.t. than a rival. </trans>
<eg><i lang=""ceb"">Ákù tà tung palitun, apan gipuhalan giyud sa babáyi,</i><trans> I was going to buy it, but a lady came and bought it from under my nose (by offering <pb n=""791""/>a better price). </trans></eg>
<eg><i lang=""ceb"">Puhali ang kumpaníya arun kitay makapalit sa awtu,</i><trans> <tr>Outbid</tr> the company so we can buy the car. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; b8]</itype><trans> be <tr>outclassed</tr> or <tr>outstripped</tr> in comparison. </trans>
<eg><i lang=""ceb"">Hipuhalan ang átung dyíp sa bag-ung awtu sa átung silíngan,</i><trans> Our neighbor’s new car quite outclasses our jeep. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> higher bid than s.o. else offered or lower than s.o. else asked. </trans>
</sense></hom>
<entry><form id=""pinuhalay"" lang=""ceb""><abbr expan=""pinuhalay"" type=""lemma"">-in-ay</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>competition</tr> or <tr>rivalry</tr> in selling or bidding. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[ANC]</itype><trans> be in competition.
</trans>
</sense></hom></entry></entry>");
