INSERT INTO `wced_entry` VALUES (14831, "puhaw", "791", "<entry page=""791"" id=""14831""><form id=""puhaw"" lang=""ceb"">puhaw</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> for a color or voice quality to be lacking its full intensity. </trans>
<eg><i lang=""ceb"">Puhaw na kaáyu ang ímung sinínà sa tantung linadlad,</i><trans> Your skirt is all <tr>faded</tr> from being put under the sun. </trans></eg>
<eg><i lang=""ceb"">Puhaw ang íyang pamánit kay bag-ung naáyu sa sakit,</i><trans> His complexion is <tr>pale</tr> because he has just recently recovered from his illness. </trans></eg>
<eg><i lang=""ceb"">Ang puhaw ug tíngug dílì mahímung mag-aawit,</i><trans> One with a <tr>weak</tr> voice cannot become a singer. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> become <tr>embarrassed</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B; c1]</itype><trans> get to lose its full quality. </trans>
<eg><i lang=""ceb"">Napuhaw ang buhuk pagkinalígù sa dágat,</i><trans> His hair turned blond from swimming so much. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3P; ab3(1)]</itype><trans> <tr>embarrass</tr> s.o. </trans>
<eg><i lang=""ceb"">Napuhaw siya kay wà tagda sa íyang gikutána,</i><trans> She was embarrassed because the man she asked didn’t pay any attention to her. </trans></eg>
</sense></hom>
<entry><form id=""pamuhawpuhaw"" lang=""ceb"">pamuhawpuhaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2]</itype><trans> for the face to change colors in embarrassment. </trans>
<eg><i lang=""ceb"">Namuhawpuhaw ku dihang giingnan ku níyang wà kuy batásan,</i><trans> My face turned all colors of the rainbow when she told me I had no manners.
</trans></eg>
</sense></hom></entry></entry>");
