INSERT INTO `wced_entry` VALUES (14832, "puhun", "791", "<entry page=""791"" id=""14832""><form id=""puhun"" lang=""ceb"">puhun</form>
<hom>
<sense n=""0""><trans> in the <tr>future</tr>, God willing. </trans>
<eg><i lang=""ceb"">Puhun, ug may kinabúhì pa, mulangyaw ku,</i><trans> Someday, God willing, I will go abroad. </trans></eg>
<eg><i lang=""ceb"">Mugíkan ku ugmà puhun,</i><trans> I’m leaving tomorrow, God willing. </trans></eg>
</sense></hom>
<entry><form id=""puhunpuxhun"" lang=""ceb"">puhunpúhun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN2; a12]</itype><trans> say that one will do s.t., God willing. </trans>
<eg><i lang=""ceb"">Mupuhunpúhun (mamuhunpúhun) ta kay dì ta makasigúru sa ugmà,</i><trans> We should say ‘God willing’ because we cannot be certain of the future. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[a12]</itype><trans> for it only to be a matter of days for s.t. expected to happen to s.o. </trans>
<eg><i lang=""ceb"">Puhunpuhúnun na lang ang gilaygay. Dì nà madúgayng mamatay,</i><trans> It’s only a matter of days till the patient dies. He’ll pass away soon.
</trans></eg>
</sense></hom></entry></entry>");
