INSERT INTO `wced_entry` VALUES (14840, "pukan", "791", "<entry page=""791"" id=""14840""><form id=""puxkan"" lang=""ceb"">púkan</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB12; ab2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>topple</tr> s.t. tall and erect. </trans>
<eg><i lang=""ceb"">Hángin ang mupúkan ánang kahúya,</i><trans> The wind will <tr>uproot</tr> that tree. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> bring to a downfall in a struggle. </trans>
<eg><i lang=""ceb"">Mga Amirikanhun ang nakapúkan sa ribulusiyun,</i><trans> The American forces crushed the revolutionary movement. </trans></eg>
<eg><i lang=""ceb"">Mapúkan ra ang hiwing pamunúan,</i><trans> The crooked administration will some day be brought down. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; ab3(1)]</itype><trans> <tr>dishonor</tr>. </trans>
<eg><i lang=""ceb"">Ang íyang ámu ang mipúkan sa íyang kaputlì,</i><trans> Her own master violated her. </trans></eg>
</sense></hom>
<entry><form id=""kapukaxnan"" lang=""ceb""><abbr expan=""kapukánan"" type=""lemma"">ka-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> downfall, fall from power or loss of honor. </trans>
<eg><i lang=""ceb"">Ang kapukánan sa Impiryu sa Rúma,</i><trans> The fall of the Roman Empire. </trans></eg>
</sense></hom></entry>
<entry><form id=""pukan"" lang=""ceb""><abbr expan=""pukan"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> trees that have fallen.
</trans>
</sense></hom></entry></entry>");
