<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; ac]</itype><trans> <tr>pound</tr> with the fist or s.t. held in the fist, not necessarily with force. </trans>
<eg><i lang=""ceb"">Mipukpuk siya sa lamísa sa kalágut,</i><trans> He pounded on the table in anger. </trans></eg>
<eg><i lang=""ceb"">Nagpamukpuk siya sa íyang dughan nga nangadyì,</i><trans> She kept striking her breast while praying. </trans></eg>
