<eg><i lang=""ceb"">Nakapukpuk siya sa pamaligyà ug kupras,</i><trans> He made a killing in the sale of copra. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> action of <tr>pounding</tr> or <tr>hammering</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>drumstick</tr>. </trans>
</sense></hom>
