INSERT INTO `wced_entry` VALUES (14869, "pula", "793", "<entry page=""793"" id=""14869""><form id=""pula"" lang=""ceb"">pula</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>red</tr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> any color ranging from dark yellow through orange, red, and brown. </trans>
</sense>
<sense n=""1b""><number>1b</number> <form id=""pula_ug_saxya"" lang=""ceb""><abbr expan=""pula"" type=""lemma"">—</abbr> ug sáya</form><trans> palm <tr>toddy</tr>, esp. inside a transparent glass container where the redness shows (slang). </trans>
<eg><i lang=""ceb"">Puwa ug sáya ang ílang giinum,</i><trans> They drank palm toddy. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> not true, <tr>lie</tr> (so called from the color of the <ix>butbut<sub>2</sub></ix> which is homonymous with a word meaning lie, <ix>butbut<sub>1</sub></ix>—colloquial). </trans>
<eg><i lang=""ceb"">Anus-a ku mutúu nga pulus man nà pula?</i><trans> Don’t expect me to believe that when it’s all lies. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> = <xr lang=""ceb"" target=""#daxgir""><sc>dágir</sc></xr>, <bx>2</bx>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[ABN; ab7]</itype><trans> become red, cause s.o. to do s.t. </trans>
<eg><i lang=""ceb"">Akuy mupula sa ímung sapátus,</i><trans> I’ll make your shoes red. </trans></eg>
<eg><i lang=""ceb"">Mipula siya kay gisugsū́g,</i><trans> She turned red because they teased her. </trans></eg>
<eg><i lang=""ceb"">Napula ang íyang kamut sa dyúbus,</i><trans> Her hands got red with dye. </trans></eg>
<eg><i lang=""ceb"">Namula ang ákung nawung sa kaúlaw,</i><trans> My face was red with shame. </trans></eg>
<eg><i lang=""ceb"">Nagpula ang langit pagsawup sa adlaw,</i><trans> The sky was all red at sunset. </trans></eg>
<eg><i lang=""ceb"">Nagkapula ang binágang puthaw,</i><trans> The iron that was heated is turning redder and redder. </trans></eg>
<eg><i lang=""ceb"">Pulahun ta nang putì mung sapátus,</i><trans> I’ll make your white shoes red. </trans></eg>
<eg><i lang=""ceb"">Gipulahan ku sa ímung sinínà,</i><trans> Your dress looks red to me. </trans></eg>
<eg><i lang=""ceb"">Pulahi pa nang ímung ngábil,</i><trans> Put more red on your lips. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B126]</itype><trans> for the voice to <tr>crack</tr> and become discordant. </trans>
<eg><i lang=""ceb"">Napula ang íyang tíngug sa kalísang,</i><trans> His voice went off pitch discordantly in fright. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <form id=""haxin_bay_napula"" lang=""ceb"">háin bay <abbr expan=""napula"" type=""lemma"">na-</abbr></form><trans> expression to show contemptuous disbelief. </trans>
<eg><i lang=""ceb"">Ingun siya dúna na siyay awtu, háin bay napuwa?</i><trans> He said he got a car. That will be the day that I believe that! </trans></eg>
</sense></hom>
<entry><form id=""pulapula"" lang=""ceb"">pulapula</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> scattered red spots or dots. </trans>
</sense></hom></entry>
<entry><form id=""pulaxhan"" lang=""ceb"">puláhan</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the name given to the Filipino fighters for independence against the Spaniards and then the Americans (so called from their red badges). </trans>
</sense>
<sense n=""2""><number>2</number><trans> types of fish with predominantly red hues. </trans>
</sense></hom></entry>
<entry><form id=""pulaxhay"" lang=""ceb"">puláhay</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> infant. </trans>
</sense></hom></entry>
<entry><form id=""kapula"" lang=""ceb""><abbr expan=""kapula"" type=""lemma"">ka-</abbr></form>
<hom>
<sense n=""0""><trans> <tr>redness</tr>. </trans>
</sense></hom></entry>
<entry><form id=""papula"" lang=""ceb""><abbr expan=""papula"" type=""lemma"">pa-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>lipstick</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pulahun"" lang=""ceb"">pulahun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>reddish</tr>. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#pulaxhay""><sc>puláhay</sc></xr>.
</trans>
</sense></hom></entry></entry>");
