INSERT INTO `wced_entry` VALUES (14870, "pulak", "793", "<entry page=""793"" id=""14870""><form id=""puxlak"" lang=""ceb"">púlak</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>fall</tr> down from a height, cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Magpúlak kug mga tambis,</i><trans> I’ll knock some <ix>tambis</ix> fruits down. </trans></eg>
<eg><i lang=""ceb"">Mupúlak (mapúlak) ang prutas ug labihan na sa kahinug,</i><trans> Fruits will fall when they are overripe. </trans></eg>
<eg><i lang=""ceb"">Napúlak ang misitíra gíkan sa bintánà,</i><trans> The potted plant fell from the window sill. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> fail in an examination or subject. </trans>
<eg><i lang=""ceb"">Sa nangúhà sa iksámin usa ray napúlak,</i><trans> Of those that took the exam, only one failed. </trans></eg>
</sense></hom>
<entry><form id=""pulak"" lang=""ceb""><abbr expan=""pulak"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a nut, fruit that has fallen. </trans>
</sense>
<sense n=""2""><number>2</number><trans> coconuts that have fallen off the tree. </trans>
</sense></hom></entry>
<entry><form id=""pamuxlak"" lang=""ceb""><abbr expan=""pamúlak"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; a2]</itype><trans> gather fallen fruits, esp. coconuts.
</trans>
</sense></hom></entry></entry>");
