INSERT INTO `wced_entry` VALUES (14871, "pulaki", "793", "<entry page=""793"" id=""14871""><form id=""pulaxkiq"" lang=""ceb"">pulákì</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>odd</tr>, not evenly divisible by a given number. </trans>
<eg><i lang=""ceb"">Duhay pulákì. Tulu mi, unyà limay inyung gihátag,</i><trans> There are two left over. There <corr sic=""is"">are</corr> three of us and you gave five. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> be the <tr>leftover</tr> when s.t. is divided. </trans>
<eg><i lang=""ceb"">Ang pulákì ámù na lang pikásun,</i><trans> Let’s just divide the one left over. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126; c16]</itype><trans> come out not evenly divisible.
</trans>
</sense></hom></entry>");
