INSERT INTO `wced_entry` VALUES (14877, "pulang1", "793", "<entry page=""793"" id=""14877""><form id=""puxlang"" lang=""ceb"">púlang<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> for a baby to learn to <tr>jump</tr>, bounce up and down when held. </trans>
<eg><i lang=""ceb"">Mupúlang na ang bátà,</i><trans> The child is now learning to jump. </trans></eg>
<eg><i lang=""ceb"">Dì pa makapúlang si Bíbi,</i><trans> Baby can’t jump yet. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> put a child in a <ix>pulangan</ix>. </trans>
</sense></hom>
<entry><form id=""pulangan"" lang=""ceb""><abbr expan=""pulangan"" type=""lemma"">-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> chair attached to a spring pole in which a baby is placed so that it can jump up and down.
