INSERT INTO `wced_entry` VALUES (14883, "pulas, pulas", "793", "<entry page=""793"" id=""14883""><form id=""pulas_puxlas"" lang=""ceb"">pulas, púlas</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>remove</tr> s.t. from s.t. that covers or encircles it, or remove the covering thing. </trans>
<eg><i lang=""ceb"">Napulas ang kálù paghurus sa hángin,</i><trans> The hat was blown away in the wind. </trans></eg>
<eg><i lang=""ceb"">Ug ímung pulasun (ipulas) ang ímung kamut sa púsas, muhugut hinúun kini,</i><trans> If you try to slip your hands out of the handcuffs, <pb n=""794""/>they’ll just tighten. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; b]</itype><trans> remove the tie from the coconut palm bud to stop the toddy flow and allow the bud to develop fruit. </trans>
<eg><i lang=""ceb"">Pulasi ang sanggutan arun mamúnga,</i><trans> Untie the coconut bud so it will bear fruit. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> allow s.t. to run over the face to remove s.t. </trans>
<eg><i lang=""ceb"">Puwasa ang dágat sa ímung nawung,</i><trans> Let the sea water run over your face. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B23(1); c1]</itype><trans> for s.t. to wear off, disappear. </trans>
<eg><i lang=""ceb"">Mipúlas ang adlaw sa búkid,</i><trans> The sun disappeared behind the mountains. </trans></eg>
<eg><i lang=""ceb"">Wà pa makapulas ang ispiritu sa bínu,</i><trans> The effect of the liquor hasn’t worn off yet. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <form id=""papulaspuxlas"" lang=""ceb"">papulaspúlas</form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AN; c1]</itype><trans> rub the hands over the face. </trans>
<eg><i lang=""ceb"">Namulaspúlas ku pagpawálà sa katulúgun,</i><trans> I rubbed my hands over my face to get rid of my feeling of sleepiness.
</trans></eg>
</sense></hom></entry>");
