INSERT INTO `wced_entry` VALUES (14884, "pulasik", "794", "<entry page=""794"" id=""14884""><form id=""pulaxsik"" lang=""ceb"">pulásik</form>
<hom>
<sense n=""0""><trans> (from <ix>lásik</ix>) </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B2S3(1)N; b2c1]</itype><trans> fly apart in various directions because of force. </trans>
<eg><i lang=""ceb"">Mipulásik (namulásik) ang lápuk pag-ági sa trák,</i><trans> The mud spattered in all directions when the truck passed by. </trans></eg>
<eg><i lang=""ceb"">Pagkahúlug sa búlig, namuwásik ang mga lubi,</i><trans> When the bunch of coconuts fell, the coconuts flew off in all directions.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (14884, "pulásik", "pulasik", "m", "v");
INSERT INTO `wced_entry` VALUES (14885, "pulaspulas", "794", "<entry page=""794"" id=""14885""><form id=""pulaspulas"" lang=""ceb"">pulaspulas</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5c1]</itype><trans> do s.t. with hurried motions. </trans>
<eg><i lang=""ceb"">Dì ka makapulaspulas ánang ímung líhuk kay dilikádu nang ímung búhat,</i><trans> You can’t do that work hurriedly because it is a delicate piece of work.
</trans></eg>
</sense></hom></entry>");
INSERT INTO `wced_head` (entryid, head, normalized_head, type, pos) VALUES (14885, "pulaspulas", "pulaspulas", "m", "v");
INSERT INTO `wced_entry` VALUES (14886, "pulaw, pulaw", "794", "<entry page=""794"" id=""14886""><form id=""pulaw_puxlaw"" lang=""ceb"">pulaw, púlaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; b]</itype><trans> stay up very late at night or the whole night through. </trans>
<eg><i lang=""ceb"">Nagpulaw ku sa bátà gabíi,</i><trans> I stayed up all night to watch the child last night. </trans></eg>
<eg><i lang=""ceb"">Dì ku mupulaw (mamulaw) ug tuun,</i><trans> I won’t stay up late studying. </trans></eg>
<eg><i lang=""ceb"">Gipuláwan (gipamuláwan) sa sastri ang ákung sinínà,</i><trans> The seamstress stayed up late finishing my dress. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> keep a fire or lamp going the night through. </trans>
<eg><i lang=""ceb"">Magpúlaw ku arun dúna tay káyu kanúnay,</i><trans> I’ll keep a fire burning so that we’ll always have fire. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A3]</itype><trans> for a feeling to be kept alive. </trans>
<eg><i lang=""ceb"">Ang tingúhà sa pag-adtu sa Amirika nagpúlaw sa íyang dughan sukad sa bátà pa,</i><trans> The desire to go to America has been <corr sic=""keep"">kept</corr> burning in his breast since his childhood. </trans></eg>
</sense></hom>
<entry><form id=""pulaw"" lang=""ceb""><abbr expan=""pulaw"" type=""lemma"">(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#pulawan""><sc><abbr expan=""pulawan"" type=""lemma"">-an(→)</abbr></sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""pulawan_kapulawan"" lang=""ceb""><abbr expan=""pulawan"" type=""lemma"">-an(→)</abbr>, <abbr expan=""kapulawan"" type=""lemma"">ka-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> small lamp that is left lighted throughout the night. </trans>
</sense>
<sense n=""2""><number>2</number><trans> log that is kept burning day and night.
</trans>
</sense></hom></entry></entry>");
