INSERT INTO `wced_entry` VALUES (14901, "puli", "794", "<entry page=""794"" id=""14901""><form id=""puxli"" lang=""ceb"">púli</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>replacement</tr>, one who spells s.o. </trans>
<eg><i lang=""ceb"">Aku ang púli nímu,</i><trans> I am your <tr>substitute</tr>. </trans></eg>
</sense></hom>
<entry><form id=""puxli_noun"" lang=""ceb""><abbr expan=""púli"" type=""lemma"">—</abbr> <r>[<ix>noun</ix>]</r></form>
<hom>
<sense n=""0""><trans> <tr>vice-</tr>. </trans>
<eg><i lang=""ceb"">Púli pangúlu,</i><trans> Vice-president. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> take the place of s.t. else. </trans>
<eg><i lang=""ceb"">Kinsay mupúli nímug magbakasiyun ka?</i><trans> Who will take your place when you take your vacation? <pb n=""795""/></trans></eg>
<eg><i lang=""ceb"">Ang kasadyà gipulíhan sa kaguul,</i><trans> Now his mirth changed to sorrow. </trans></eg>
<eg><i lang=""ceb"">Munggus ang ipúli pagtanum sa mais,</i><trans> Plant mung beans after the corn. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> (by extension) <tr>replace</tr>. </trans>
<eg><i lang=""ceb"">Pulíhan tu nátung pawuntin pin nga nawálà,</i><trans> Let’s replace the fountain pen that got lost. </trans></eg>
</sense></hom></entry>
<entry><form id=""pulipuxli"" lang=""ceb"">pulipúli</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b]</itype><trans> <tr>take turns</tr> in doing s.t., do s.t. alternately. </trans>
<eg><i lang=""ceb"">Gipulipulíhan nílag bantay ang masakitun,</i><trans> They took turns keeping watch over the patient. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a]</itype><trans> do s.t. to s.o. by turns. </trans>
<eg><i lang=""ceb"">Pulipulíhun lang sila nákug kasábà,</i><trans> I’ll give them a scolding alternately. </trans></eg>
</sense></hom></entry>
<entry><form id=""kapuxli"" lang=""ceb""><abbr expan=""kapúli"" type=""lemma"">ka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>substitute</tr> or <tr>replacement</tr>. </trans>
</sense></hom></entry>
<entry><form id=""kapulixhay"" lang=""ceb"">kapulíhay</form>
<hom>
<sense n=""0""><trans> in the long run. </trans>
<eg><i lang=""ceb"">Sa kapulíhay masáyud ra siya,</i><trans> In the long run, he will surely find out the truth.
</trans></eg>
</sense></hom></entry></entry>");
