<sense n=""0""> <itype>[A; a]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>annihilate</tr>, <tr>destroy</tr> utterly. </trans>
<eg><i lang=""ceb"">Ang mga girilya nagpulkas sa usa ka trák nga Hapun,</i><trans> The guerrillas annihilated a truckload of Japanese soldiers. </trans></eg>
<eg><i lang=""ceb"">Mahinánuk na ku nga napulkasan na sa dughù ang ákung katri,</i><trans> I sleep soundly now that my bed has been rid of bedbugs. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> remove a fish corral from the sea. </trans>
<eg><i lang=""ceb"">Pulkása nag inyung bungsud kay tinghabagat na,</i><trans> Remove your fish corral now because the windy season is setting in. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a]</itype><trans> pay off debts. </trans>
<eg><i lang=""ceb"">Nakapulkas siya sa útang pagkadaug níya sa swipstik,</i><trans> He managed to pay off his debts when he won the sweepstakes.
