<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>break</tr> s.t. brittle into tiny pieces. </trans>
<eg><i lang=""ceb"">Napulpug ang básung nahagbung,</i><trans> The glass fell and broke into <tr>smithereens</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b]</itype><trans> tap, knock off fine particles. </trans>
