INSERT INTO `wced_entry` VALUES (14922, "pulta", "796", "<entry page=""796"" id=""14922""><form id=""pulta"" lang=""ceb"">pulta</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number> <tr>door</tr>, <tr>doorway</tr>. <form id=""pulta_mayur"" lang=""ceb""><abbr expan=""pulta"" type=""lemma"">—</abbr> mayur</form><trans> main door. </trans>
</sense>
<sense n=""2""><number>2</number><trans> admission fee. </trans>
</sense>
<sense n=""3""><number>3</number><trans> = <xr lang=""ceb"" target=""#pwirtu2""><sc>pwirtu<sub>2</sub></sc></xr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> pay admission. </trans>
<eg><i lang=""ceb"">Akuy mupulta nímu sa sini,</i><trans> I’ll pay your way to the show. </trans></eg>
</sense></hom>
<entry><form id=""pultahan"" lang=""ceb"">pultahan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>doorway</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> store space used as a retail establishment. </trans>
<eg><i lang=""ceb"">Duha ka náyung pultahan ang ílang giabángan,</i><trans> They rented two adjacent store spaces. </trans></eg>
</sense></hom></entry>
<entry><form id=""pultixra"" lang=""ceb"">pultíra</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#pultixru""><sc>pultíru</sc></xr> (female). </trans>
</sense></hom></entry>
<entry><form id=""pultixru"" lang=""ceb"">pultíru</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>doorkeeper</tr>, <tr>usher</tr> who collects admission tickets. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B16; bc1]</itype><trans> be a ticket collector.
</trans>
</sense></hom></entry></entry>");
