INSERT INTO `wced_entry` VALUES (14923, "pultri", "796", "<entry page=""796"" id=""14923""><form id=""pultri"" lang=""ceb"">pultri</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> one’s fowls and the equipment to maintain them. </trans>
<eg><i lang=""ceb"">Nasúnug ámung pultri gabíi,</i><trans> Our chicken coop burnt down last night. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> operate a poultry business. </trans>
<eg><i lang=""ceb"">Magpultri ku arun ku makabaligyag mga itlug,</i><trans> I want to raise poultry so that I can sell eggs. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> set up a poultry house. </trans>
<eg><i lang=""ceb"">Magpultri kug kabutangan sa mga manuk,</i><trans> I’ll make a coop to shelter the chickens.
</trans></eg>
</sense></hom></entry>");
