INSERT INTO `wced_entry` VALUES (14925, "pulu2", "796", "<entry page=""796"" id=""14925""><form id=""puxlu2"" lang=""ceb"">púlu<sub>2</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>handle</tr> of bladed instruments. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>butt</tr> of a pistol or a revolver. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> make, supply the handle of a bladed instrument. </trans>
<eg><i lang=""ceb"">Íya nang gipulúan (gipul-ánan) ang ímung sundang,</i><trans> He has made a handle for your bolo. </trans></eg>
</sense></hom>
<entry><form id=""puluan_pul-an"" lang=""ceb"">puluan, pul-an</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#puxlu""><sc>púlu</sc></xr>, <i lang=""ceb"">n, v.</i> </trans>
</sense></hom></entry>
<entry><form id=""magdaxyig_ug_pul-an_ug_guna_nagdaxyig_ug_pul-an_ug_guna"" lang=""ceb""><abbr expan=""magdáyig ug pul-an ug guna"" type=""lemma"">mag-</abbr>/nagdáyig ug pul-an ug guna</form>
<hom>
<sense n=""0""><trans> extolling the virtues of one’s own possessions. </trans>
<eg><i lang=""ceb"">Ang amahan nga nagdáyig sa kagwápa sa íyang kaugalíngung anak mu rag nagdáyig ug puluan ug guna,</i><trans> A father who praises his own daughter’s beauty is like a man who praises a bolo handle he made himself.
</trans></eg>
</sense></hom></entry></entry>");
