INSERT INTO `wced_entry` VALUES (14929, "pulug", "796", "<entry page=""796"" id=""14929""><form id=""pulug"" lang=""ceb"">pulug</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>dye</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>color</tr>. </trans>
<eg><i lang=""ceb"">Musíga na ang pulug nga pula sa sugà sa trapiku,</i><trans> The traffic light is red. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>power</tr> or <tr>strength</tr> to do s.t. or produce an effect. </trans>
<eg><i lang=""ceb"">Pila ra may pulug sa linúgaw nga ipanihápun?</i><trans> There is nothing to a dinner of mere rice porridge. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> dye, color s.t. with a dye. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a12]</itype><trans> give s.t. its appearance by its very presence. </trans>
<eg><i lang=""ceb"">Mga púlung nga gipulug sa pagmáhay,</i><trans> Words that were fashioned by her deep remorse. </trans></eg>
<eg><i lang=""ceb"">Ang tibuuk palíbut gipulug sa langitnung katahum,</i><trans> Heavenly beauty that bathed the surroundings. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[a12]</itype><trans> picture, describe s.t. in words. </trans>
<eg><i lang=""ceb"">Dì mapulug ang ílang gibátì,</i><trans> What they felt was beyond description. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; a12]</itype><trans> consider s.t. carefully in the mind. </trans>
<eg><i lang=""ceb"">May mga púlung nga manlugwà sa bàbà nga dì pulugun sa hunàhúnà,</i><trans> Words that come out of the mouth without having been carefully thought over in the mind.
</trans></eg>
</sense></hom></entry>");
