INSERT INTO `wced_entry` VALUES (14930, "puluhu", "796", "<entry page=""796"" id=""14930""><form id=""puluxhu"" lang=""ceb"">pulúhu</form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>lazy</tr>, not eager or willing to work or exert oneself. </trans>
</sense>
<sense n=""2""><number>2</number><trans> mentally <tr>slow</tr>. </trans>
<eg><i lang=""ceb"">Pulúhu kaáyu nang batáa sa klási,</i><trans> That boy is very weak in class. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> not knowing how to do anything. </trans>
<eg><i lang=""ceb"">Pulúhu nang bayhána. Dì gánì kahibáwung mulung-ag,</i><trans> That woman has no skills. She doesn’t even know how to cook rice. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B12]</itype><trans> be, become lazy. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B12]</itype><trans> become slow in learning. </trans>
</sense></hom>
<entry><form id=""pinuluhu"" lang=""ceb""><abbr expan=""pinuluhu"" type=""lemma"">-in-(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> done in a lazy, indolent way. </trans>
<eg><i lang=""ceb"">Pinuluhu man nang ímung linaktan!</i><trans> Hurry up! You are walking so lazily. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b5]</itype><trans> do s.t. in a lazy and indolent manner.
<pb n=""797""/>
</trans>
</sense></hom></entry></entry>");
