INSERT INTO `wced_entry` VALUES (14933, "pulung", "797", "<entry page=""797"" id=""14933""><form id=""puxlung"" lang=""ceb"">púlung</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>word</tr>. </trans>
<eg><i lang=""ceb"">Maáyu ka lang sa púlung,</i><trans> You are only good in talking. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number><trans> Word, as used in theology. </trans>
<eg><i lang=""ceb"">Sa sinugdánan mau ang Púlung,</i><trans> In the beginning was the Word. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>statement</tr> or <tr>message</tr>. </trans>
<eg><i lang=""ceb"">Unsay íyang púlung?</i><trans> What did he say? </trans></eg>
</sense></hom>
<entry><form id=""puxlung_gen."" lang=""ceb""><abbr expan=""púlung"" type=""lemma"">—</abbr> <r>[<ix>gen.</ix>]</r></form>
<hom>
<sense n=""0""><trans> [gen.] <tr>said</tr>. </trans>
<eg><i lang=""ceb"">‘Asa ka?’ púlung níya,</i><trans> ‘Where are you going?’ said he. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> word received as a point of honor. </trans>
<eg><i lang=""ceb"">Bakákun ka kay wà kay púlung,</i><trans> You’re a liar because you didn’t keep your word. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A12C; c]</itype><trans> have a <tr>dialogue</tr>, <tr>conference</tr>. </trans>
<eg><i lang=""ceb"">Nagpúlung ang mga tinugyánan sa duha ka násud,</i><trans> The representatives of the two nations had a conference. </trans></eg>
<eg><i lang=""ceb"">Gipulúngan námù ang ímung suliran,</i><trans> We discussed your problem in a conference. </trans></eg>
</sense></hom></entry>
<entry><form id=""pulungpuxlung"" lang=""ceb"">pulungpúlung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; bc]</itype><trans> engage in a conversation. </trans>
<eg><i lang=""ceb"">Wà siyay ikapulungpúlung sukad mabálu,</i><trans> He had no one to talk to after his wife died. </trans></eg>
</sense></hom></entry>
<entry><form id=""pamuxlung"" lang=""ceb""><abbr expan=""pamúlung"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c6]</itype><trans> deliver a speech, say s.t. before an audience. </trans>
<eg><i lang=""ceb"">Siya ang únang namúlung,</i><trans> He was the first one to speak to the group. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A2; c]</itype><trans> say s.t. about s.t. </trans>
<eg><i lang=""ceb"">Unsay ímung ikapamúlung niánà<corr sic="","">?</corr></i><trans> What can you say about that? </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; b]</itype><trans> speak to the parents asking for their daughter’s hand. </trans>
<eg><i lang=""ceb"">Nakapamúlung na siya sa ginikánan sa babáyi,</i><trans> He has already asked the parents for the girl’s hand. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> celebration held in asking a girl’s hand from her parents. </trans>
</sense></hom></entry>
<entry><form id=""tigpamuxlung"" lang=""ceb""><abbr expan=""tigpamúlung"" type=""lemma"">tigpaN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>speaker</tr> in a program. </trans>
</sense>
<sense n=""2""><number>2</number><trans> one who speaks for others. </trans>
</sense></hom></entry>
<entry><form id=""pinulungan"" lang=""ceb""><abbr expan=""pinulungan"" type=""lemma"">-in-an(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>language</tr>, way of speech. </trans>
</sense>
<sense n=""2""><number>2</number><trans> word of honor. </trans>
</sense></hom></entry>
<entry><form id=""mamumuxlung"" lang=""ceb""><abbr expan=""mamumúlung"" type=""lemma"">maN-r-</abbr></form>
<hom role=""n""><pos>n</pos>
