INSERT INTO `wced_entry` VALUES (14936, "pulus1", "797", "<entry page=""797"" id=""14936""><form id=""pulus"" lang=""ceb"">pulus<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1; b8]</itype><trans> <tr>be of use</tr>, do. </trans>
<eg><i lang=""ceb"">Kining kahúya dílì magpulus sa halígi,</i><trans> This piece of wood will not do for a post. </trans></eg>
<eg><i lang=""ceb"">Láing táwu ang makapulus sa kwarta,</i><trans> S.o. else can make use of the money. </trans></eg>
<eg><i lang=""ceb"">Kining likì nga tadyaw dì na kapuslan,</i><trans> This jar is of no use any more because it is cracked. </trans></eg>
</sense></hom>
<entry><form id=""walay_pulus"" lang=""ceb"">walay <abbr expan=""pulus"" type=""lemma"">—</abbr></form>
<hom>
<sense n=""0""><trans> there is no use, benefit. </trans>
<eg><i lang=""ceb"">Wà na nay pús<corr sic="","">.</corr> Ilábay nà,</i><trans> That is no good any more. Throw it away. </trans></eg>
</sense></hom></entry>
<entry><form id=""pahimulus"" lang=""ceb""><abbr expan=""pahimulus"" type=""lemma"">pahiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> make <tr>use</tr> of. </trans>
<eg><i lang=""ceb"">Pahimusli (pahimudsi) ang mga taknà sa pagbása,</i><trans> Make use of the hours by reading. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> take <tr>advantage</tr> of. </trans>
<eg><i lang=""ceb"">Dílì ku mupahimulus sa kahúyang sa uban,</i><trans> I will not take advantage of others’ weaknesses. </trans></eg>
<eg><i lang=""ceb"">Pahimudsi ang tanyag,</i><trans> Take advantage of the offer. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b(1)]</itype><trans> take advantage of a woman sexually. </trans>
<eg><i lang=""ceb"">Gipahimuslan ang íyang pagkababáyi samtang gikuyapan siya,</i><trans> She was molested while she was unconscious. </trans></eg>
</sense></hom></entry>
<entry><form id=""puslan_pudsan_man"" lang=""ceb"">puslan (pudsan) man</form>
<hom>
<sense n=""0""><trans> inasmuch as [so-and-so] has happened, [such-and-such] might just as well happen, too. </trans>
<eg><i lang=""ceb"">Puslan (pudsan) man nga nahumud ku maáyu pa ug malígù,</i><trans> Now that I got wet, I might as well go in all the way (i.e., since I started it, I might as well go the whole hog). </trans></eg>
</sense></hom></entry>
<entry><form id=""kapuslaxnan"" lang=""ceb"">kapuslánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> use or <tr>benefit</tr> that can be gotten from s.t. </trans>
<eg><i lang=""ceb"">Unsa may kapuslánan ánang ímung paglakwatsa?</i><trans> What good is it for you to roam about? </trans></eg>
</sense></hom></entry>
<entry><form id=""mahimuslaxnun_mapahimuslaxnun"" lang=""ceb"">mahimuslánun, mapahimuslánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> inclined to avail oneself of any opportunity that comes one’s way. </trans>
</sense></hom></entry>
<entry><form id=""mapuslaxnun_mapudsaxnun"" lang=""ceb"">mapuslánun, mapudsánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>useful</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A13]</itype><trans> be useful. </trans>
<eg><i lang=""ceb"">Ihátag nà nákù kay magmapuslánun (magmapudsánun) ra gihápun nà,</i><trans> Give it to me because it is still of use.
</trans></eg>
</sense></hom></entry></entry>");
