INSERT INTO `wced_entry` VALUES (14937, "pulus2, pulus1", "797", "<entry page=""797"" id=""14937""><form id=""pulus2_puxlus"" lang=""ceb"">pulus<sub>2</sub>, púlus<sub>1</sub></form>
<hom>
<sense n=""0""><trans> (not without <ix>l</ix>) be all s.t. </trans>
<eg><i lang=""ceb"">Pulus babáyi mi dinhi,</i><trans> We are all women here. </trans></eg>
<eg><i lang=""ceb"">Pulus ka lang balíbad dà,</i><trans> You always say no. </trans></eg>
<eg><i lang=""ceb"">Pulus dáan ang ákung libru,</i><trans> My books are all old. </trans></eg>
