INSERT INTO `wced_entry` VALUES (14945, "puna1", "797", "<entry page=""797"" id=""14945""><form id=""puxnaq"" lang=""ceb"">púnà<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; bc]</itype><trans> replant spaces in a field where a seed or plant failed to grow. </trans>
<eg><i lang=""ceb"">Íya nang gipunáan ang dapit nga wà tugki,</i><trans> She has already replanted the places where nothing sprouted. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> repair a fishnet. </trans>
<eg><i lang=""ceb"">Gipunáan <pb n=""798""/>pa ang púkut,</i><trans> They’re still mending the net.
</trans></eg>
</sense></hom></entry>");
