INSERT INTO `wced_entry` VALUES (14949, "punaw", "798", "<entry page=""798"" id=""14949""><form id=""puxnaw"" lang=""ceb"">púnaw</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B126; a4b4]</itype><trans> feel <tr>faint</tr>. </trans>
<eg><i lang=""ceb"">Gipúnaw (gipunáwan) ku sa kabúhì,</i><trans> I felt faint from my stomach pain. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b4(1)]</itype><trans> be overcome by a strong emotion. </trans>
<eg><i lang=""ceb"">Napunáwan siya sa hilabihang kasubù,</i><trans> She was overcome with grief. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B126]</itype><trans> be overcome by shame. </trans>
<eg><i lang=""ceb"">Mu rag napúnaw ku sa íyang tinutukan,</i><trans> The way he stared at me, I wanted to sink into a crack in the floor. </trans></eg>
</sense></hom>
<entry><form id=""punawpuxnaw"" lang=""ceb"">punawpúnaw</form>
<hom>
<sense n=""0""> <form id=""pamunawpuxnaw"" lang=""ceb""><abbr expan=""pamunawpúnaw"" type=""lemma"">paN-</abbr></form><trans> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A]</itype><trans> go far away from s.o. to the horizon or upper spaces where the image is blurred. </trans>
<eg><i lang=""ceb"">Namunawpúnaw ang langgam sa kahitas-an,</i><trans> The bird soared up to the highest reaches of the sky. </trans></eg>
</sense></hom></entry>
<entry><form id=""kapunawpunaxwan"" lang=""ceb"">kapunawpunáwan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> horizon, upper reaches of heaven. </trans>
</sense>
<sense n=""2""><number>2</number><trans> deepest recesses of one’s consciousness (literary). </trans>
<eg><i lang=""ceb"">Ang íyang tíngug mikulíkut sa kapunawpunáwan sa ákung katúlug,</i><trans> Her voice pierced into the depths of my slumber.
</trans></eg>
</sense></hom></entry></entry>");
