INSERT INTO `wced_entry` VALUES (14962, "pundu", "798", "<entry page=""798"" id=""14962""><form id=""pundu"" lang=""ceb"">pundu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>anchor</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>deposit</tr>, amount paid to guarantee the return of s.t. </trans>
</sense>
<sense n=""2a""><number>2a</number><trans> <tr>funds</tr>, <tr>money</tr> set aside for s.t. </trans>
</sense>
<sense n=""2b""><number>2b</number><trans> <tr>stock</tr>, amount of s.t. set aside. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> make an <tr>anchor</tr>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c]</itype><trans> drop <tr>anchor</tr>. </trans>
<eg><i lang=""ceb"">Mupundu ta dinhi,</i><trans> Let’s drop anchor here. </trans></eg>
<eg><i lang=""ceb"">Gipundúhan na ang sakayan,</i><trans> The boat dropped anchor. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[A; b6]</itype><trans> stay s.w. for a while. </trans>
<eg><i lang=""ceb"">Mupundu ta sa landung kadiyut,</i><trans> Let’s rest in the shade for a while. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; b6]</itype><trans> <tr>settle down</tr>, stop doing s.t. </trans>
<eg><i lang=""ceb"">Nagpundu na ang íyang pagtambuk,</i><trans> He has stopped putting on weight. </trans></eg>
</sense>
<sense n=""2c""><number>2c</number> <itype>[A; b]</itype><trans> put animals away for the night. </trans>
<eg><i lang=""ceb"">Gipundúhan na ba nímu ang kabáyù?</i><trans> Have you put the horse away for the night? </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> lay a vehicle or machinery aside. </trans>
<eg><i lang=""ceb"">Ámung gipundu ang ámung kutsi samtang nagbakasiyun mi,</i><trans> We stored our car while we were on vacation. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <itype>[A; c]</itype><trans> deposit s.t. as guarantee. </trans>
<eg><i lang=""ceb"">Ang butilya gipundúhan ug diyis,</i><trans> They deposited ten cents for the bottle. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A; c]</itype><trans> fund a project. </trans>
<eg><i lang=""ceb"">Usa ka miliyun ang gipundu álang sa ubras,</i><trans> A million pesos have been funded for public works. </trans></eg>
</sense>
<sense n=""4a""><number>4a</number><trans> set aside stock for s.t. </trans>
<eg><i lang=""ceb"">Bangà ang gipundúhan sa túbig,</i><trans> They stored <pb n=""799""/>the water in a jar. </trans></eg>
</sense></hom>
<entry><form id=""punduhaxnan"" lang=""ceb"">punduhánan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> anchoring place. </trans>
</sense>
<sense n=""2""><number>2</number><trans> place one stays for a while, animals are put away for the night. </trans>
</sense>
<sense n=""3""><number>3</number><trans> place s.t. is stored, deposited.
</trans>
</sense></hom></entry></entry>");
