INSERT INTO `wced_entry` VALUES (14963, "punduk", "799", "<entry page=""799"" id=""14963""><form id=""punduk"" lang=""ceb"">punduk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AC; b6]</itype><trans> <tr>gather</tr>, <tr>assemble</tr> together in a group. </trans>
<eg><i lang=""ceb"">Dì kita makapunduk sa pasilyu,</i><trans> We can’t gather in the passageway. </trans></eg>
<eg><i lang=""ceb"">Plása ang ílang gipundúkan,</i><trans> They gathered in the town square. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> gather s.t. </trans>
<eg><i lang=""ceb"">Pundúka (ipunduk) ang mga sagbut arun daúban,</i><trans> Pile the trash up to burn it. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>group</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>pile</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>political party</tr>. </trans>
<eg><i lang=""ceb"">Mubali ku sa punduk Libiral,</i><trans> I’ll cross to the Liberal party. </trans></eg>
</sense></hom>
<entry><form id=""pundukpunduk"" lang=""ceb"">pundukpunduk</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> social <tr>gathering</tr>. </trans>
<eg><i lang=""ceb"">Sa pundukpunduk dì pud siya mapiri,</i><trans> She would not be out of place in social gatherings. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> k.o. small cerith shells (<ix>daludalu</ix>), so called because they are found gathered in bunches.
