INSERT INTO `wced_entry` VALUES (14979, "punggak", "799", "<entry page=""799"" id=""14979""><form id=""punggak"" lang=""ceb"">punggak</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1b7]</itype><trans> knock s.t. down by breaking it off at its base or from its attachment. </trans>
<eg><i lang=""ceb"">Makapunggak ka ba ánang manggag pusil gamítun?</i><trans> Can you knock that mango down with a gun? </trans></eg>
<eg><i lang=""ceb"">Punggakun (punggákun) ta nang balay sa lapínig,</i><trans> Let’s knock the beehive down. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B12]</itype><trans> for the seat of the pants to be worn out. </trans>
<eg><i lang=""ceb"">Nagkapunggak na ang lubut sa ákung karsúnis,</i><trans> The seat of my trousers is gradually wearing out. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
