INSERT INTO `wced_entry` VALUES (14980, "punggit", "799", "<entry page=""799"" id=""14980""><form id=""punggit"" lang=""ceb"">punggit</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a1b2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> hit s.t. with a missile <pb n=""800""/>to knock it down or off. </trans>
<eg><i lang=""ceb"">Wà siya makapunggit sa iruplánu sa kaáway,</i><trans> He was not able to shoot down the enemy plane. </trans></eg>
<eg><i lang=""ceb"">Batu ray ákung ipunggit ánang bayábas,</i><trans> I’ll knock that guava down with a stone. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>hit</tr> s.t. directly. </trans>
<eg><i lang=""ceb"">Punggíta ang úlu sa manuk,</i><trans> Hit the chicken in the head. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> break, cut s.t. off. </trans>
<eg><i lang=""ceb"">Ang hitabù nakapunggit sa íyang ambisiyun,</i><trans> The event cut down his soaring ambition. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> <tr>mark</tr> s.o. for s.t. bad. </trans>
<eg><i lang=""ceb"">Ug mapildi ang Libiral punggítun siya sa ubus nga pwistu,</i><trans> He’s marked for demotion to a low position if the Liberal Party loses.
</trans></eg>
</sense></hom></entry>");
