INSERT INTO `wced_entry` VALUES (14994, "pungpung pyangaw", "800", "<entry page=""800"" id=""14994""><form id=""pungpung_pyaxngaw"" lang=""ceb"">pungpung pyángaw</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a game of the hands played by children wherein the players put their fists one on top of the other. A child not participating is the leader (<ix>abat</ix>) and recites a verse after which the fist at the bottom opens; the verse is repeated and the next fist opens, and so forth, until everybody has opened his fist. Then the leader inserts his index finger into the pile of hands letting the players guess in turn if his finger have touched bottom. The verse recited goes: </trans>
<eg><i lang=""ceb"">Pungpung pyángaw, Bukadbukad iláwum, Kulítug kulítug, Lagbas na ba? Pungpung pyángaw,</i><trans> Open up the lowest hand, Thrust the finger in, Has it reached the bottom? </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AC; c1]</itype><trans> play <ix>pungpung pyángaw</ix>.
</trans>
</sense></hom></entry>");
