INSERT INTO `wced_entry` VALUES (14995, "pungtud", "800", "<entry page=""800"" id=""14995""><form id=""pungtud"" lang=""ceb"">pungtud</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>hill</tr>, a natural raised part of the earth’s surface often rounded, smaller than a mountain. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>anthill</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>shoal</tr> or <tr>sandbar</tr>, an island-like formation in shallow seas, visible during low tide. </trans>
<eg><i lang=""ceb"">Manginhas ku sa pungtud inighunas,</i><trans> I’ll gather shells at the shoal during low tide. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126; b6]</itype><trans> be formed into a hill. </trans>
</sense></hom>
<entry><form id=""kapungtuxran"" lang=""ceb"">kapungtúran</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>hills</tr>. </trans>
