INSERT INTO `wced_entry` VALUES (14997, "pungun", "800", "<entry page=""800"" id=""14997""><form id=""pungun"" lang=""ceb"">pungun</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> sharp object (<tr>spine</tr>, <tr>thorn</tr>, and the like) that has pricked and is lodged into the body. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; a3b4]</itype><trans> <tr>prick</tr> and be lodged in the body. </trans>
<eg><i lang=""ceb"">Mupungun gayud ang mga tunuk sa tuyum,</i><trans> The spines of the sea urchins will surely be lodged in the skin if they prick you. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[b]</itype><trans> for a woman to be had for sexual intercourse (humorous). </trans>
<eg><i lang=""ceb"">Kay natúlug siya uban sa íyang trátu, sigúru giyud ku nga gipungnan siya,</i><trans> Because she slept with her lover, I’m sure she had sexual intercourse <pb n=""801""/>with him.
