INSERT INTO `wced_entry` VALUES (15000, "pungut", "801", "<entry page=""801"" id=""15000""><form id=""puxngut"" lang=""ceb"">púngut</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; c1]</itype><trans> <tr>join</tr> things together by tying or pasting them. </trans>
<eg><i lang=""ceb"">Magpúngut kug písì nga hayháyan,</i><trans> I’ll join together pieces of rope for a clothesline. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C; c1]</itype><trans> for two people to have a claim on part of a piece of money for lack of loose change. </trans>
<eg><i lang=""ceb"">Ang ímung singkwinta nagpúngut sa písus nga gibáyad nákù,</i><trans> Your payment is included in the peso bill which he paid me. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A13]</itype><trans> for a thicket to form with intertwining weeds. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> thick cluster of intertwining shrubs and grasses. </trans>
<eg><i lang=""ceb"">Ságad ang buntug mulukluk sa púngut,</i><trans> Usually the quail hides in the <tr>underbrush</tr>. </trans></eg>
</sense></hom>
<entry><form id=""pungutay"" lang=""ceb""><abbr expan=""pungutay"" type=""lemma"">-ay(→)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C]</itype><trans> have intercourse (coarse, but not very much so). </trans>
</sense></hom></entry>
<entry><form id=""kapupungtan_kinapungtan"" lang=""ceb"">kapupungtan, kinapungtan</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> the endmost part of s.t. long where it joins to s.t. else. </trans>
<eg><i lang=""ceb"">Putla ang tinái dihà sa íyang kapupungtan sa túngul,</i><trans> Cut the intestines at the place where they join the stomach. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the <tr>endmost</tr> part of anything very long or high. </trans>
<eg><i lang=""ceb"">Didtu níla hiapsi ang kawatan sa kapupungtan sa sapà, nag-inum,</i><trans> They came across the thief at the head of the river, drinking. </trans></eg>
<eg><i lang=""ceb"">Ang payag túa gitúkud sa kinapungtan sa búkid,</i><trans> The shack was built at the top of the mountain.
</trans></eg>
</sense></hom></entry></entry>");
