INSERT INTO `wced_entry` VALUES (15009, "punpal", "802", "<entry page=""802"" id=""15009""><form id=""punpal"" lang=""ceb"">punpal</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> person whom one calls up regularly to talk to on the phone, but whom one does not know in person. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C1; a12]</itype><trans> be, become a phone pal. </trans>
<eg><i lang=""ceb"">Ug makigpunpal ka ayaw gawía ring ákù,</i><trans> If you are calling just to make friends with s.o., don’t use my phone.
</trans></eg>
</sense></hom></entry>");
