INSERT INTO `wced_entry` VALUES (15010, "punpun", "802", "<entry page=""802"" id=""15010""><form id=""punpun"" lang=""ceb"">punpun</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>gather</tr> powder, grains into a heap by scooping them together with the hands. </trans>
<eg><i lang=""ceb"">Punpúna ang ímung giníuk humay sa taliwā̀ sa banig,</i><trans> <tr>Pile</tr> the rice you threshed in the center of the mat. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3; a12]</itype><trans> <tr>compile</tr>, <tr>collect</tr>. </trans>
<eg><i lang=""ceb"">Gipunpun ang tanang mananáug nga sugilánun sa usa ka bulyum,</i><trans> All the winning entries of stories were compiled in one volume. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B; a12]</itype><trans> <tr>accumulate</tr>, <tr>pile</tr> up. </trans>
<eg><i lang=""ceb"">Ug sa matag adlaw nga milabay láing kahásul ang mipunpun dihà sa íyang kaisípan,</i><trans> And each day that passed another worry accumulated in her mind. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c1]</itype><trans> in weeding, knock off the soil and heap up the weeds for disposal. </trans>
<eg><i lang=""ceb"">Mamunpun (mupunpun) ku sa ímung ginúna,</i><trans> I will knock the soil off the weeds you pulled up and heap them at the side. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> pile of s.t. powdered or in grains. </trans>
</sense>
<sense n=""2""><number>2</number><trans> compilation. </trans>
</sense>
<sense n=""3""><number>3</number><trans> accumulation.
</trans>
</sense></hom></entry>");
