INSERT INTO `wced_entry` VALUES (15019, "punta1", "802", "<entry page=""802"" id=""15019""><form id=""punta"" lang=""ceb"">punta<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6]</itype><trans> <tr>head</tr> towards a place. </trans>
<eg><i lang=""ceb"">Diin siya punta,</i><trans> Where was he <tr>headed</tr>? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; ac]</itype><trans> head s.t. s.w. </trans>
<eg><i lang=""ceb"">Kanang kahúya mauy puntáhun,</i><trans> Head toward that tree. </trans></eg>
<eg><i lang=""ceb"">Ipunta ang sakayan ngadtu,</i><trans> Head the boat in that direction. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[B12356]</itype><trans> end up with a certain husband or wife. </trans>
<eg><i lang=""ceb"">Namílì siyag dátù, nahipunta núug buguy,</i><trans> She tried to get a rich husband but wound up with a tramp. </trans></eg>
</sense></hom>
<entry><form id=""hipunta_hapunta"" lang=""ceb""><abbr expan=""hipunta"" type=""lemma"">hi-</abbr>/<abbr expan=""hapunta"" type=""lemma"">ha-</abbr></form>
<hom>
