INSERT INTO `wced_entry` VALUES (15030, "puntu", "803", "<entry page=""803"" id=""15030""><form id=""puntu"" lang=""ceb"">puntu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>point</tr>, the important or main idea. </trans>
<eg><i lang=""ceb"">Klarúha ang puntu sa buut mung ipasabut,</i><trans> Clarify the point that you want to make. </trans></eg>
</sense></hom>
<entry><form id=""puntu_dibista"" lang=""ceb""><abbr expan=""puntu"" type=""lemma"">—</abbr> dibista</form>
<hom>
<sense n=""0""><trans> <tr>point of view</tr>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>period</tr> in writing. </trans>
</sense>
<sense n=""2a""><number>2a</number> <form id=""puntu_ikuxma"" lang=""ceb""><abbr expan=""puntu"" type=""lemma"">—</abbr> ikúma</form><trans> semicolon. </trans>
</sense>
<sense n=""2a1""><number>2a1</number><trans> speaking slowly. </trans>
<eg><i lang=""ceb"">Puntu ikúma kaáyug sinultihan,</i><trans> Speaking slowly and tediously. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>accent</tr>, <tr>pronunciation</tr>. </trans>
<eg><i lang=""ceb"">Puntu sa Dalagit ang íyang sinultihan,</i><trans> She talks with a Dalaguete accent. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number><trans> <tr>tune</tr> of a musical piece. </trans>
<eg><i lang=""ceb"">Dì nà mau ang puntu,</i><trans> That’s not the tune. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number><trans> <tr>timing</tr>, <tr>rhythm</tr>. </trans>
<eg><i lang=""ceb"">Maáyug puntu ang íyang sinayawan,</i><trans> She dances in a good rhythm. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>fitting</tr>, mixed to the right proportion, done at the right time, <tr>right</tr> for the purpose for which it is meant. </trans>
<eg><i lang=""ceb"">Puntu kaáyu ang timpla sa sabaw,</i><trans> The soup is perfectly seasoned. </trans></eg>
<eg><i lang=""ceb"">Puntu nang aníhun ang humay,</i><trans> Now is just the time to harvest the rice. </trans></eg>
<eg><i lang=""ceb"">Dílì puntu ang midisína nga nadápat sa duktur,</i><trans> The doctor did not administer the right medicine. </trans></eg>
<eg><i lang=""ceb"">Dílì puntu ang ímung tubag,</i><trans> Your answer is not exactly to the point. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> doing s.t. <tr>regularly</tr>. </trans>
<eg><i lang=""ceb"">Dílì puntu ang ílang pagpangáun,</i><trans> They don’t eat regularly. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b6(1)]</itype><trans> <tr>punctuate</tr> with a period. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2B16; c1]</itype><trans> sing with the correct tune and rhythm. </trans>
<eg><i lang=""ceb"">Kamau ming mupuntu ug náay musúgud,</i><trans> We know how to get the correct tune if s.o. starts. </trans></eg>
<eg><i lang=""ceb"">Ipuntu (puntúha) ang ímung sinayawan sa sunáta,</i><trans> Dance in time to the music. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[C; ac]</itype><trans> in <tr>harmony</tr>. </trans>
<eg><i lang=""ceb"">Nagkapuntu ang ílang tíngug,</i><trans> They sang in harmony. </trans></eg>
</sense>
<sense n=""2b""><number>2b</number> <itype>[A; a]</itype><trans> in pounding rice, when s.o. wants to join in pounding together with s.o. else, to tap the side of the mortar each time the other person’s pestle is out in order to get the rhythm prior to pounding, so that when the two are pounding together the pestles will not collide. </trans>
<eg><i lang=""ceb"">Puntúhi úsà antis ka muásud,</i><trans> Tap your pestle on the mortar to get the rhythm before you enter in. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A2; c1]</itype><trans> add <tr>seasoning</tr> in the right consistency. </trans>
<eg><i lang=""ceb"">Lamì ang sálad ug puntúhun (ipuntu) ang asin, súkà, ug asúkar,</i><trans> The salad will come out nice if the salt, vinegar, and sugar are added in the right proportions. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A; a]</itype><trans> do s.t. at the right time or in the right way. </trans>
<eg><i lang=""ceb"">Mipuntu giyud síyag adtu arun dílì sila magkabaíwas,</i><trans> He went just at the right time so they wouldn’t miss each other. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <itype>[A2]</itype><trans> make a point in an argument, answer to the point. </trans>
<eg><i lang=""ceb"">Mipuntu siya niadtung tubága,</i><trans> He hit the point with that answer. </trans></eg>
</sense>
<sense n=""3c""><number>3c</number> <itype>[A2N; b(1)]</itype><trans> <tr>score</tr> a <tr>point</tr>. </trans>
<eg><i lang=""ceb"">Siyay mamuntu sa baskit kay hingígù,</i><trans> He makes a lot of baskets because he is a crack player. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[C1]</itype><trans> do s.t. on a regular schedule. </trans>
</sense>
<sense n=""5""><number>5</number> <itype>[c]</itype><trans> <form id=""puntu_ikuxma"" lang=""ceb""><abbr expan=""puntu"" type=""lemma"">—</abbr> ikúma</form> speak slowly. </trans>
</sense></hom></entry>
<entry><form id=""panghimuntu"" lang=""ceb""><abbr expan=""panghimuntu"" type=""lemma"">panghiN-</abbr></form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#puntu""><sc>puntu</sc></xr>, <i lang=""ceb"">v2b.</i> </trans>
</sense></hom></entry>
<entry><form id=""dipuntu"" lang=""ceb""><abbr expan=""dipuntu"" type=""lemma"">di-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>short pants</tr>. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b6]</itype><trans> wear short pants. </trans>
</sense></hom></entry>
<entry><form id=""puntixru"" lang=""ceb"">puntíru</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one who blends the sugar being refined. </trans>
</sense></hom></entry>
<entry><form id=""pamuntu"" lang=""ceb""><abbr expan=""pamuntu"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> regional pronunciation.
</trans>
</sense></hom></entry></entry>");
