INSERT INTO `wced_entry` VALUES (15033, "puntus", "803", "<entry page=""803"" id=""15033""><form id=""puntus"" lang=""ceb"">puntus</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>points</tr> in a game. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> <tr>blow</tr> in boxing as reckoned as a criteria for winning a game. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>mahjong</tr> player. </trans>
<eg><i lang=""ceb"">Dì sila makadúlà ug madyung ug kúlang ang puntus,</i><trans> They can’t play mahjong if there are not enough players. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> regular <tr>player</tr> at a certain gambling joint. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>superior</tr> in any way (slang). </trans>
<eg><i lang=""ceb"">Usa ray ákung uyab piru puntus man sab,</i><trans> I have only one girl but she really is s.t. </trans></eg>
<eg><i lang=""ceb"">Ang puntus nga mga bisíta ispisyal giyud nga pagkatagad,</i><trans> <tr>Important</tr> visitors should be given special treatment. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for a statement or opinion to be loaded with bright ideas. </trans>
<eg><i lang=""ceb"">Diyútay ra siyag sulti, piru ug mutíngug, puntus pud,</i><trans> He doesn’t have much to say, but when he speaks, it is to the point. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A]</itype><trans> score. </trans>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A2N; b2]</itype><trans> land a good blow at s.o. </trans>
<eg><i lang=""ceb"">Bísag gamay si Tiryu nakapuntus sab sa íyang kuntra,</i><trans> Though Terry is small he managed to land a blow on his opponent. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c1]</itype><trans> have a player or players for a mahjong game. <pb n=""804""/></trans>
</sense></hom>
<entry><form id=""puntusay"" lang=""ceb""><abbr expan=""puntusay"" type=""lemma"">-ay(→)</abbr></form>
