INSERT INTO `wced_entry` VALUES (15035, "punu", "804", "<entry page=""804"" id=""15035""><form id=""punuq"" lang=""ceb"">punù</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>filled</tr>, <tr>full</tr>. </trans>
<eg><i lang=""ceb"">Punù ang ímung úlu sa binúang,</i><trans> Your head is filled with all sorts of foolishness. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>covered</tr> with s.t. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AB56; a2]</itype><trans> <tr>fill</tr> up a container or space. </trans>
<eg><i lang=""ceb"">Siyay nagpunù sa baldi ug balas,</i><trans> He filled up the pail (with sand). </trans></eg>
<eg><i lang=""ceb"">Ang lawak napunù sa mga táwu,</i><trans> The room was filled with people. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1246; a12]</itype><trans> be full of s.t., all covered with. </trans>
<eg><i lang=""ceb"">Napunù sa kawras ang íyang mga bitíis,</i><trans> Her legs are all covered with scratches. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; c]</itype><trans> <tr>add</tr> s.t. to. </trans>
<eg><i lang=""ceb"">Íyang gipun-an ang ámung swildu ug tagdiyis písus,</i><trans> He added ten pesos each to our salary. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A23; c]</itype><trans> say s.t. further in a conversation. </trans>
<eg><i lang=""ceb"">Wà na kuy ikapunù sa ákung gisulti sa úna,</i><trans> I have nothing further to add to what I said before. </trans></eg>
</sense>
<sense n=""3b""><number>3b</number> <itype>[b(1)]</itype><trans> [so-and-so] is true on top of s.t. else. </trans>
<eg><i lang=""ceb"">Gipun-an pa sa íyang pagkadátù ang íyang pagkabrayit,</i><trans> He is rich and also smart. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>amount added</tr> or thrown into a bargain. </trans>
<eg><i lang=""ceb"">Pila may ímung punù sa pagbugtì sa ímung báka sa íyang kabáyù?</i><trans> How much money did you <tr>throw in</tr> when you bartered your cow for his horse? </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> things said in addition to. </trans>
<eg><i lang=""ceb"">‘Kaáyu untang ipuyù dinhi,’ punù níya nga nanghupaw,</i><trans> ‘How nice would it be to live here,’ he added, sighing. </trans></eg>
</sense></hom>
<entry><form id=""makapunuq"" lang=""ceb""><abbr expan=""makapunù"" type=""lemma"">maka-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> a variety of coconut, filled with meat which remains soft even when mature. </trans>
</sense></hom></entry>
<entry><form id=""pulun-an_pulun-anan"" lang=""ceb"">pulun-an, pulun-anan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> amount to add. </trans>
</sense></hom></entry>
<entry><form id=""pun-unun_pulun-un"" lang=""ceb"">pun-unun, pulun-un</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>container</tr> to be filled up.
</trans>
</sense></hom></entry></entry>");
