INSERT INTO `wced_entry` VALUES (15036, "punu1", "804", "<entry page=""804"" id=""15036""><form id=""puxnuq"" lang=""ceb"">púnù<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>trunk</tr> of a tree, main stem or body of a tree, apart from the limbs and roots. </trans>
</sense></hom>
<entry><form id=""punuxan"" lang=""ceb""><abbr expan=""punúan"" type=""lemma"">-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#puxnuq""><sc>púnù</sc></xr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> the <tr>tree</tr> as a unit for numeration. </trans>
<eg><i lang=""ceb"">Tulu ka punúang mangga,</i><trans> Three mango trees. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>base</tr>, <tr>lowest part</tr> of s.t. </trans>
<eg><i lang=""ceb"">Balay nga náa sa punúan sa bungtud,</i><trans> A house at the foot of the hill. </trans></eg>
<eg><i lang=""ceb"">Punúan sa hagdan,</i><trans> Foot of the stairs. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> <tr>point of attachment</tr> of a part of the body. </trans>
<eg><i lang=""ceb"">Gihubagan ku sa may punúan sa ákung páa,</i><trans> I have a boil right at the base of my thigh. </trans></eg>
<eg><i lang=""ceb"">Punúan sa buhuk,</i><trans> The roots of the hair. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>officials</tr> in charge of an office. </trans>
<eg><i lang=""ceb"">Punúan sa lungsud,</i><trans> The town officials. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> main <tr>office</tr> of a company. </trans>
</sense></hom></entry>
<entry><form id=""pamuxnuq"" lang=""ceb""><abbr expan=""pamúnù"" type=""lemma"">paN-</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>president</tr>, <tr>governor</tr>. </trans>
</sense></hom></entry>
<entry><form id=""pamuxnuq_lalawixgan"" lang=""ceb""><abbr expan=""pamúnù"" type=""lemma"">paN-</abbr> lalawígan</form>
<hom>
<sense n=""0""><trans> <tr>governor</tr> of the province. </trans>
</sense></hom></entry>
<entry><form id=""pamuxnuq_naxsud"" lang=""ceb""><abbr expan=""pamúnù"" type=""lemma"">paN-</abbr> násud</form>
<hom>
<sense n=""0""><trans> <tr>president</tr> of the nation. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b6]</itype><trans> be the president. </trans>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A12]</itype><trans> get as one’s president. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> <tr>govern</tr>. </trans>
<eg><i lang=""ceb"">Gibutáan tas mga Katsílà sa dihang silay mipamúnù (namúnù),</i><trans> The Spaniards blinded us when they governed us. </trans></eg>
</sense></hom></entry>
<entry><form id=""pamunuxan"" lang=""ceb""><abbr expan=""pamunúan"" type=""lemma"">paN-an</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> administration of a certain regime. </trans>
</sense>
<sense n=""2""><number>2</number><trans> way of administering. </trans>
</sense></hom></entry>
<entry><form id=""pamunuxan_nga_kumpanixya"" lang=""ceb""><abbr expan=""pamunúan"" type=""lemma"">paN-an</abbr> nga kumpaníya</form>
<hom>
<sense n=""0""><trans> head office, mother company. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; b6]</itype><trans> govern. </trans>
<eg><i lang=""ceb"">Ug ikay mamunúan, wà kay mahímù,</i><trans> If you are in power, you won’t be able to do anything. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12]</itype><trans> get a certain regime as one’s government.
</trans>
</sense></hom></entry></entry>");
