</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[a2b2]</itype><trans> shout <ix>punyíta</ix> to s.o. </trans>
<eg><i lang=""ceb"">Gipunyíta (napunyitahan) ku sa ákung ámu kay nakapildi kug istanti,</i><trans> My boss shouted ‘darn’ at me because I broke a display case.
