INSERT INTO `wced_entry` VALUES (15052, "puphu", "805", "<entry page=""805"" id=""15052""><form id=""puphu"" lang=""ceb"">puphu</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; a]</itype><trans> <tr>scoop</tr> up with the hands. </trans>
<eg><i lang=""ceb"">Siyay mipuphu (namuphu) sa bugas nga naúsik,</i><trans> She scooped up the rice that spilled. </trans></eg>
<eg><i lang=""ceb"">Magpuphu ku sa mga sagbut nga ákung sinilhig,</i><trans> I’ll <tr>pick up</tr> the trash that I swept. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A12; a3]</itype><trans> <tr>gather</tr> information, earnings. </trans>
<eg><i lang=""ceb"">Nakapuphu ang pulis ug dúgang kasayúran báhin sa túlis,</i><trans> The police have gathered additional information on the robbery. </trans></eg>
<eg><i lang=""ceb"">Íyang napuphu ang íyang minilyun gíkan sa íyang patigáyun sa trúsu,</i><trans> He earned his millions from his logging business. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; a12]</itype><trans> <tr>annihilate</tr>, wipe out of existence en masse. </trans>
<eg><i lang=""ceb"">Sakit mauy mipuphu sa tanang pumupúyù,</i><trans> Pestilence wiped out the whole population. </trans></eg>
</sense></hom>
<entry><form id=""puphuay"" lang=""ceb"">puphuay</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#buqbuay""><sc>bùbuay</sc></xr>, <ix>see</ix> <xr lang=""ceb"" target=""#buqbuq""><sc>bùbù</sc></xr>. <ix>see also</ix> <xr lang=""ceb"" target=""#paluphu""><sc>paluphu</sc></xr>.†
</trans>
</sense></hom></entry></entry>");
