INSERT INTO `wced_entry` VALUES (15073, "purga", "806", "<entry page=""806"" id=""15073""><form id=""purga"" lang=""ceb"">purga</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>purgative</tr>. </trans>
<eg><i lang=""ceb"">Purga sa bítuk,</i><trans> Purgative for intestinal worms. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> administer a purgative. </trans>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A]</itype><trans> take a purgative. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> eat s.t. which is unpalatable because it has been served so often. </trans>
<eg><i lang=""ceb"">Háy. Ginamus gayud ang sud-an nátù adlaw-adlaw ug magpurga na sad sa tangkung,</i><trans> All we have to eat is fish paste every day, and <ix>kangkong</ix> vegetable as a purgative. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B1256]</itype><trans> have so much of s.t. one is sick of it. </trans>
<eg><i lang=""ceb"">Dalùdalù mag mangga. Pasagdahan bítaw nákug pagkáun, napurga lagi,</i><trans> He just loved mangoes, so I let him have as many as he wanted and he got sick of them. </trans></eg>
</sense></hom>
<entry><form id=""purganti"" lang=""ceb""><abbr expan=""purganti"" type=""lemma"">-nti</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>purgative</tr>.
</trans>
</sense></hom></entry></entry>");
