INSERT INTO `wced_entry` VALUES (15086, "purisu, pur-isu", "806", "<entry page=""806"" id=""15086""><form id=""purixsu_pur-ixsu"" lang=""ceb"">purísu, pur-ísu</form>
<hom>
<sense n=""1""><number>1</number><trans> <tr>therefore</tr>, in that case, <tr>then</tr> ... </trans>
<eg><i lang=""ceb"">Pur-ísu magtuun ka arun ka makapasar,</i><trans> Therefore, you must study if you want to pass. </trans></eg>
<eg><i lang=""ceb"">Wà ka magtuun. Purísu nahagbung ka,</i><trans> You did not study. Therefore, you failed. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> that’s exactly what must happen (said in a context where the interlocutor has said, ‘If [so-and-so] does not happen, [such-and-such] a bad outcome will follow’). </trans>
<eg><i lang=""ceb"">‘Midalì siyag báyad arun dílì maimbargu’—‘Purísu.’</i><trans> ‘He paid right away to avoid having it repossessed.’—‘Exactly. That’s what he had to do.’
