INSERT INTO `wced_entry` VALUES (15092, "purma", "807", "<entry page=""807"" id=""15092""><form id=""purma"" lang=""ceb"">purma</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>form</tr>, <tr>outline</tr>: the way s.t. looks. </trans>
