<sense n=""0""> <itype>[AB2; c1]</itype><trans> take <tr>form</tr>, <tr>shape</tr>; cause s.t. to do so. </trans>
<eg><i lang=""ceb"">Ígù lang kung mupurma sa balay,</i><trans> I’ll just form the framework of the house. </trans></eg>
