INSERT INTO `wced_entry` VALUES (15093, "purmal", "807", "<entry page=""807"" id=""15093""><form id=""purmal"" lang=""ceb"">purmal</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> behaving properly according to one’s station. </trans>
<eg><i lang=""ceb"">Purmal kaáyu siyang manglihuklihuk,</i><trans> She is very <tr>formal</tr> in her ways. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> formal, according to ceremony. </trans>
<eg><i lang=""ceb"">Purmal kaáyu ang ílang kasal,</i><trans> Their wedding was a very formal one. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> formal clothing. </trans>
</sense>
<sense n=""4""><number>4</number><trans> done formally, not off the record. </trans>
<eg><i lang=""ceb"">Ang purmal nga pagtiman-anay,</i><trans> Formal signing ceremonies. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B3(1); c1]</itype><trans> be, behaved properly according to one’s station. </trans>
<eg><i lang=""ceb"">Magpurmal ka. Dì ka magpabuyag,</i><trans> Act properly. Don’t misbehave. </trans></eg>
<eg><i lang=""ceb"">Dì ku makapurmal uban sa ákung mga gang,</i><trans> I can’t behave <tr>prim</tr> and <tr>proper</tr> when I’m with my gang. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c1]</itype><trans> make s.t. formal. </trans>
</sense>
<sense n=""3""><number>3</number> <itype>[A13]</itype><trans> wear formal attire. </trans>
</sense>
<sense n=""3a""><number>3a</number> <itype>[c1]</itype><trans> make it a party with formal attire. </trans>
</sense>
<sense n=""4""><number>4</number> <itype>[c16]</itype><trans> do s.t. formally, not off the record. </trans>
</sense></hom>
<entry><form id=""purmalidad"" lang=""ceb""><abbr expan=""purmalidad"" type=""lemma"">-idad(→)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>formality</tr>, as a matter of form. </trans>
<eg><i lang=""ceb"">Purmalidad lang nang íyang pagpangimbitar kanátù. Dì giyud kinasingkásing,</i><trans> He invited us only for formality’s sake. He didn’t really want us to go.
</trans></eg>
</sense></hom></entry></entry>");
