INSERT INTO `wced_entry` VALUES (15108, "pursiyintu", "807", "<entry page=""807"" id=""15108""><form id=""pursiyintu"" lang=""ceb"">pursiyintu</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>per cent</tr> </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> give a rate of interest. </trans>
<eg><i lang=""ceb"">Pursiyintúhan ku ang íyang kwartag diyis ang búlan,</i><trans> I’ll pay him (or I will charge him) ten <tr>percent</tr> interest a month. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get or give a percentage commission. </trans>
<eg><i lang=""ceb"">Mupursiyintu mig singku káda hálin,</i><trans> We get (or give) five percent commission on each sale. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> give or get a <tr>percentage</tr> of the winnings to the owner of gambling equipment. </trans>
<eg><i lang=""ceb"">Mupursiyintu silag gamay káda daug,</i><trans> They get (or give) a small percentage of the winning as a fee to the owner of the house. </trans></eg>
</sense></hom>
<entry><form id=""pamursiyintu"" lang=""ceb""><abbr expan=""pamursiyintu"" type=""lemma"">paN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> borrow money with interest. </trans>
<eg><i lang=""ceb"">Mamursiyintu lang ku kay wà kuy láing karimidiyúhan,</i><trans> I’ll borrow money because I have no other place to get money from.
</trans></eg>
</sense></hom></entry></entry>");
