</sense>
<sense n=""2""><number>2</number> <itype>[A; a1]</itype><trans> <tr>break</tr> s.t. fragile. </trans>
<eg><i lang=""ceb"">Akuy mipusà sa plátu,</i><trans> I broke the plate. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b6c1]</itype><trans> <tr>hatch</tr> an egg. </trans>
<eg><i lang=""ceb"">Ang himungáan mauy mipusà sa mga itlug sa bíbi,</i><trans> The hen hatched the duck’s eggs. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[b8]</itype><trans> for eggs to break in the hen’s womb. </trans>
<eg><i lang=""ceb"">Napus-an (hipus-an) nang manuk nga nagbasà ang lubut,</i><trans> That hen that has a wet bottom had an egg break in its womb. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>broken</tr>, esp. eggs.
