INSERT INTO `wced_entry` VALUES (15134, "pusak, pusak", "808", "<entry page=""808"" id=""15134""><form id=""pusak_puxsak"" lang=""ceb"">pusak, púsak</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2S; a]</itype><trans> <tr>break</tr> s.t. hard. </trans>
<eg><i lang=""ceb"">Ikaw bay nagpusak sa pinggan<corr sic="","">?</corr></i><trans> Were you the one who broke the plate into pieces? </trans></eg>
<eg><i lang=""ceb"">Másu ang ipusak sa simintung salug,</i><trans> Use a hammer to break up the cement flooring. </trans></eg>
</sense></hom>
<entry><form id=""himuxsak"" lang=""ceb""><abbr expan=""himúsak"" type=""lemma"">hiN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[APN]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> come in <tr>abundance</tr>. </trans>
<eg><i lang=""ceb"">Muhimúsak (muhimusak) na gánì ang ulan, malígù ku,</i><trans> If the rain falls in torrents I’ll bathe in it. </trans></eg>
<eg><i lang=""ceb"">Naghimusak ang búnga sa mga mangga run,</i><trans> Mangoes are <tr>plentiful</tr> now. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for flowers or young fruit to come out. </trans>
<eg><i lang=""ceb"">Ígù lang nakahimusak ang púsù sa mais dihang gidagsángan sa mga dúlun,</i><trans> No sooner had ears of corn <tr>developed</tr>, when the locusts descended on them. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> being <tr>crowded</tr>, <tr>numerous</tr>. </trans>
