INSERT INTO `wced_entry` VALUES (15141, "pusdu", "809", "<entry page=""809"" id=""15141""><form id=""pusduq"" lang=""ceb"">pusdù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A13; c6]</itype><trans> put s.t. down with considerable force. </trans>
<eg><i lang=""ceb"">Ayaw ug ipusdù ang sag-ub arun dì mabuak,</i><trans> Do not put the bamboo water container down hard or it will break. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[bc]</itype><trans> <tr>invest</tr> all of a sum on s.t. </trans>
<eg><i lang=""ceb"">Gipusdù ni Tátay ang íyang ritayirmint ug yútà,</i><trans> Father invested all of his retirement pay on a piece of land.
</trans></eg>
</sense></hom></entry>");
