INSERT INTO `wced_entry` VALUES (15142, "pusgay", "809", "<entry page=""809"" id=""15142""><form id=""pusgay"" lang=""ceb"">pusgay</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A3PB12; c16]</itype><trans> <tr>break</tr> into many pieces, <tr>shatter</tr>. </trans>
<eg><i lang=""ceb"">Napusgay ang búlig paghiantug sa yútà,</i><trans> The coconuts broke off the stem when the whole bunch hit the ground. </trans></eg>
<eg><i lang=""ceb"">Mapusgay na gánì ang kristal, dì na maúlì,</i><trans> Once the glass is shattered, it can’t be repaired. </trans></eg>
<eg><i lang=""ceb"">Nagkapusgay na ang mga simintu sa dáyik,</i><trans> The cement on the dike is slowly crumbling. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[B1256]</itype><trans> for liquid to <tr>splatter</tr> against s.t. </trans>
<eg><i lang=""ceb"">Napusgay ang mga balud sa kabatuan,</i><trans> The waves broke on the rocks. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; c16]</itype><trans> <tr>ruin</tr> one’s reputation, good name. </trans>
<eg><i lang=""ceb"">Tabì nga makapusgay sa kadunggánan,</i><trans> Gossip that can ruin one’s reputation.
</trans></eg>
</sense></hom></entry>");
