INSERT INTO `wced_entry` VALUES (15143, "pusgu", "809", "<entry page=""809"" id=""15143""><form id=""pusguq"" lang=""ceb"">pusgù</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> for sacks to be filled up to the neck so that only a small bit can be gathered at the top to tie. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B2; c16]</itype><trans> for sacks to be filled up with a little part left for tying. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A2]</itype><trans> <tr>hit the jackpot</tr> in business, fishing, or any endeavor. </trans>
<eg><i lang=""ceb"">Ug mupusgù ning ákung bungsud rung tingbungsud mupalit kug dikarga,</i><trans> I’ll buy a cargo truck if I hit the jackpot with my fish corral. </trans></eg>
<eg><i lang=""ceb"">Nikalit nag kasapíang tawhána kay nakapusgù nà siya sa ismagling,</i><trans> He got rich suddenly because he made a killing in smuggling.
</trans></eg>
</sense></hom></entry>");
