INSERT INTO `wced_entry` VALUES (15145, "pusibli", "809", "<entry page=""809"" id=""15145""><form id=""pusibli"" lang=""ceb"">pusibli</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>possibly</tr> happening. </trans>
