<eg><i lang=""ceb"">Mapusibli nga milakaw sila,</i><trans> It may be possible that they went out. </trans></eg>
<eg><i lang=""ceb"">Pusiblíhan ku nga siya mauy mikúhà sa kwarta,</i><trans> To me it’s possible that she stole the money.
