INSERT INTO `wced_entry` VALUES (15160, "puspus", "810", "<entry page=""810"" id=""15160""><form id=""puspus"" lang=""ceb"">puspus</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[AN; b(1)]</itype><trans> <tr>strike</tr> hard with s.t. stiff and long. </trans>
<eg><i lang=""ceb"">Puspúsan ku siyag alhu,</i><trans> I’ll beat him with a pestle. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[c6]</itype><trans> be dashed onto s.t. </trans>
<eg><i lang=""ceb"">Giísa ang sakayan sa balud ug napuspus sa batu,</i><trans> The boat was lifted by a wave and <tr>dashed</tr> onto the rocks. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number> <itype>[B1256]</itype><trans> <tr>fall</tr> heavily. </trans>
<eg><i lang=""ceb"">Nadalispang siyas pálut ságing ug napuspus sa asíras,</i><trans> He slipped on a banana peel and fell to the sidewalk with all his force. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[ABN; a12]</itype><trans> for leaves to be violently <tr>torn</tr> to shreds; cause them to be so. </trans>
<eg><i lang=""ceb"">Mipuspus (namuspus) ang mga dáhun human sa bagyu,</i><trans> The leaves were torn to shreds after the typhoon. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[B2N]</itype><trans> for leaves to <tr>wither</tr> and fall, leaving only the stalk or trunk. </trans>
<eg><i lang=""ceb"">Mupuspus (mamuspus) ang dáhun sa gábi basta magúlang na,</i><trans> The leaves of taro wither when the plant matures. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> club, staff, stick, and the like.
</trans>
</sense></hom></entry>");
