</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> think s.t. is likely to happen. </trans>
</sense></hom>
<entry><form id=""pusta_dirikta"" lang=""ceb""><abbr expan=""pusta"" type=""lemma"">—</abbr> dirikta</form>
<hom>
