INSERT INTO `wced_entry` VALUES (15173, "pusu", "810", "<entry page=""810"" id=""15173""><form id=""puxsuq"" lang=""ceb"">púsù</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>banana blossom</tr> including the petals. </trans>
