<sense n=""2""><number>2</number><trans> s.t. at the very <tr>heart</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>core</tr>, <tr>innermost</tr>; <tr>heart</tr> of the thing. </trans>
