INSERT INTO `wced_entry` VALUES (15176, "pusung", "811", "<entry page=""811"" id=""15176""><form id=""puxsung"" lang=""ceb"">púsung</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> a person who is good in putting up a front of innocence when committing mischief, so called from the character <ix>Huwan Púsung</ix> of folk tales who is always getting the better of people in high places. </trans>
<eg><i lang=""ceb"">Púsung kaáyu siya ug hitsúra mu rag dílì mauy nagtágù sa ákung sapátus,</i><trans> He looks innocent, as if he did not hide my shoes. </trans></eg>
</sense></hom>
<entry><form id=""papusungpuxsung"" lang=""ceb"">papusungpúsung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A1]</itype><trans> pretend to be innocent. </trans>
<eg><i lang=""ceb"">Nagpapusungpúsung siya, mu ra ug walà ku makakità sa íyang gibúhat,</i><trans> He is pretending to be innocent as though I had not seen what he did.
</trans></eg>
</sense></hom></entry></entry>");
