<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b3]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> for chickens to keep squawking, as when laying eggs. </trans>
<eg><i lang=""ceb"">Ayaw ug pakurati ang mungáan kay muputak,</i><trans> Don’t frighten the hen because it will <tr>squawk</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>complain</tr>, talk, or <tr>protest</tr> loudly. </trans>
<eg><i lang=""ceb"">Muputak dáyun siya basta maalkansi sa báhin,</i><trans> She complains loudly right away if she doesn’t get her share. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>nag</tr>, <tr>scold</tr> by babbling. </trans>
<eg><i lang=""ceb"">Milakaw dáyun ang bána dihang giputakan na siya sa íyang asáwa,</i><trans> The husband went out immediately when his wife started to nag him. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[A2]</itype><trans> talk or <tr>butt in</tr> in a conversation which is not one’s business. </trans>
<eg><i lang=""ceb"">Muputak ka man lang bísag wà kay lábut,</i><trans> Why do you butt in when I’m not talking to you?
</trans></eg>
</sense></hom></entry>");
