INSERT INTO `wced_entry` VALUES (15190, "puti", "811", "<entry page=""811"" id=""15190""><form id=""puxti"" lang=""ceb"">púti</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a12]</itype><trans> <tr>break off</tr>, but not with a snap. </trans>
<eg><i lang=""ceb"">Kinsay nagpúti sa gítung sa sundang?</i><trans> Who broke the tongue of the knife? </trans></eg>
<eg><i lang=""ceb"">Napúti ang dágum sa makina,</i><trans> The needle of the sewing machine broke. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AB126; ab4]</itype><trans> <tr>abort</tr> a fetus. </trans>
<eg><i lang=""ceb"">Arun dì mainahan ílang putíhun ang ílang giburus,</i><trans> To escape motherhood they abort the life they are carrying in the womb. </trans></eg>
<eg><i lang=""ceb"">Bag-u nà siyang naputíhan,</i><trans> She just had a <tr>miscarriage</tr>. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> aborted fetus. </trans>
<eg><i lang=""ceb"">Gilábay sa basúra ang púti,</i><trans> They threw the fetus into the garbage.
</trans></eg>
</sense></hom></entry>");
