INSERT INTO `wced_entry` VALUES (15214, "putul", "813", "<entry page=""813"" id=""15214""><form id=""putul"" lang=""ceb"">putul</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a1]</itype><trans> <tr>sever</tr> with a bladed instrument or by snapping. </trans>
<eg><i lang=""ceb"">Dì makaputul ang ákung ngípun sa hílu,</i><trans> My teeth can’t break the thread. </trans></eg>
<eg><i lang=""ceb"">Putlag kaduha arun matulu ka pútù,</i><trans> Cut it twice to make three pieces. </trans></eg>
</sense>
<sense n=""1a""><number>1a</number> <itype>[A; a12]</itype><trans> cut down. </trans>
<eg><i lang=""ceb"">Kinsay nagputul sa mangga?</i><trans> Who cut the mango tree down? </trans></eg>
</sense>
<sense n=""1b""><number>1b</number> <itype>[A; b7]</itype><trans> <tr>cut</tr> s.t. out of s.t. </trans>
<eg><i lang=""ceb"">Ákung giputlan ang pálu kay taas ra,</i><trans> I cut a length from the mast because it was too long. </trans></eg>
</sense>
<sense n=""1c""><number>1c</number> <itype>[A; a]</itype><trans> cut s.t. out of s.t. </trans>
<eg><i lang=""ceb"">Giputul sa sinsur ang mga báhing law-ay,</i><trans> The censors cut out the lewd parts. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; a2]</itype><trans> <tr>break</tr> a connection. </trans>
<eg><i lang=""ceb"">Giputlan mig sugà,</i><trans> Our electricity was cut off. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A12; a]</itype><trans> <tr>cut</tr> s.t. short. </trans>
<eg><i lang=""ceb"">Naputul ang ámung isturya pag-abut sa mga bisíta,</i><trans> Our conversation was cut short by the arrival of the visitors. </trans></eg>
</sense>
<sense n=""3a""><number>3a</number> <itype>[A12; a1]</itype><trans> <tr>put an end to</tr> s.t. </trans>
<eg><i lang=""ceb"">Putlun ku ang ímung ngil-ad nga batásan,</i><trans> I’ll <tr>put a stop to</tr> your bad manners. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> s.t. cut off from s.t. or s.t. which had s.t. cut off of it. </trans>
<eg><i lang=""ceb"">Putul ug íkug ang irù,</i><trans> The dog has a <tr>stubbed</tr> tail. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> the other one of two things which had been cut from one piece. </trans>
<eg><i lang=""ceb"">Háin man ang putul ári?</i><trans> Where is the other piece of this stick that had been cut in two? </trans></eg>
</sense></hom>
<entry><form id=""putul_sa_adlaw"" lang=""ceb""><abbr expan=""putul"" type=""lemma"">—</abbr> sa adlaw</form>
<hom>
<sense n=""0""><trans> half a day. </trans>
</sense></hom></entry>
<entry><form id=""putul_sa_pixkas"" lang=""ceb""><abbr expan=""putul"" type=""lemma"">—</abbr> sa píkas</form>
<hom>
<sense n=""0""><trans> a <tr>quarter</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> s.t. said in cutting in. </trans>
</sense></hom></entry>
<entry><form id=""puxtul"" lang=""ceb""><abbr expan=""pútul"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; c16]</itype><trans> <tr>divide</tr> s.t. into, between two. </trans>
<eg><i lang=""ceb"">Magpútul ta ánang isdà,</i><trans> Let us divide that fish between us. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos></hom></entry>
<entry><form id=""puxtul_ug_tinaxi"" lang=""ceb""><abbr expan=""pútul"" type=""lemma"">—</abbr> ug tinái</form>
<hom>
<sense n=""0""><trans> <tr>sibling</tr>. </trans>
<eg><i lang=""ceb"">Pútul mu ug tinái, búsà ayaw mu pag-áway,</i><trans> You are sisters, so don’t quarrel. </trans></eg>
</sense></hom></entry>
<entry><form id=""putulputul"" lang=""ceb"">putulputul</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a]</itype><trans> <tr>cut</tr> into small pieces. </trans>
</sense></hom></entry>
<entry><form id=""putulpuxtul"" lang=""ceb"">putulpútul</form>
<hom>
<sense n=""0""> <corr><pos>v</pos> </corr><itype>[B16]</itype><trans> be intermittently discontinuous. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>intermittent</tr>, <tr>discontinuous</tr>. </trans>
<eg><i lang=""ceb"">Putulpútul man tung salída nga sikan ran,</i><trans> The second-run movie kept being interrupted. </trans></eg>
</sense></hom></entry>
<entry><form id=""igpuxtul_ug_tinaxi"" lang=""ceb""><abbr expan=""igpútul"" type=""lemma"">ig-(←)</abbr> ug tinái</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>relative</tr>. </trans>
<eg><i lang=""ceb"">Igpútul ku siya ug tinái,</i><trans> She is my relative. </trans></eg>
</sense></hom></entry>
<entry><form id=""kaputul_kapuxtul"" lang=""ceb""><abbr expan=""kaputul"" type=""lemma"">ka-</abbr>, <abbr expan=""kapútul"" type=""lemma"">ka-(←)</abbr></form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> the other half of a piece cut off.
</trans>
</sense></hom></entry></entry>");
