INSERT INTO `wced_entry` VALUES (15219, "putus", "813", "<entry page=""813"" id=""15219""><form id=""putus"" lang=""ceb"">putus</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>wrapper</tr>. </trans>
</sense>
<sense n=""1a""><number>1a</number><trans> membranous <tr>covering</tr> of organs or parts of organs in the body of animals. </trans>
</sense>
<sense n=""2""><number>2</number><trans> small <tr>bundle</tr>, <tr>package</tr>. </trans>
</sense>
<sense n=""3""><number>3</number><trans> male genitalia (humorous). </trans>
<eg><i lang=""ceb"">Mihulma nang putus mu ánang hugut nímung karsúnis,</i><trans> Your pants are so tight they show your genitals. </trans></eg>
</sense>
<sense n=""4""><number>4</number><trans> an infant born wrapped inside a thin membranous covering which must be pinched open to save the infant from suffocating. A baby born in this manner is said to be likely to grow into a strong and quick-tempered adult. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; a]</itype><trans> <tr>wrap</tr> s.t. </trans>
<eg><i lang=""ceb"">Unsa may ímung gipustan (giputus) sa kík?</i><trans> What did you use to wrap the cake? </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[B1245; c1]</itype><trans> be full of or <tr>covered</tr> with. </trans>
<eg><i lang=""ceb"">Naputus ang bátà sa núka,</i><trans> The child is covered with sores. </trans></eg>
<eg><i lang=""ceb"">Pustun tikag haluk,</i><trans> I will <tr>smother</tr> you with kisses. </trans></eg>
</sense></hom>
<entry><form id=""pamutus"" lang=""ceb""><abbr expan=""pamutus"" type=""lemma"">paN-</abbr></form>
<hom>
<sense n=""0""> <itype>[A2]</itype><trans> <tr>pack</tr> up for a journey. </trans>
<eg><i lang=""ceb"">Mamutus na ku pára sa byáhi,</i><trans> I’ll pack up for the trip.
</trans></eg>
</sense></hom></entry></entry>");
