INSERT INTO `wced_entry` VALUES (15222, "putut1", "813", "<entry page=""813"" id=""15222""><form id=""puxtut"" lang=""ceb"">pútut<sub>1</sub></form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> a small <tr>coconut</tr>. </trans>
<eg><i lang=""ceb"">Maáyu pay maglána kag pútut,</i><trans> It is about as easy as extracting coconut oil from the small fruit (i.e. impossible). </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2N; b(1)]</itype><trans> bearing forth small coconuts. </trans>
<eg><i lang=""ceb"">Mipútut (namútut) na ang lubi. Dì na madúgay may butung,</i><trans> The coconut tree has nuts. We’ll have young coconut to eat soon. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A]</itype><trans> for flowers to form <tr>buds</tr>. </trans>
<eg><i lang=""ceb"">Musúgud nag pangalimyun ug mupútut (mamútut) na ang búwak,</i><trans> A flower begins to smell sweet when it begins to form buds. <pb n=""814""/></trans></eg>
</sense></hom>
<entry><form id=""putuxtun"" lang=""ceb""><abbr expan=""putútun"" type=""lemma"">-un</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> young, inexperienced, and uninitiated (literary). </trans>
