INSERT INTO `wced_entry` VALUES (15225, "puu", "814", "<entry page=""814"" id=""15225""><form id=""puxu"" lang=""ceb"">púu</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB12; a1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>exterminate</tr> all things of a certain kind. </trans>
<eg><i lang=""ceb"">Ang iring ray nagpúu sa mga ilagà ning baláya,</i><trans> It was the cat that annihilated the rats in this house. </trans></eg>
<eg><i lang=""ceb"">Nagkapuu na ang tamaraw,</i><trans> The tamaraw is becoming <tr>extinct</tr>. </trans></eg>
<eg><i lang=""ceb"">Puúhan ang syudad sa mga buguy,</i><trans> They will <tr>get rid of</tr> the thugs in the city. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> get rid of completely. </trans>
<eg><i lang=""ceb"">Ngil-ad nga batásan nga ángay puhúun (puúhun),</i><trans> Bad manners that should be gotten rid of. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> <tr>ruin</tr> a business. </trans>
<eg><i lang=""ceb"">Ang ímung pagkasugarul mau ray makapúu sa ímung nigusyu,</i><trans> Your gambling is enough to ruin your business. </trans></eg>
</sense></hom>
<entry><form id=""puuhun_nga_apilyixdu"" lang=""ceb"">puuhun nga apilyídu</form>
<hom>
<sense n=""0""><trans> a family name that is disappearing (because of lack of males).
</trans>
</sense></hom></entry></entry>");
