INSERT INTO `wced_entry` VALUES (15226, "puuk", "814", "<entry page=""814"" id=""15226""><form id=""puxuk"" lang=""ceb"">púuk</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A1; c16]</itype><trans> <tr>cut</tr> s.t. short close to the base. </trans>
<eg><i lang=""ceb"">Ang mga úlud nagpúuk ug putul sa mga turuk nga pugas mais,</i><trans> The worms cut the corn sprouts right down to the ground. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[AP2B2SN; c1P]</itype><trans> drive s.t. so deep that the end is level. </trans>
<eg><i lang=""ceb"">Akuy mupúuk (mupapúuk) ánang lansánga,</i><trans> I’ll <tr>drive</tr> that nail all the way in. </trans></eg>
<eg><i lang=""ceb"">Lisud pag-ibut sa nagpuuk nga lansang,</i><trans> It is difficult to pull out a nail that is <tr>driven</tr> all the way in. </trans></eg>
<eg><i lang=""ceb"">Ákung puúkun (papuúkun, ipapúuk, ipúuk) ang gasulinadur arun kusug ang dágan,</i><trans> I’ll push the gas pedal to the floor to go full speed. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[BN]</itype><trans> for the nits to be right at the roots of the hair. </trans>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>cut</tr> close to the base, <tr>driven</tr> down even with the base. </trans>
</sense></hom>
<entry><form id=""puuk"" lang=""ceb""><abbr expan=""puuk"" type=""lemma"">(→)</abbr></form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> = <xr lang=""ceb"" target=""#puxuk""><sc>púuk</sc></xr>, <i lang=""ceb"">a</i>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> for nits to be located right in the scalp at the base of the hair. </trans>
<eg><i lang=""ceb"">Wà ka katli nga puuk man kaáyu ning ímung mga lusà?</i><trans> Isn’t it itchy? Your nits are right in your scalp. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; b]</itype><trans> <tr>tie</tr>, hold a tethered animal close to the attachment. </trans>
<eg><i lang=""ceb"">Nagpuuk ku sa kábaw sa káhuy arun dì siya makaabut pagkáun sa mga gagmayng lubi,</i><trans> I’m tying the carabao close to the tree so that it can’t reach the small coconut plants. </trans></eg>
<eg><i lang=""ceb"">Ákung puk-an ang irù inig súd ninyu,</i><trans> I’ll hold the dog close to me when you enter the house.
</trans></eg>
</sense></hom></entry></entry>");
