INSERT INTO `wced_entry` VALUES (15227, "puul", "814", "<entry page=""814"" id=""15227""><form id=""puul"" lang=""ceb"">puul</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>boring</tr>, <tr>wearying</tr> by being <tr>dull</tr> and <tr>uninteresting</tr>. </trans>
<eg><i lang=""ceb"">Puul kaáyu ning kinabúhì ug wà kay lingawlingaw,</i><trans> Life is very boring if you have no leisure. </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B12C3; b4(1)]</itype><trans> be, become boring. </trans>
<eg><i lang=""ceb"">Nagkapuul na man ning trabahúa,</i><trans> This work is becoming boring. </trans></eg>
<eg><i lang=""ceb"">Nagpúul na sila kay nag-áway na man,</i><trans> They must be sick of each other because they are already quarrelling. </trans></eg>
<eg><i lang=""ceb"">Wà siya pul-i ug tan-aw sa íyang katahum,</i><trans> He never got <tr>tired</tr> looking at her beauty. </trans></eg>
</sense></hom>
<entry><form id=""pul-axnun"" lang=""ceb"">pul-ánun</form>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> easily <tr>bored</tr>.
