INSERT INTO `wced_entry` VALUES (15229, "puut", "814", "<entry page=""814"" id=""15229""><form id=""puxut"" lang=""ceb"">púut</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>airless</tr>, lacking fresh air. </trans>
<eg><i lang=""ceb"">Púut ning kwartúha kay usa ray bintánà,</i><trans> This room lacks air because it has only one window. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> for gases or some other congesting thing to be s.w. or for a place to be <tr>congested</tr> with s.t. pent up in it. </trans>
<eg><i lang=""ceb"">Púut kaáyu ang asu sa kusína (or Púut sa asu ang kusína),</i><trans> The kitchen is full of smoke. </trans></eg>
<eg><i lang=""ceb"">Púut kaáyu ning ákung ilung sa sip-un,</i><trans> My nose is congested with mucus. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> for an emotion to be <tr>pent up</tr> s.w. or for the breast to have an emotion pent up in it. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B3]</itype><trans> be, become <tr>airless</tr> or having s.t. <tr>pent up</tr> in it. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[A1; c16]</itype><trans> be, become pent up. </trans>
<eg><i lang=""ceb"">Kaguul nga nagpúut sa ákung dughan,</i><trans> Sorrows pent up in my breast. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A; b(1)]</itype><trans> put a dog’s nose into a container filled with burning feathers in order to make it come to hate the smell of chickens. </trans>
<eg><i lang=""ceb"">Puútun ku ning irúa arun dì na manukub ug manuk,</i><trans> I will asphyxiate this dog with burning chicken feathers so it won’t prey on chickens.
</trans></eg>
</sense></hom></entry>");
