INSERT INTO `wced_entry` VALUES (15239, "puyasut", "814", "<entry page=""814"" id=""15239""><form id=""puyasut"" lang=""ceb"">puyasut</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>weak</tr>, <tr>thin</tr>. </trans>
<eg><i lang=""ceb"">Puyasut ug tíngug,</i><trans> <tr>Weak-voiced</tr>. </trans></eg>
<eg><i lang=""ceb"">Puyasut ug láwas,</i><trans> <tr>Thin-bodied</tr>. </trans></eg>
