INSERT INTO `wced_entry` VALUES (15245, "puyit", "815", "<entry page=""815"" id=""15245""><form id=""puyit"" lang=""ceb"">puyit</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> first grade child. </trans>
</sense>
<sense n=""2""><number>2</number><trans> being last in line or coming in <tr>last</tr> in a contest. </trans>
</sense>
<sense n=""3""><number>3</number><trans> <tr>anus</tr>. </trans>
</sense></hom>
<entry><form id=""puyit_sa_anay"" lang=""ceb""><abbr expan=""puyit"" type=""lemma"">—</abbr> sa anay</form>
<hom>
<sense n=""0""><trans> = <xr lang=""ceb"" target=""#lubut_sa_anay""><sc>lubut sa anay</sc></xr>. <ix>see</ix> <xr lang=""ceb"" target=""#lubut""><sc>lubut</sc></xr>. </trans>
</sense>
<sense n=""3a""><number>3a</number><trans> <tr>female genitalia</tr> (euphemism). </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B56]</itype><trans> be, become a <tr>first grader</tr>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B126N; c1]</itype><trans> come out last in a contest, be last in line. </trans>
<eg><i lang=""ceb"">Naúlaw ku kay namuyit ku sa banggà,</i><trans> I was embarrassed because I came out last in the race.
</trans></eg>
</sense></hom></entry></entry>");
