INSERT INTO `wced_entry` VALUES (15246, "puypuy", "815", "<entry page=""815"" id=""15246""><form id=""puypuy"" lang=""ceb"">puypuy</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[B24N; c16]</itype><trans> for the muscles to become weak from fatigue or nervousness. </trans>
<eg><i lang=""ceb"">Mipuypuy (namuypuy) ang ákung mga buktun,</i><trans> My arms grew heavy with <tr>fatigue</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A3P; c16]</itype><trans> <tr>placate</tr>, <tr>calm</tr> s.o. down. </trans>
<eg><i lang=""ceb"">Puypúya (ipuypuy) ang ímung kasukù pinaági sa pagsuruysúruy,</i><trans> Let your anger calm down by taking a walk. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A23P; c1]</itype><trans> <tr>relieve</tr>, <tr>alleviate</tr> pain. </trans>
<eg><i lang=""ceb"">Puypúyun (ipuypuy) sa hílut ang ímung pamául,</i><trans> Massage will relieve your muscle pains. </trans></eg>
</sense></hom>
<hom role=""a""><pos>a</pos>
<sense n=""0""><trans> <tr>weak</tr>, lacking strength. </trans>
<eg><i lang=""ceb"">Puypuy kaáyu ang ákung mga tiil,</i><trans> My legs are very weak.
</trans></eg>
</sense></hom></entry>");
