INSERT INTO `wced_entry` VALUES (15250, "puyu", "816", "<entry page=""816"" id=""15250""><form id=""puxyu"" lang=""ceb"">púyu</form>
<hom role=""n""><pos>n</pos>
<sense n=""1""><number>1</number><trans> <tr>bag</tr>, <tr>sack</tr>, or anything that can be put together at the ends and closed. </trans>
</sense>
<sense n=""2""><number>2</number><trans> <tr>hammock</tr> tied up like a sack to hold a baby. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> make a <ix>púyu</ix>. </trans>
</sense>
<sense n=""2""><number>2</number><trans> put s.t. in a bag or in a hammock. </trans>
<eg><i lang=""ceb"">Puyúha (ipúyu) ang bulingun sa hábul,</i><trans> Wrap the dirty clothing in a sheet. </trans></eg>
<eg><i lang=""ceb"">Puyúha (ipúyu) ang bátà,</i><trans> Put the baby in its hammock.
</trans></eg>
</sense></hom></entry>");
