INSERT INTO `wced_entry` VALUES (15251, "puyu", "816", "<entry page=""816"" id=""15251""><form id=""puyuq"" lang=""ceb"">puyù</form>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A; b3]</itype><trans> <tr>live</tr>, <tr>reside</tr> s.w. </trans>
<eg><i lang=""ceb"">Unsa pay ákung gipuy-an ning kalibutána?</i><trans> What am I in this world for? </trans></eg>
<eg><i lang=""ceb"">Balay nga ákung gipuy-an,</i><trans> The house I am staying in. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[A; b6]</itype><trans> <tr>stay</tr> s.w. </trans>
<eg><i lang=""ceb"">Mupuyù ku sa báy ug dúna kuy trabáhu,</i><trans> I’ll stay home if I have s.t. to do. </trans></eg>
</sense>
<sense n=""3""><number>3</number> <itype>[A]</itype><trans> be, become <tr>still</tr>. </trans>
<eg><i lang=""ceb"">Ug dì ka mupuyù, latiguhun ta ka,</i><trans> If you don’t <tr>keep still</tr>, I’ll whip you. </trans></eg>
</sense>
<sense n=""4""><number>4</number> <itype>[b(1)]</itype><trans> be willing to go to prison just to get s.t. </trans>
<eg><i lang=""ceb"">Puy-an ku ang prisuhan basta lang makabalus ku,</i><trans> I am willing to go to prison just so I can get revenge. </trans></eg>
</sense></hom>
<entry><form id=""puxyuq"" lang=""ceb""><abbr expan=""púyù"" type=""lemma"">(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0"">
<eg><i lang=""ceb"">1</i> <itype>[C2; ac4]</itype><trans> live together with s.o. </trans></eg>
<eg><i lang=""ceb"">Dílì ku makigpúyù ug táwung palaaway,</i><trans> I don’t want to <tr>live with</tr> a quarrelsome person. </trans></eg>
<eg><i lang=""ceb"">Lisud kang igpúyù,</i><trans> You’re a hard person to live with. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <itype>[C; a1c]</itype><trans> <tr>live with</tr> s.o. as husband and wife. </trans>
<eg><i lang=""ceb"">Nagpúyù lang mi ug wà lang pakasal,</i><trans> We just lived as husband and wife and we didn’t get married. </trans></eg>
</sense></hom></entry>
<entry><form id=""puyuqpuxyuq"" lang=""ceb"">puyùpúyù</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>common-law</tr> husband, common-law wife. </trans>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[C; a1c]</itype><trans> live together as common-law spouses. </trans>
</sense></hom></entry>
<entry><form id=""himuyuq_hamuyuq"" lang=""ceb""><abbr expan=""himuyù"" type=""lemma"">hiN-</abbr>/<abbr expan=""hamuyù"" type=""lemma"">haN-</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[B126]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>stay</tr> in a place. </trans>
<eg><i lang=""ceb"">Dì ku mahimuyù sa balay kay pul-an ku,</i><trans> I can’t <tr>hang around</tr> the house because I get bored. </trans></eg>
</sense>
<sense n=""2""><number>2</number> <form id=""dixliq_walaq_himuyuq"" lang=""ceb"">dílì, walà <abbr expan=""himuyù"" type=""lemma"">—</abbr></form><trans> be <tr>restless</tr>. </trans>
<eg><i lang=""ceb"">Walà siya mahimuyù kay dúgayng naulì ang íyang anak,</i><trans> She was restless because her daughter stayed out late. </trans></eg>
</sense></hom></entry>
<entry><form id=""panimuyuq_panimuxyuq"" lang=""ceb""><abbr expan=""panimuyù"" type=""lemma"">paniN-</abbr>, <abbr expan=""panimúyù"" type=""lemma"">paniN-(←)</abbr></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A2; b6]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>reside</tr> and have one’s livelihood in a certain area. </trans>
<eg><i lang=""ceb"">Adtu sila sa Mindanaw manimuyù,</i><trans> They are going to Mindanao to <tr>live</tr>. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> live in a certain style. </trans>
<eg><i lang=""ceb"">Malináwun silang nanimuyù,</i><trans> They live a peaceful life. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> one’s family life. </trans>
<eg><i lang=""ceb"">Ang sugal mauy nakabungkag sa ílang panimuyù,</i><trans> Gambling destroyed their home life. </trans></eg>
</sense></hom></entry>
<entry><form id=""higmuyuq_hagmuyuq_sagmuyuq"" lang=""ceb""><abbr expan=""higmuyù"" type=""lemma"">higN-</abbr>, <abbr expan=""hagmuyù"" type=""lemma"">hagN-</abbr>, <abbr expan=""sagmuyù"" type=""lemma"">sagN-</abbr></form>
<hom>
<sense n=""0""><trans> <ix>see</ix> <xr lang=""ceb"" target=""#sagmuyuq""><sc>sagmuyù</sc></xr>. </trans>
</sense></hom></entry>
<entry><form id=""puy-anan_puluy-axnan_pinuy-anan"" lang=""ceb"">puy-anan, puluy-ánan, pinuy-anan</form>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>residence</tr>, dwelling place. </trans>
</sense></hom></entry>
<entry><form id=""pamuyuq"" lang=""ceb""><abbr expan=""pamuyù"" type=""lemma"">paN-</abbr></form>
<hom>
