INSERT INTO `wced_entry` VALUES (15253, "puyuk1", "816", "<entry page=""816"" id=""15253""><form id=""puyuk"" lang=""ceb"">puyuk<sub>1</sub></form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; ab2]</itype><trans> get a favor or a favorable reaction by saying the right thing. </trans>
<eg><i lang=""ceb"">Gipuyuk nákug kindi ang ákung anak arun magpatupi,</i><trans> I bribed my son with candy so that he would agree to get his hair cut. </trans></eg>
<eg><i lang=""ceb"">Hipuyukan ku sa ákung anak maung milugwag ákung diyísun,</i><trans> My son talked me out of a ten-peso bill.
</trans></eg>
</sense></hom></entry>");
