INSERT INTO `wced_entry` VALUES (15254, "puyung", "816", "<entry page=""816"" id=""15254""><form id=""puxyung"" lang=""ceb"">púyung</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; c1]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>gather</tr> the ends of a sack or bag to <tr>close</tr> it up or take s.t. flat and fold up the ends to put s.t. inside it. </trans>
<eg><i lang=""ceb"">Ákung gipúyung ang mga daplin sa bàbà sa puntil,</i><trans> I closed the sack by gathering the upper edges. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> pull one’s hair back, gathering the ends and tying or clipping them. </trans>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> <tr>clip</tr>, <tr>ribbon</tr>, or the like to hold the ends of gathered hair in place.
</trans>
</sense></hom></entry>");
