INSERT INTO `wced_entry` VALUES (15255, "puyus", "816", "<entry page=""816"" id=""15255""><form id=""puxyus"" lang=""ceb"">púyus</form>
<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[A; a2]</itype><trans> </trans>
</sense>
<sense n=""1""><number>1</number><trans> <tr>carry</tr> s.t. in a piece of cloth or paper by pulling up the edges. </trans>
<eg><i lang=""ceb"">Gipúyus níya ang siriguylas sa íyang sayal,</i><trans> She carried the small fruits in the folds of her skirt. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> carry a child in the womb (humorous). </trans>
<eg><i lang=""ceb"">Nagpúyus na siyag tulu ka búlan pagkasal níya,</i><trans> She was three months <tr>pregnant</tr> when she was married. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> harbor emotions, <tr>rain</tr> (literary). </trans>
<eg><i lang=""ceb"">Dag-um nga hingbug-atan sa gipúyus nga ulan,</i><trans> Clouds weighted down with the rain they were carrying.
</trans></eg>
</sense></hom></entry>");
