INSERT INTO `wced_entry` VALUES (15266, "pwirti", "817", "<entry page=""817"" id=""15266""><form id=""pwirti"" lang=""ceb"">pwirti</form>
<hom>
<sense n=""1""><number>1</number><trans> doing s.t. vigorously, to a great extent, existing in great quantities or being to a great degree. </trans>
<eg><i lang=""ceb"">Pwirting hílak sa bátà,</i><trans> The child cried <tr>hard</tr>. </trans></eg>
<eg><i lang=""ceb"">Pwirting mukáun ning batáa,</i><trans> The child eats a <tr>lot</tr>. </trans></eg>
<eg><i lang=""ceb"">Pwirting mahála sa isdà run,</i><trans> Fish is <tr>terribly</tr> expensive these days. </trans></eg>
<eg><i lang=""ceb"">Pwirting pagkadusmúa sa dyíp sa pusti,</i><trans> How hard the jeep smashed into the post! </trans></eg>
<eg><i lang=""ceb"">Pwirting ulána gahápun,</i><trans> How it rained yesterday! </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> do s.t. very <tr>well</tr>. </trans>
<eg><i lang=""ceb"">Pwirting mubayli si Pidru ug tanggu,</i><trans> Peter dances the tango very well. </trans></eg>
</sense>
<sense n=""2a""><number>2a</number><trans> having s.t. that enhances one’s standing, <tr>terrific</tr>. </trans>
<eg><i lang=""ceb"">Sigúrung madáwat si Míli kay pwirti siya ug rikumindasiyun,</i><trans> Millie will surely get the job because she has terrific recommendations. </trans></eg>
<eg><i lang=""ceb"">Pwirti siyag tútuy,</i><trans> She has <tr>magnificent</tr> breasts.
