<hom role=""v""><pos>v</pos>
<sense n=""0""> <itype>[AB6; c16]</itype><trans> get <tr>bunched up</tr>, <tr>gathered</tr> into folds and <tr>wrinkled</tr>, cause s.t. to become so. </trans>
<eg><i lang=""ceb"">Mupyungkut (mapyungkut) nang ímung buldáhan ug dílì ka mugámit ug bastidur,</i><trans> You are going to sew wrinkles into your embroidery if you don’t use an embroidery frame. </trans></eg>
