INSERT INTO `wced_entry` VALUES (15304, "pyur", "818", "<entry page=""818"" id=""15304""><form id=""pyuxr"" lang=""ceb"">pyúr</form>
<hom role=""a""><pos>a</pos>
<sense n=""1""><number>1</number><trans> <tr>unadulterated</tr>, <tr>pure</tr>. </trans>
<eg><i lang=""ceb"">Pyúr tablíya ang ákung palitun,</i><trans> I’ll buy pure chocolate. </trans></eg>
</sense>
<sense n=""2""><number>2</number><trans> <tr>virgin</tr>, <tr>chaste</tr>. </trans>
<eg><i lang=""ceb"">Pyúr siyang pagkababáyi,</i><trans> She is a virgin. </trans></eg>
</sense>
<sense n=""3""><number>3</number><trans> the <tr>genuine</tr>, unmixed breed. </trans>
<eg><i lang=""ceb"">Pyúr nga danggit,</i><trans> The <tr>genuine</tr> <ix>danggit</ix> fish (not the one that looks similar to it and which may still be so called but is not the real one). </trans></eg>
</sense></hom>
<hom role=""v""><pos>v</pos>
<sense n=""1""><number>1</number> <itype>[A2; c16]</itype><trans> drink liquor <tr>straight</tr>. </trans>
</sense>
<sense n=""2""><number>2</number> <itype>[B126; c1]</itype><trans> be pure, <tr>unmixed</tr>. </trans>
<eg><i lang=""ceb"">Ug mapyúr ang ímung tubà mailhan ku,</i><trans> I can recognize unadulterated toddy. </trans></eg>
</sense></hom>
<hom role=""n""><pos>n</pos>
<sense n=""0""><trans> winning hand in mahjong consisting of only one design.
</trans>
</sense></hom></entry>");
